INSERT INTO `blog` VALUES (1,13,'<p>\r\n	Right now, you are reading the future Champion&#39;s blog post. So watch out, Domination, is coming your way.<img alt=\"\" src=\"http://www.olmec.org/ckeditor/plugins/smiley/images/shades_smile.gif\" title=\"\" /></p>\r\n','Micki McIntosh','2020-08-20 02:36:48',NULL,'ABQ','Listen up!'),(2,6,'<p>\r\n	Welcome to Mr. Daniel Pauk.&nbsp; Doncaster is now the Normal Ninjas.&nbsp;&nbsp;</p>\r\n<p>\r\n	Unfortunately Dan you are paired up against 10 year old Micki and all her mind games in your second match when you host ABQ.&nbsp; Good luck!&nbsp;&nbsp;</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://www.olmec.org/ckeditor/plugins/smiley/images/hiding_behind_a_couch.gif\" title=\"\" /></p>\r\n','Allan Sellers','2020-08-22 03:50:26',NULL,'QRM','Normal Ninjas'),(3,14,'<p>\r\n	Looks like we have drawn Normal this week. Since we have no idea what we are doing, we hope Dan doesn&#39;t either!?</p>\r\n','Mike Cabral','2020-08-29 20:48:00',NULL,'TT','Twisted Normal?'),(118,13,'<p>\r\n	We had a bumpy start, but today is our time to shine! All of my anger is about to come out so if you are going against me in session 3, watch out, cause here I come.</p>\r\n<p>\r\n	You=<img alt=\"\" src=\"http://www.olmec.org/ckeditor/plugins/smiley/images/hiding_behind_a_couch.gif\" title=\"\" /><img alt=\"\" src=\"http://www.olmec.org/ckeditor/plugins/smiley/images/shocked.gif\" title=\"\" /><img alt=\"\" src=\"http://www.olmec.org/ckeditor/plugins/smiley/images/smiley-gen164.gif\" title=\"\" />Me=<img alt=\"\" src=\"http://www.olmec.org/ckeditor/plugins/smiley/images/snoopy.gif\" title=\"\" /><img alt=\"\" src=\"http://www.olmec.org/ckeditor/plugins/smiley/images/shades_smile.gif\" title=\"\" /><img alt=\"\" src=\"http://www.olmec.org/ckeditor/plugins/smiley/images/dancing_banana.gif\" title=\"\" /></p>\r\n','Micki McIntosh','2020-09-05 20:36:28',NULL,'ABQ','This is our turf'),(119,8,'<p>\r\n	Is it just me, or is Micki WAY more intimidating of a manager than Phil&#39;s ever been? Seems like the apple fell way far from the tree here.&nbsp;</p>\r\n','Rob Peterson','2020-09-05 21:59:56',NULL,'AA','Apple vs tree'),(120,6,'<p>\r\n	Burlington, Teutopolis, Sheboygan, and Carlsbad win their groups.</p>\r\n<p>\r\n	Mike Cabral&#39;s Twisters take the top spot in the seeds.&nbsp;&nbsp;</p>\r\n<p>\r\n	Link below to the schedule for the Sweet 16 (played in Session 6) in three weeks time...</p>\r\n<p>\r\n	<a href=\"http://www.olmec.org/tmvl/scoreboard.php?matchnumber=20&amp;status=nospoil&amp;div=all\">WGM Sweet 16 Schedule</a></p>\r\n<p>\r\n	Seeding means home court in this tournament and that&#39;s an advantage.&nbsp; &nbsp;</p>\r\n<p>\r\n	This is also &quot;bracket play&quot; (we need to show the brackets) but looking at the schedule link above the winner of 16/1 and 9/8 play in the Elite 8, and so on...</p>\r\n<p>\r\n	Al</p>\r\n','Allan Sellers','2020-09-06 01:36:26',NULL,'QRM','Spoiler Alert - WGM Results and Sweet 16 Schedule'),(121,5,'<p>\r\n	She gets it from her mom.</p>\r\n','Phil McIntosh','2020-09-08 22:03:58',NULL,'CC','Apple vs. Tree'),(122,15,'<p>\r\n	After trying to manage expectations within his new organization, newly hired Bananas Head Coach Mike Halpin scored two conference wins against Albequerque and Santa Clara. Still, Halpin&#39;s squad met stiff resistance in the form of non-conference opponent St. Charles Scarecrows, although the match ultimately went to a fifth set.</p>\r\n<p>\r\n	Asked about his thoughts on his opening session, Halpin maintained a cautious optimism. &quot;We got a solid core squad on the floor. We&#39;ll have to make up for some lost coaching time, but I&#39;m confident we can serve, hit, and block with the best of the league, and look forward to the rest of our season.&quot;</p>\r\n<p>\r\n	The Bananas also scored a Middle Blocker recruit in Tylin Jefferson.&nbsp;</p>\r\n','Mike Halpin','2020-09-13 01:55:14',NULL,'BRB','HALPIN WITH MIXED RESULTS DURING FIRST SESSION WITH BANANAS'),(123,13,'<p>\r\n	Like I said, you got move it out of my way to victory!!! My hips are literally going side to side, bumping you out of my way. You guys can get front row seats of me winning this league trophy. And I, will crush you.<img alt=\"\" src=\"http://www.olmec.org/ckeditor/plugins/smiley/images/alligator_eating_a_teasing_smiley.gif\" title=\"\" /></p>\r\n','Micki McIntosh','2020-09-19 03:43:25',NULL,'ABQ','You got to move it move it'),(124,15,'<p>\r\n	The Baton Rouge Bananas finished another 2-1 session, bringing them back to 8-8 overall and 5-5 in the Western Conference. Strong performances in each match indicate a possible comeback for the struggling team. The Bananas also took in two recruits, already looking forward to next season.</p>\r\n<p>\r\n	Still, Coach Halpin says he isn&#39;t giving up on his current team, and says his team will put everything into the Western Conference Tournament.&nbsp;</p>\r\n','Mike Halpin','2020-09-25 06:05:24',NULL,'BRB','BANANAS BACK TO .500'),(125,6,'<p>\r\n	Below is an update to the viewer I made to show a letter grade signifying the strength of the player.&nbsp; This uses an algorithm that takes into account their key skills at their given position.&nbsp; This will be added to more pages for next season.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<img alt=\"\" height=\"1526\" src=\"https://www.olmec.org/tmvl/images/Viewer.jpg\" width=\"880\" /></p>\r\n','Allan Sellers','2020-10-21 01:12:32',NULL,'QRM','Viewer Update'),(126,13,'<p>\r\n	Hi guys! Where are all of you? Did you leave because I kept beating you? Well next time I will bring it all I got, and you don&#39;t want to see that do you. I. Will. &nbsp;Bring. You. Down.</p>\r\n<p>\r\n	You=<img alt=\"\" src=\"https://www.olmec.org/ckeditor/plugins/smiley/images/worshipper.gif\" title=\"\" /></p>\r\n<p>\r\n	Me=<img alt=\"\" src=\"https://www.olmec.org/ckeditor/plugins/smiley/images/alligator_eating_a_teasing_smiley.gif\" title=\"\" /></p>\r\n','Micki McIntosh','2020-11-15 01:55:54',NULL,'ABQ','Next time'),(127,2,'<p>\r\n	New coach of Columbia here. I used to play volleyball in PE in school and to be honest it was my favourite of all PE/Games activities. I was one of the shortest boys and couldn&#39;t kick a ball to save my life. But I was the best server in my year (we played in a small gym so I didn&#39;t have to hit it too hard and we had to serve underarm). I was also one of the best diggers. However I couldn&#39;t set very well and certainly couldn&#39;t block or spike. Anyway I&#39;ve read the rules and have a couple of questions.</p>\r\n<p>\r\n	In 6.Strategy: Best pin hitter. What&#39;s this? Is it just the player with the best Attack? Then it says separate good pin hitters from good MB hitters. Different line ups?&nbsp;</p>\r\n<p>\r\n	Setting. Start in Zone 1 for less chance of setter dumps. What&#39;s a setter dump?</p>\r\n','Steve Turner','2021-01-22 17:45:34',NULL,'CFC','Hello all.'),(128,6,'<p>\r\n	Thanks for joining Mr. Turner.&nbsp; Volleyball was ALSO my favorite PE sport.&nbsp; I remember in high school having a lot of PE tournaments and loving it.</p>\r\n<p>\r\n	Onto your questions...</p>\r\n<p>\r\n	If you look at a court from the endline you will see two antenna (aka pins) on the edges of the net (image below).</p>\r\n	\r\n	<img alt=\"\" height=\"400\" src=\"http://www.olmec.org/tmvl/images/s7.png\" width=\"801\" /></p>	\r\n<p>\r\n	The antenna are essentially out of bounds if the ball hits them as they line up with the out line on the floor.&nbsp;&nbsp;</p>\r\n<p>\r\n	Pin hitters are the players who are positioned in the attacking roles so that includes Outside Hitters (OH) and Right Side (RS) positions.&nbsp; The MB players play in the middle and attack but also have a focus on blocking.&nbsp;&nbsp;</p>\r\n<p>\r\n	A setter dump is when the setter sends the ball over on the 2nd contact.&nbsp; A typical play is a pass/dig then set then attack.&nbsp; Sometimes the setter will send the ball over deceptively on the 2nd sequence.&nbsp;&nbsp;</p>\r\n<p>\r\n	This link might help with some of the terminology too:</p>\r\n<p>\r\n	https://www.goldmedalsquared.com/coaching-resources/volleyball-terms</p>\r\n<p>\r\n	Competitive volleyball is way more complex than the PE version we experienced.&nbsp; But it also has a lot of nuances with a focus on positions and skills.</p>\r\n<p>\r\n	Al</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n\r\n<p>\r\n	<img alt=\"\" src=\"http://www.olmec.org/images/s7/png\" /></p>\r\n<p>\r\n	&nbsp;</p>','Allan Sellers','2021-01-23 01:16:33',NULL,'QRM','Reply to Steve....'),(129,2,'<p>\r\n	Yes when I was at school we had the rule (I think universal) that you only scored if you were the serving side. We stood pretty much is set positions and rotated when winning the serve. We were supposed to dig the ball&nbsp; to the setter who passed to one of the attackers.&nbsp;</p>\r\n<p>\r\n	I once realised the server was serving low over the net where I was so just jumped and blocked it back. &quot;Good idea&quot; said the teacher &quot;but we&#39;re supposed to be using all three hits&quot;.&nbsp;</p>\r\n','Steve Turner','2021-01-23 13:44:07',NULL,'CFC','More complicated'),(130,2,'<p>\r\n	Can players play out of position? and if so what is the penalty?</p>\r\n','Steve Turner','2021-01-23 14:26:34',NULL,'CFC','Another question (sorry)'),(131,11,'<p>\r\n	Welcome Steve,</p>\r\n<p>\r\n	I think playing out of position is not possible in this game, since when doing orders you dont get to choose position for the player only area/zon he plays in.</p>\r\n<p>\r\n	The orders page will help you get a legal formation aswell.</p>\r\n','Christer Kallin','2021-01-23 17:44:25',NULL,'SS','OOP'),(132,13,'<p>\r\n	This season will be epic because, of course, I will win. Your probably thinking, &quot;How is a 10 year going to beat me?&quot;. DON&#39;T under estimate me. I am warning you now. So don&#39;t say I did&#39;t warn you.</p>\r\n<p>\r\n	Me-<img alt=\"\" src=\"https://www.olmec.org/ckeditor/plugins/smiley/images/neener_neener_neener.gif\" title=\"\" />&nbsp; &nbsp; &nbsp;You-<img alt=\"\" src=\"https://www.olmec.org/ckeditor/plugins/smiley/images/banging_head.gif\" title=\"\" /></p>\r\n',NULL,'2021-01-24 01:07:40',NULL,'ABQ','Going down (I mean YOU)'),(133,13,'<p>\r\n	This season will be epic because I will beat you. Your prbably thinking, &quot;How will a 10 year old beat me?&quot;. DON&#39;T under estimate me. I am warning you now. So don&#39;t say I didn&#39;t warn.</p>\r\n<p>\r\n	Me-<img alt=\"\" src=\"https://www.olmec.org/ckeditor/plugins/smiley/images/neener_neener_neener.gif\" title=\"\" />&nbsp; &nbsp; &nbsp; You-<img alt=\"\" src=\"https://www.olmec.org/ckeditor/plugins/smiley/images/hiding_behind_a_couch.gif\" title=\"\" /></p>\r\n',NULL,'2021-01-24 01:11:35',NULL,'ABQ','Going down (I mean YOU)'),(134,5,'<p>\r\n	I don&#39;t want to alarm anyone, but Micki is in at her craft table making little dolls and preparing to stick them with pins at appropriate points this season. &nbsp;So far she has a Rob Peterson doll and a John Holden doll. &nbsp;For the Rob Peterson doll, she has him decked out in Jets garb. &nbsp;I told her, &quot;I think he is a Giants fan...&quot;. She laughed maniacally and said....&quot;I know.&quot;</p>\r\n','Phil McIntosh','2021-01-24 01:19:24',NULL,'CC','Voodoo'),(135,2,'<p>\r\n	I have no idea if my team is just bad or my tactics. It probably didn&#39;t help playing Max twice but in games where I thought I played my strongest side I pretty much got thrashed.&nbsp;</p>\r\n','Steve Turner','2021-01-24 04:10:28',NULL,'CFC','First matches our the way'),(136,6,'<p>\r\n	Hi Steve, here&#39;s some analysis in case it is helpful:</p>\r\n<p>\r\n	<strong>vs. St. Charles #1 </strong>- Home game so you start with a real advantage.&nbsp; Max didn&#39;t throw everything at you (A, 2-B, 3-C, 1-D) but Columbia had an uphill battle with 1B, 3C, 1D, and 2F.&nbsp; Three fairly close sets.</p>\r\n<p>\r\n	<strong>vs. Carlsbad </strong>- COL had 3C, 2D, 2F.&nbsp; &nbsp;But Phil had 2B, 3C, 2D.&nbsp; Home court advantage is currently &quot;extra strong&quot;, so that&#39;s where you had some help here.&nbsp; &nbsp;There was likely also some <strong>Olmec Loves Steve Turner</strong> magic at play as well.&nbsp;&nbsp;</p>\r\n<p>\r\n	<strong>vs. Sheboygan</strong> -&nbsp; (Neutral Court) John came to play.&nbsp; All players at A/B level.&nbsp; Your team wasn&#39;t too far behind with the same A/B players and two C players.&nbsp; A couple of close sets, but that&#39;s a match John should win.&nbsp;&nbsp;</p>\r\n<p>\r\n	<strong>vs. St. Charles #2</strong> (Neutral Court) - STC with 2A, 3B, 2C.&nbsp; A pretty good lineup.&nbsp; Fighting Crabs counter with 1A, 3B, 2C, 1D.&nbsp; Scarecrows were still a littler better.&nbsp;</p>\r\n<p>\r\n	I&#39;m probably over focusing on the grades here, but they can tell a tale as they get to the quality of the players on the court.&nbsp; Positions also matter a lot.&nbsp; In that last match against St. Charles the Setter matchup was A- for Max and you had a D- setter.&nbsp; With setters taking that second ball and the quality of that set resulting in positive or negative attacking outcomes that&#39;s a big deal.&nbsp; Because Max knows more about volleyball thank all of us, he has put in algorithms to try to make this as realistic as possible and this is a good example.&nbsp; Your top setter Korben Li rested and when he plays in the next season that will likely more a more positive impact.&nbsp;&nbsp;</p>\r\n<p>\r\n	You elected to spend some CP on FIT this session and that will some of your players for next session.&nbsp; &nbsp;It is still a game of building players through CP so that will no doubt improve things moving forward for the team...</p>\r\n','Allan Sellers','2021-01-24 05:04:38',NULL,'QRM','Follow-Up for Mr. Turner...'),(137,6,'<p>\r\n	The Team Awards feature is now on your team pages.</p>\r\n<p>\r\n	A couple of notes:</p>\r\n<p>\r\n	- Multiple titles awarded for ties for conference (league) titles - so you will see co-champions awarded (just like Big Ten basketball)</p>\r\n<p>\r\n	- Last season&#39;s Grand Championship translates to the going forward National Championship</p>\r\n<p>\r\n	This was done quickly so C-Ball wouldn&#39;t need to tell you in each WGM group match that he is the defending champs!&nbsp; &nbsp;</p>\r\n<p>\r\n	<img alt=\"\" src=\"https://www.olmec.org/ckeditor/plugins/smiley/images/hiding_behind_a_couch.gif\" title=\"\" /></p>\r\n','Allan Sellers','2021-01-27 05:51:43',NULL,'QRM','Team Awards Are Up (just for C-Ball)...'),(138,15,'<p>\r\n	I didnt take the opportunity to say this last season, but thank you Al and Max (and others!) for setting all of this up. It&#39;s a fun distraction during a tough year, and it gets me thinking back to my time playing VB in college.&nbsp; I haven&#39;t played since grad school, when we played pick-up games at the Y.&nbsp; This sport at its highest levels is as graceful as a ballet and as full of power as a boxing match. It&#39;s cerebral, and just pretending to play as a keyboard warrior has been a wonderful time!</p>\r\n','Mike Halpin','2021-01-31 05:12:04',NULL,'BRB','Thanks'),(139,1,'<p>\r\n	We really appreciate the post! This game took a lot of time and effort, so this comment made my day! I am happy you are enjoying it and connecting back to your college days!&nbsp;</p>\r\n<p>\r\n	Thanks for playing!</p>\r\n<p>\r\n	Max</p>\r\n','Max Sellers','2021-02-01 05:02:54',NULL,'STC','Thanks Mr. Halpin'),(140,14,'<p>\r\n	I just noticed Gabe Kotter is in Stage 2 of recruiting. How many here are old enough to remember &quot;Welcome Back, Kotter&quot; on TV? Can Vinnie Barbarino be far behind?</p>\r\n','Mike Cabral','2021-02-07 21:38:42',NULL,'TT','Welcome Back, Welcome Back, Welcome Back?'),(141,4,'<p>\r\n	I think the Swordfish should be allowed to play every game at home with an 80% win rate they would be doing ok. They do not travel well with no wins away or at neutral courts. Something for the team to work on. May need a few tweaks to how we set up away from home.</p>\r\n','Matt White','2021-02-18 14:06:24',NULL,'SDS','Swordfish do not travel'),(142,2,'<p>\r\n	Completely baffled this week.&nbsp; Threw two games. T7 two games. 1-12 in sets.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	Also - in my 4th game (and maybe the 3rd as well) my Libero appears to have played. He has the biggest number in the D (digs ?) column but I didn&#39;t have him down as playing.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	I thought we had the stronger team in game 3 but maybe home court advantage played a part and just the stronger team in game 4 where I hoped home court advantage would see us through. So maybe I just put the players in the wrong positions, in which case I need to look at the game more sometime. Or maybe the curse of Olmec which I don&#39;t mind.</p>\r\n','Steve Turner','2021-02-21 05:26:48',NULL,'CFC','????'),(143,11,'<p>\r\n	I am not sure about how to analyse the matches but it looks as if your team were uneffective in attacks. Or my team goo din defence.<br />\r\n	When you attacked we picked it up and could attack backa and then win the points.</p>\r\n<p>\r\n	But how to change that for next week? I dont know.</p>\r\n<p>\r\n	Looking at the grades your team is stronger than mine. But I am not sure the ratings reflect the player skill accurate.<br />\r\n	I have two 15ATK and one 14ATK players. (rested one in our game).</p>\r\n<p>\r\n	The game is complex and I have not really taken the time to analyze it so much.</p>\r\n<p>\r\n	But homecourt is a big bonua. I have 6-0 at home.</p>','Christer Kallin','2021-02-21 18:58:53',NULL,'SS','Steve'),(144,6,'<p>\r\n	Please see Forum post for additional thoughts - Serve Receive and the RCV Ratings:</p>\r\n<p>\r\n	https://www.olmec.org/tmvl/forum_topic.php?topic_id=16</p>\r\n<p>\r\n	Al</p>\r\n','Allan Sellers','2021-02-21 21:38:04',NULL,'QRM','Questions- Please see Serve Receive and the RCV Ratings Post'),(146,13,'<p>\r\n	Ok, the one blog entrie I messed up. But anyways, all you guys are going down this session. I have a card up my sleeve and I intend to play it. Well, I hope you guys are prepared for what&#39;s about to happen. I will be in first place before you say, superkalafragilisticespeallydocious. Good luck. You&#39;ll need it.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	you=<img alt=\"\" src=\"https://www.olmec.org/ckeditor/plugins/smiley/images/worshipper.gif\" title=\"\" />&nbsp; &nbsp; &nbsp;Me=<img alt=\"\" src=\"https://www.olmec.org/ckeditor/plugins/smiley/images/alligator_eating_a_teasing_smiley.gif\" title=\"\" /></p>\r\n<hr />','Micki McIntosh','2021-03-06 20:44:43',NULL,'ABQ','Hi again'),(147,6,'<p>\r\n	Great to see Ms. McIntosh back on the blog.&nbsp; &nbsp;More please!</p>\r\n<p>\r\n	One question I had personally is WHEN do I get my new allotment of RPs each session.&nbsp; BEFORE...or AFTER recruiting has been processed for a given session.&nbsp; The answer:</p>\r\n<h1>\r\n	AFTER</h1>\r\n<p>\r\n	So if you want to sign that player but are counting on 125 RP above what you see on your team page..don&#39;t.&nbsp; It won&#39;t be there for that session.&nbsp;&nbsp;</p>\r\n<p>\r\n	Example: I have 126 RPs.&nbsp; I&#39;d LOVE to get a Libero this season...I need one!&nbsp; But at 126 I can&#39;t affort David Puddy this session (min 280 RPs).&nbsp; THEN in session 9 I will not be able to afford Kamron Savage.&nbsp; I&#39;ll have 251 RP.&nbsp; He will be a min of 350 RPs.&nbsp; So I&#39;m done with recruiting.&nbsp; It makes no sense for me to spend any more RP on competitive recruiting.&nbsp; I&#39;d be throwing it away.&nbsp;&nbsp;</p>\r\n<p>\r\n	I want to highlight this for you all so you are in the loop on this and spend accordingly (and also look at your &#39;competition&#39; for a player).</p>\r\n<p>\r\n	One thing I&#39;ll add is this about the &quot;Discover Recruits&quot; process.&nbsp; I plan to process this after session 11 (last session with matches).&nbsp; So any RPs you earn through the end of session 11 can be used to get those discovery recruits you couldn&#39;t get in the competitive recruiting we do from sessions 1-9.&nbsp;&nbsp;</p>\r\n<p>\r\n	<img alt=\"\" src=\"https://www.olmec.org/ckeditor/plugins/smiley/images/borg.gif\" title=\"\" /></p>','Allan Sellers','2021-03-08 06:06:14',NULL,'QRM','RPs - WHEN do I get them...Recruiting Strategies within...'),(148,8,'<p>\r\n	Given that you bring a L into a match to serve for one of your MBs, does it stand to reason that you really only need 1 MB with good SRV rating?</p>\r\n','Rob Peterson','2021-03-11 23:06:09',NULL,'AA','MB SRV'),(149,6,'<p>\r\n	How you handle the MB/L serving situation is completely up to you as there can be some different strategies here.</p>\r\n<p>\r\n	For my team , some of my MBs were already strong in SRV so I may have built it up a little but not a lot.&nbsp; At the same time with my Liberos having a lower SRV number, why build it up when the MBs are already better servers.</p>\r\n<p>\r\n	The &quot;con&quot; of that approach is this.&nbsp; When the MB serves, the receiving team can get the ball back over the net to your side on an attack, right?&nbsp; &nbsp;The skill that your team on defense needs is the DEF SL to dig the ball.&nbsp; If the MBs are a 6 and the L&#39;s are a 13 on DEF, guess which one will do better to dig the ball (or allow the opposition to simply get an outright kill).</p>\r\n<p>\r\n	This is definitely a nuanced situation, but it is a choice every match.&nbsp; In our game it would be optimal to have the L serve and be in a better position to dig the ball when it comes back over the net (so building the SRV for L and you already are/should have a high DEF for the L).</p>\r\n<p>\r\n	===========</p>\r\n<p>\r\n	As an aside that pretty much no one cares about except me, Max, and his mom...</p>\r\n<p>\r\n	In the NCAA and NAIA (college in the US)...for the women&#39;s game liberos can serve.&nbsp; In the Men&#39;s game, Liberos can serve ONLY in NAIA (but not NCAA Div I, II, or III).&nbsp; Max plays in NCAA D-III.&nbsp; Max is playing mostly a defensive specialist role this season so he does get to serve (usually subs in for an OH or RS when they move to the back row).&nbsp; But when he gets a chance to play at Libero he won&#39;t be able to serve.&nbsp;&nbsp;</p>\r\n','Allan Sellers','2021-03-12 04:58:39',NULL,'QRM','Strategy Tip -- MB SRV Follow-up'),(150,6,'<p>\r\n	1) Great analysis on the home court situation John.&nbsp; I would have thought 78% on wins but not 53% on points...</p>\r\n<p>\r\n	2) John: tell me more (maybe some design examples) on your bubble watch ideas.&nbsp; Session 8 DID come at us fast and I would have liked to preview who may/may not get in based on earning the National Championship slots...</p>\r\n<p>\r\n	3) Can someone find a photo of Boston Rob, put it on a Sports Illustrated cover and post a headline?&nbsp; Maybe these rankings are a curse for the Anglerfish?</p>\r\n<p>\r\n	4) For the viewer/boxcore type reports should we go further?&nbsp; We show the grade &quot;as if&quot; your FIT is 0.&nbsp; Well if FIT is 2 you are more effective.&nbsp; If it is -2 you &#39;actual&#39; grade is lower.</p>\r\n<p>\r\n	Home court is sort of a built in home team should win all things being equal (at least for now).&nbsp; But what doesn&#39;t show up is the FIT.&nbsp; And you&#39;ve got people like C-Ball over there with the &quot;Damn the Torpedoes, I&#39;m not spending any CP on skills, it all goes on FIT&quot; approach.&nbsp;&nbsp;</p>\r\n<p>\r\n	<img alt=\"\" src=\"https://www.olmec.org/ckeditor/plugins/smiley/images/hiding_behind_a_couch.gif\" title=\"\" /></p>\r\n<p>\r\n	Thank you for the comments/feedback everyone, it is appreciated.</p>\r\n<p>\r\n	Al</p>\r\n','Allan Sellers','2021-03-16 04:32:05',NULL,'QRM','A few quick Comments Wall notes/responses PLUS C-Ball...'),(151,10,'<p>\r\n	I was just thinking of an overall standings page, sorted by whatever criteria you use to sort the best eight teams, and then on the right, a column or check boxes which show how teams qualified (conference winner, conference tourney winner, WGM Cup winner). I know MSWL updates team cup rounds pretty instantly on the team history page, so I was thinking you could reuse that advanced technology</p>\r\n','John Holden','2021-03-16 13:13:32',NULL,'SVB','Bubble watch'),(152,14,'<p>\r\n	Haaaaaaa, now that TEU are&nbsp;<strong>YOUR&nbsp;</strong>WESTERN CONFERENCE TOURNAMENT CHAMPIONS, we will scramble back to skills coaching. We actually didn&#39;t realize how far behind we were on skills coaching until a couple weeks ago. Then we freaked out and got it moving. That said, the allure of trophy bling is still too much to overcome for us. The cabinet looks so nice and shiny with all those cups in there. Even if it comes at the expanse of a &quot;rebuilding year&quot; (trademark, Allan da Commih Sellers). On to coaching our Yutes!</p>\r\n','Mike Cabral','2021-03-16 18:58:03',NULL,'TT','Bling-a-ding-ding!'),(153,6,'<p>\r\n	Thanks for the ideas John.&nbsp; I&#39;ve created a task on my end and will hopefully get something ready for next season.&nbsp; I like your ideas...</p>','Allan Sellers','2021-03-17 02:05:04',NULL,'QRM','Bubble-Watch Update'),(154,3,'<p>\r\n	Al,</p>\r\n<p>\r\n	I like the idea of showing the players skills ratings and Fit scores.&nbsp; Maybe just in the match report, under the diagram of the Net and starting lineups?&nbsp; Maybe a table with Player, Fit, and the 6 skill areas on each player?&nbsp; That might allow managers to both see the impact of Fit on a team as well as better gauge how their top guys are stacking up against other teams&#39; top guys.&nbsp; Why didn&#39;t my best attacker do well?&nbsp; Look at their Blk &amp; Def ratings.&nbsp; Would also let a manager be able to see how the better teams are building rosters and lining up their guys, so they can emulate what successful managers are doing.</p>\r\n','Kevin Martin','2021-03-18 01:23:43',NULL,'NOS','Fit in match reports, please'),(155,10,'<p>\r\n	Any chance of being able to red-shirt recruits?</p>\r\n<p>\r\n	I&#39;m thinking you can redshirt any freshman D+ or lower in skill before the start of each season, they would have to sit out the season and you could only improve each skill once that season, like a Junior. When aging occurs they become a full fledged Freshman.</p>\r\n','John Holden','2021-03-25 16:34:22',NULL,'SVB','Redshirts?'),(156,6,'<p>\r\n	Kevin: I have added to my task list to put in the FIT aspect (and maybe more) per your note in reports.</p>\r\n<p>\r\n	John: Handling Redshirts would require a lot of changes at a basic level to make it work well.&nbsp; Right now we have web and simulator queries that evaluate a roster/team based on a Y/N active field.&nbsp; I think we&#39;d need a third variable like &#39;R&#39; in that equation to make it work and again that&#39;s a change across a lot of areas of the game.&nbsp;&nbsp;</p>\r\n<p>\r\n	Conceptually though I like the idea.&nbsp; I could see where you pickup two OH players, for example but want to offset them by a year...</p>\r\n<p>\r\n	Are you saying though that I could update skills as a Redshirt freshman and then update them as a normal freshman, sophomore, junior after that?</p>\r\n<p>\r\n	I&#39;ve added a task list item to evaluate this for season 4. If you have more ideas, please share...might need a forum post on this to get more ideas and usage...</p>\r\n','Allan Sellers','2021-03-29 03:21:12',NULL,'QRM','Effective Grade & Redshirts'),(157,8,'<p>\r\n	I love the concept (having formerly been a redshirt freshman for my college soccer team), but it does mean we&#39;d have 5th year seniors to work in as well.&nbsp;</p>\r\n','Rob Peterson','2021-03-29 21:12:29',NULL,'AA','Redshirts'),(158,14,'<p>\r\n	With all the discussion of redshirt and 5th years (and March Madness happening right now), I wonder if there also might be a place for transfers in TMVL. The real-life NCAA &quot;transfer portal&quot; is putting lots of players out there, and it&#39;s changing the ways teams are constructed and built year to year. We have recruiting here in TMVL (just like real schools) to gain raw recruits/incoming freshman. I wonder if there would also be a place for transfers -- experienced players from other teams/progtams who become available. Perhaps this could be done with RP spending, just maybe at a different &quot;price level,&quot; due to transfers requiring some recruiting energy, but likely not as much as a from-scratch recruit. Since it is the players themselves who decide to transfe (not the coaches), perhaps there is a randomized process that elects mid to lower level players (but more experienced than real freshman) to enter the transfer process (thinking stars would like stay put with thier existing teams, and it would be rough to randomly lose a star you have built up). Just thinking. Tx, C-Ball</p>\r\n','Mike Cabral','2021-03-30 15:56:16',NULL,'TT','Transfers?'),(159,10,'<p>\r\n	I don&#39;t know why a redshirt wouldn&#39;t just be an Active=N, Year=0 (if the current Years are 1-2-3-4) or Year=-1 (if 0,1,2,3), and use the same CP rules as juniors. But I also didn&#39;t write the code :)</p>\r\n','John Holden','2021-04-02 19:45:36',NULL,'SVB','Redshirts'),(160,2,'<p>\r\n	I wasn&#39;t sure where to post this as there isn&#39;t a team journal kind of thing here.</p>\r\n<p>\r\n	My first season in TMVL is over and despite some early frustration I&#39;ve enjoyed it. I don&#39;t know where my team ranked over all at the start of the season but finishing with a 16-17 record and a bit of silverware seems decent enough for a rookie coach. I appear to have spent more RPs than anyone else and messed up in getting two OH players. At least I will only need to recruit 3 players next season (I think). RP might be a problem, so I&#39;ll check how much I might need by the end of the season.</p>\r\n<p>\r\n	I can see areas for improvement on spending CP. </p>\r\n','Steve Turner','2021-04-05 15:52:32',NULL,'CFC','First season'),(161,16,'<p>\r\n	Considering how little I know what I am doing, not finishing bottom of the league represents auccess.&nbsp; I shall build on this by trying not to finish bottom next season but perhaps that&#39;s asking too much</p>\r\n','Martyn Hathaway','2021-04-06 23:20:33',NULL,'SCC','Santa Clara success'),(162,6,'<p>\r\n	The Viewer and Summary pages for match reports have been updated to include the Effective Grade.</p>\r\n<p>\r\n	Essentially that takes into account any +/- for FIT and the -1 if the away team.</p>\r\n<p>\r\n	Rearranged the page a bit to put the comment entry at top of page as we widened the summary report to use the width of the page.</p>\r\n<p>\r\n	Considering some ideas for a Preview Page and open to ideas on what to put there.</p>\r\n','Allan Sellers','2021-08-19 01:56:22',NULL,'QRM','Match Reports - Viewer and Summary'),(163,15,'<p>\r\n	With a fresh class of recruits, the Baton Rouge Bananas look to build on last year&#39;s successful conference season, while improving their somewhat disappointing tournament play. &quot;We&#39;re a talented team, and have some great team chemistry,&quot; Coach Halpin said. &quot;We just need to put it together for the long game.&quot;</p>\r\n<p>\r\n	An exciting incoming class of freshman look to prove their skills in support of their veteran upperclassmen. Stay tuned for their first big conference matchups against Normal and Burlington.</p>','Mike Halpin','2021-08-19 05:56:25',NULL,'BRB','BANANAS LOOK TO REPEAT AS CONFERENCE CHAMPS'),(164,3,'<p>\r\n	As the only teams starting over 1000 RP, will Schenectady and Burlington bully(frog) their way to the early 5-star recruits?&nbsp; Or will they squirrel away their points for a coveted recruit later on and overpower the rest of us then?</p>\r\n<p>\r\n	The rest of us will have to ration RPs more carefully, particularly those teams that can barely afford to even scout multiple players right now!</p>\r\n<p>\r\n	Should be a very interesting season on the recruiting front, and look nothing like last season&#39;s early free-for-all and multiple 1000+ recruiting bids.</p>\r\n','Kevin Martin','2021-08-20 17:59:28',NULL,'NOS','RP strategies'),(165,11,'<p>\r\n	Remind me here. Does Jereds max +2 rcv in the recruiting mean he will get +2 on his recieving when stars convert to ability?</p>\r\n<p>\r\n	So he is 12-13 instead of 10-11.</p>','Christer Kallin','2021-08-21 02:39:16',NULL,'SS','max +2 rcv'),(166,6,'<p style=\"font-family: &quot;Lucida Grande&quot;, Verdana, Helvetica, Arial, sans-serif; font-size: 13px; border: 0px none; outline: 0px; padding: 0px; margin: 0px 0px 15px; color: rgb(0, 0, 0);\">\r\n	You are absolutely correct Christer.&nbsp; As a 5-star Libero Jared Pruitt will normally be in a 10-11 range for receiving but at the end of season 3 when the actual skill number is assigned he will be either a 12 or 13 for receiving.&nbsp;&nbsp;</p>\r\n','Allan Sellers','2021-08-21 02:46:13',NULL,'QRM','Application of +2 RCV'),(167,13,'<p>\r\n	Hello everyone! Just thought I would stop in and tell you all how my team is doing. They have grown much stronger than last year. So much, in fact, that last session is a distantant memory. In fact, I have so much faith in them that I am naming a new era after them. &quot;The era of Albuquerque&quot;. I wish my opponents good luck this session. You&#39;ll need it.</p>\r\n<p>\r\n	You&lt;<img alt=\"\" src=\"https://www.olmec.org/ckeditor/plugins/smiley/images/hiding_behind_a_couch.gif\" title=\"\" />&nbsp; Me&lt;<img alt=\"\" src=\"https://www.olmec.org/ckeditor/plugins/smiley/images/dancing_banana.gif\" title=\"\" /></p>\r\n','Micki McIntosh','2021-08-21 08:02:52',NULL,'ABQ','Upping my game'),(168,2,'<p>\r\n	I think I&#39;ve forgotten more than I&#39;ve remembered but I&#39;m sure Olmec will help out.</p>\r\n<p>\r\n	BTW has Phil changed his hat for this season?</p>\r\n','Steve Turner','2021-08-21 10:28:31',NULL,'CFC','Orders in'),(169,5,'<p>\r\n	Era of Albuquerque? Where does she get this stuff?<img alt=\"\" src=\"https://www.olmec.org/ckeditor/plugins/smiley/images/shrugging.gif\" title=\"\" /></p>\r\n','Phil McIntosh','2021-08-21 10:31:43',NULL,'CC','???'),(170,8,'<p>\r\n	Expectations are high in Antioch as the fans feel that the team should have won every trophy available last season as they were one of the top 3 team in either conference. The team will not consider it a successful season without some silverware. Expect agressive spiking, taunting, and distractingly high cut shorts (the kind Phil would have worn back in the day). The Anglerfish will eat all competitors this season, sparing no one.&nbsp;</p>\r\n','Rob Peterson','2021-08-21 20:29:44',NULL,'AA','Big Expectations'),(171,6,'<p>\r\n	Max and I saw two bugs we will fix:</p>\r\n<p>\r\n	1. On the CP/RP logs there were some totaling issues.&nbsp; I manually updated the totals for now.&nbsp; Will have a fix for next week.</p>\r\n<p>\r\n	2. On the recruiting page the step 2 recruiting shows the proper check box on what was selected in step 1 (and the proper RP cost).&nbsp; However it may not be showing your logo correctly to the left of all the players.&nbsp; If you have a question or other observation please post or email.&nbsp; This one is more cosmetic from what I can tell and will also be fixed.&nbsp;&nbsp;</p>\r\n','Allan Sellers','2021-08-22 05:03:54',NULL,'QRM','Tracking Two Bugs'),(172,4,'<p>\r\n	Loooking at the recruiting page I showed interest in 2 players which has shown up in the official visit section which is fine. When i ticked the box to make the official visit it has also highlighted the next player down on the list for an official visit, which I do not want. I have tried saving it several times but stays the same. Also this turn I ticked one box in section 1 and it highlighted interest in two players. This will just spend points I do not have any reason why this is happening.</p>\r\n','Matt White','2021-08-22 11:16:30',NULL,'SDS','Recruiting Question'),(173,6,'<p>\r\n	Matt found another issue (data issue) I needed to correct for session 2 - STEP 1.</p>\r\n<p>\r\n	For STEP 2, there was a display bug that I&#39;ve resolved.</p>\r\n<p>\r\n	Please take a look at both sessions and if you spot any anomalies, let me know (email a screenshot and issue).</p>\r\n<p>\r\n	As I said, I believe this is all taken care of now.</p>\r\n','Allan Sellers','2021-08-22 17:16:45',NULL,'QRM','Recruiting Bug Update - Please Review'),(174,4,'<p>\r\n	Allen,</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	All looks fine now. Have you put the extra code in that only lets The Swordfish recruit the top players this year!!!!!!!</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	Regards</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	Matt</p>\r\n','Matt White','2021-08-22 20:40:47',NULL,'SDS','Recruiting Bug'),(175,6,'<p>\r\n	The bugs mentioned around CP, RP, and Recruiting have now been stomped.&nbsp; Please keep an eye out for anomalies and email me after we run session 2.</p>\r\n<p>\r\n	Matt: I&#39;ve added the recruiting code just for you.&nbsp; It could have some bugs though...&nbsp;&nbsp;<img alt=\"\" src=\"https://www.olmec.org/ckeditor/plugins/smiley/images/shades_smile.gif\" title=\"\" /></p>\r\n','Allan Sellers','2021-08-23 02:12:48',NULL,'QRM','Squashed Bugs'),(176,11,'<p>\r\n	The mighty Squirrels have invested in a new teambus. After last session terrible results the players complained they were very tired when arriving at the venue away from home. And with four games away from town (two neutral ground) manager Christer are dissapointed of the late arriving of the new bus. &quot;I ordered it early in off-season but delivery was late due to covid&quot;</p>\r\n','Christer Kallin','2021-08-24 21:52:14',NULL,'SS','New teambus'),(177,6,'<p>\r\n	...that members of this league are not posting memes of Squirrel players throwing Christer &quot;under&quot; the new Team Bus after Session 1.</p>\r\n<p>\r\n	Christer: I&#39;m not sure how well this all translates across the Atlantic but when things go bad here in the USA, people usually throw the coach/manager under the bus.</p>\r\n<p>\r\n	<img alt=\"\" src=\"https://www.olmec.org/ckeditor/plugins/smiley/images/shades_smile.gif\" title=\"\" /><img alt=\"\" src=\"https://www.olmec.org/ckeditor/plugins/smiley/images/devil_winking_smiley.gif\" title=\"\" /></p>\r\n<p>\r\n	<a href=\"https://memegenerator.net/img/instances/58891693/thrown-me-under-the-bus-you-have.jpg\">https://memegenerator.net/img/instances/58891693/thrown-me-under-the-bus-you-have.jpg<br />\r\n	</a></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<a href=\"https://pics.me.me/ieim-not-the-office-you-can-find-me-here-memecrunch-com-50847171.png\">https://pics.me.me/ieim-not-the-office-you-can-find-me-here-memecrunch-com-50847171.png<br />\r\n	</a></p>','Allan Sellers','2021-08-25 04:04:34',NULL,'QRM','Utterly Disappointed...'),(178,15,'<p>\r\n	In their first week of action, the Baton Rouge Bananas took home three victories, including two against conference opponents, Normal and Burlington. The results put the Bananas on top of the conference standings, tied with the Albuquerque Racoons. Solid play from MB Keegan Olson, and superior passing all around, helped keep the starting bunch in control.</p>\r\n<p>\r\n	Although the Bananas has less success in Round 1 of the TMVL Cup, the team held their own against Columbia, keeping the Fighting Crabs within reach and stealing away the fourth set.</p>\r\n<p>\r\n	With plenty of volleyball left to play this season, Coach Halpin remains optimistic about the team&#39;s prospects.&nbsp;&nbsp;</p>\r\n','Mike Halpin','2021-08-25 07:12:15',NULL,'BRB','Baton Rouge off to strong start in conference play'),(179,5,'<p>\r\n	Micki =&gt;&nbsp;<img alt=\"\" src=\"https://www.olmec.org/ckeditor/plugins/smiley/images/smiley-sport021.gif\" title=\"\" /></p>\r\n<p>\r\n	Can&#39;t wait to see outrageous press from Micki Mac.</p>\r\n','Phil McIntosh','2021-08-27 09:49:02',NULL,'CC',''),(180,13,'<p>\r\n	Well, Mr. McIntosh, you also get a red card for argueing with the ref. Anywho, I bet you are cowering over our game this weekend. Even the thought of it probably nausiates you.&nbsp;</p>\r\n<p>\r\n	Phil=&lt;<img alt=\"\" src=\"https://www.olmec.org/ckeditor/plugins/smiley/images/worshipper.gif\" title=\"\" />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Me=&lt;<img alt=\"\" src=\"https://www.olmec.org/ckeditor/plugins/smiley/images/dancing_banana.gif\" title=\"\" /></p>\r\n','Micki McIntosh','2021-08-28 08:45:34',NULL,'ABQ',''),(181,10,'<p>\r\n	I didn&#39;t see the incident involved leading to a red card, but I think everyone involved has earned a red card for posting blogs without a title.</p>\r\n','John Holden','2021-08-30 00:55:13',NULL,'SVB',''),(182,5,'<p>\r\n	But it&#39;s always the second one that gets caught for the card!</p>\r\n','Phil McIntosh','2021-08-30 07:29:03',NULL,'CC','Red'),(183,11,'<p>\r\n	With VAR the first offendent can also get redcarded</p>\r\n','Christer Kallin','2021-08-30 14:37:15',NULL,'SS','VAR'),(184,6,'<p>\r\n	Agreed John on the Blog Subject issue...</p>\r\n<p>\r\n	And agreed John and Christer about a red card?</p>\r\n<p>\r\n	Phil:&nbsp; Did you (please say yes) get a red card in a youth soccer match or something?&nbsp; Is there video?&nbsp; Were you wearing THE hat?</p>\r\n<p>\r\n	<img alt=\"\" src=\"https://www.olmec.org/ckeditor/plugins/smiley/images/hiding_behind_a_couch.gif\" title=\"\" /></p>\r\n','Allan Sellers','2021-09-01 02:27:54',NULL,'QRM','Phil?  Red Card?'),(185,5,'<p>\r\n	The only cards I recall getting in soccer as a coach are gift cards for Dairy Queen a the end of the season for a job well done!</p>\r\n','Phil McIntosh','2021-09-03 11:00:40',NULL,'CC','Enter Title Here'),(186,15,'<p>\r\n	Baton Rouge had a strong performance in conference play last week, putting them at the top of the standings. Unfortunately, though, Mendon was too strong and the Bananas couldn&#39;t come back in any of the three sets against them.</p>\r\n<p>\r\n	With two tough, but winnable home matches ahead, the Bunch are poised to maintain their first place position in the Western Conference, but anything can happen in this league, and Coach Halpin warned his squad not to take anything for granted.</p>\r\n','Mike Halpin','2021-09-04 02:00:20',NULL,'BRB','Mendon Peels Three Sets from the Bananas'),(187,13,'<p>\r\n	If anyone asks, no, I have never rcieved a red card before. But Phil on the other hand... I think he has gotton one once or twice.(From Me<img alt=\"\" src=\"https://www.olmec.org/ckeditor/plugins/smiley/images/grinning_devil.gif\" title=\"\" />)</p>\r\n','Micki McIntosh','2021-09-05 00:54:40',NULL,'ABQ','Put Entry Here'),(188,6,'<p>\r\n	Is there a pattern at Teutopolis?&nbsp; It seems that way.</p>\r\n<p>\r\n	The Twisters have played 10.</p>\r\n<p>\r\n	In 9 of the 10 they have either won or lost in 3 sets only.</p>\r\n<p>\r\n	The lone anomaly was a 3-2 win over Santa Clara in match 2.</p>\r\n<p>\r\n	Is C-Ball leaving XPs on the table this season?&nbsp;&nbsp;<img alt=\"\" src=\"https://www.olmec.org/ckeditor/plugins/smiley/images/shocked.gif\" title=\"\" /></p>\r\n<p>\r\n	Should we be prepared for a one-sided 3-0 loss at Teutopolis in Match 13?&nbsp;&nbsp;<img alt=\"\" src=\"https://www.olmec.org/ckeditor/plugins/smiley/images/worshipper.gif\" title=\"\" /></p>\r\n<p>\r\n	Many questions to answer here...and here&#39;s another question...</p>\r\n<p>\r\n	At 4-0 in neutral site matches does that bode poorly for Mr. Kevin Martin in the T-Town/N&#39;Orleans TMVL Cup clash at the end of session 4?&nbsp;&nbsp;<img alt=\"\" src=\"https://www.olmec.org/ckeditor/plugins/smiley/images/rolling_eyes_up.gif\" title=\"\" /></p>','Allan Sellers','2021-09-05 01:56:13',NULL,'QRM','Pattern at Teutopolis?'),(189,13,'<p>\r\n	Well, we all know that I&#39;m gonna win this weekend, so I&#39;ll spare you the details. Anyway, just wanted you all to know that you are going to get your b*tts kicked this weekend!<img alt=\"\" src=\"https://www.olmec.org/ckeditor/plugins/smiley/images/neener_neener_neener.gif\" title=\"\" /></p>\r\n','Micki McIntosh','2021-09-11 07:55:41',NULL,'ABQ','Hello There'),(190,14,'<p>\r\n	Hey, I hadn&#39;t thought of that, you are stressing me out, Al!</p>\r\n','Mike Cabral','2021-09-11 20:05:41',NULL,'TT','XPs!?'),(191,3,'<p>\r\n	For the 4-0 neutral site jinx, as that stat is now 4-1.&nbsp; The Swamp Rats fear no twister.&nbsp; Hurricanes on the other paw...</p>\r\n','Kevin Martin','2021-09-18 00:40:17',NULL,'NOS','Thanks, Al!'),(192,13,'<p>\r\n	I will.....do my recruiting</p>\r\n<p>\r\n	I will.....do my lineups</p>\r\n<p>\r\n	I will.....harass you</p>\r\n<p>\r\n	I will......annoy you</p>\r\n<p>\r\n	I WILL....BEAT YOU</p>\r\n<p>\r\n	I will.....then have cake after my victory<img alt=\"\" src=\"https://www.olmec.org/ckeditor/plugins/smiley/images/neener_neener_neener.gif\" title=\"\" /></p>\r\n','Micki McIntosh','2021-09-18 03:37:23',NULL,'ABQ','My list of â€œI Willâ€¦â€'),(193,5,'<p>\r\n	You know what they say...</p>\r\n<p>\r\n	&quot;Where there&#39;s a will.....</p>\r\n<p>\r\n	...there&#39;s a way.&quot;</p>\r\n','Phil McIntosh','2021-09-18 09:17:50',NULL,'CC','Will'),(194,5,'<p>\r\n	Or...</p>\r\n<p>\r\n	&quot;Where there&#39;s a will...</p>\r\n<p>\r\n	...I want to be in it...&quot;</p>\r\n','Phil McIntosh','2021-09-18 09:25:55',NULL,'CC','Will'),(200,6,'<p>Trying out a new editor here to see how it goes...</p>\r\n<p>ðŸ¤”</p>','Allan Sellers','2021-09-19 19:39:39',NULL,'QRM','New Editor...'),(202,6,'<p>With the 3-step recruiting system the end of recruiting can catch up on us all.</p>\r\n<p>This session (session 6) is the next to last STEP 1 of the season.&nbsp; &nbsp;So if you don\'t start a recruiting process (Step 1/2) this week, you have one more session to start that.&nbsp; &nbsp;We\'re down to the final players.&nbsp; &nbsp;&nbsp;</p>\r\n<p>Good luck to all! &nbsp; <span style=\"font-size: 14pt;\">ðŸ˜Ž</span></p>','Allan Sellers','2021-09-25 03:17:10',NULL,'QRM','Recruiting - Reminder'),(203,5,'<p>Blog entries are hard because you need a large vocabulary.&nbsp;</p>\r\n<p>But I have the world\'s worst thesaurus. It\'s not just terrible. It\'s....well...terrible.</p>','Phil McIntosh','2021-09-25 10:19:09',NULL,'CC','Blog'),(204,13,'<p>I won\'t...play nice</p>\r\n<p>I won\'t...hold back</p>\r\n<p>I won\'t...lose</p>\r\n<p>I won\'t...be defeated</p>\r\n<p>I won\'t...feal bad for you</p>\r\n<p>I won\'t...show any sympathy whatsoever to Phil</p>','Micki McIntosh','2021-09-25 21:02:42',NULL,'ABQ','My list of â€œI Wonâ€™tâ€¦â€'),(205,11,'<p>Did I really see us winning away???</p>','Christer Kallin','2021-09-26 23:05:15',NULL,'SS','Away win !'),(206,6,'<p style=\"font-family: \'Lucida Grande\', Verdana, Helvetica, Arial, sans-serif; font-size: 14px; border: 0px none; outline: 0px; padding: 0px; margin: 0px 0px 15px; color: #333333; background-color: #ffffff;\"><span style=\"font-size: 14pt;\"><em><strong style=\"font-family: inherit; font-style: inherit; border: 0px none; outline: 0px; padding: 0px; margin: 0px;\">Just a reminder on these that Max has in the rules in case you want to optimize a lineup...</strong></em></span></p>\r\n<p style=\"font-family: \'Lucida Grande\', Verdana, Helvetica, Arial, sans-serif; font-size: 14px; border: 0px none; outline: 0px; padding: 0px; margin: 0px 0px 15px; color: #333333; background-color: #ffffff;\"><strong style=\"font-family: inherit; font-style: inherit; border: 0px none; outline: 0px; padding: 0px; margin: 0px;\">6. Strategy Skill Strategic Tips for starting lineup</strong></p>\r\n<p style=\"font-family: \'Lucida Grande\', Verdana, Helvetica, Arial, sans-serif; font-size: 14px; border: 0px none; outline: 0px; padding: 0px; margin: 0px 0px 15px; color: #333333; background-color: #ffffff;\"><strong style=\"font-family: inherit; font-style: inherit; border: 0px none; outline: 0px; padding: 0px; margin: 0px;\">Serve -&nbsp;</strong>Best Servers possible in the lower number zones.</p>\r\n<p style=\"font-family: \'Lucida Grande\', Verdana, Helvetica, Arial, sans-serif; font-size: 14px; border: 0px none; outline: 0px; padding: 0px; margin: 0px 0px 15px; color: #333333; background-color: #ffffff;\"><strong style=\"font-family: inherit; font-style: inherit; border: 0px none; outline: 0px; padding: 0px; margin: 0px;\">Receive</strong>&nbsp;- Best receiving OH starts at zone I or II</p>\r\n<p style=\"font-family: \'Lucida Grande\', Verdana, Helvetica, Arial, sans-serif; font-size: 14px; border: 0px none; outline: 0px; padding: 0px; margin: 0px 0px 15px; color: #333333; background-color: #ffffff;\"><strong style=\"font-family: inherit; font-style: inherit; border: 0px none; outline: 0px; padding: 0px; margin: 0px;\">Block&nbsp;</strong>- Best MB starting at zone IV or V.</p>\r\n<p style=\"font-family: \'Lucida Grande\', Verdana, Helvetica, Arial, sans-serif; font-size: 14px; border: 0px none; outline: 0px; padding: 0px; margin: 0px 0px 15px; color: #333333; background-color: #ffffff;\"><strong style=\"font-family: inherit; font-style: inherit; border: 0px none; outline: 0px; padding: 0px; margin: 0px;\">Attack</strong>&nbsp;- Best pin hitter (OH or RS) starts at zone IV or V. Separate good pin hitters from good MB hitters.</p>\r\n<p style=\"font-family: \'Lucida Grande\', Verdana, Helvetica, Arial, sans-serif; font-size: 14px; border: 0px none; outline: 0px; padding: 0px; margin: 0px 0px 15px; color: #333333; background-color: #ffffff;\"><strong style=\"font-family: inherit; font-style: inherit; border: 0px none; outline: 0px; padding: 0px; margin: 0px;\">Defense</strong>&nbsp;- Have Liberos serve for a middle for more digging opportunities. Best digging OH starts at zone I or II.</p>\r\n<p style=\"font-family: \'Lucida Grande\', Verdana, Helvetica, Arial, sans-serif; font-size: 14px; border: 0px none; outline: 0px; padding: 0px; margin: 0px 0px 15px; color: #333333; background-color: #ffffff;\"><strong style=\"font-family: inherit; font-style: inherit; border: 0px none; outline: 0px; padding: 0px; margin: 0px;\">Setting</strong>&nbsp;- Start in Zone I for less chance of setter dumps&nbsp;</p>\r\n<p style=\"font-family: \'Lucida Grande\', Verdana, Helvetica, Arial, sans-serif; font-size: 14px; border: 0px none; outline: 0px; padding: 0px; margin: 0px 0px 15px; color: #333333; background-color: #ffffff;\">ðŸ‘</p>','Allan Sellers','2021-10-02 02:56:45',NULL,'QRM','Are there Strategy Tips from The Game Designer?'),(207,13,'<p>Maybe...I should be nice to you</p>\r\n<p>Maybe...I should let you win just to be nice</p>\r\n<p>Maybe...I should stop trash talking</p>\r\n<p>Maybe...I should stop being annoying</p>\r\n<p>Maybe...I should stop picking on Phil</p>\r\n<p>Nah.</p>','Micki McIntosh','2021-10-02 03:05:57',NULL,'ABQ','My list of â€œMaybeâ€¦â€'),(208,13,'<p>Why am I the only one trash talking? There should definitely be more trash talking. The only conclusion that I can up with is that you guys are just to scared to take me on....</p>','Micki McIntosh','2021-10-09 23:41:20',NULL,'ABQ','Mhmmmmm'),(209,5,'<p>Where is JPW when you need him?</p>','Phil McIntosh','2021-10-10 00:28:13',NULL,'CC','Who will challenge Micki in the press?'),(210,13,'<p>I think Phil\'s scared to trash talk me since he\'s volonteering other people.ðŸ§</p>','Micki McIntosh','2021-10-16 20:39:25',NULL,'ABQ','Interesting'),(211,2,'<p>In the early days I didn\'t understand liberos and if mine wasn\'t a great server and wouldn\'t have a substitute for MB ordered.</p>\r\n<p>Having read the algorithm I see that the server can pick out worst receiver and you only have 3: 2 OH and 1 L. If i don\'t pick L replacing MB does this become an ace? Or does the L play anyway?</p>','Steve Turner','2021-10-18 15:59:55',NULL,'CFC','Worst receiver'),(212,6,'<p>I\'m not sure of the best analogy or even word here, but think of your two MB and one L as \"symbiotic\".&nbsp;&nbsp;</p>\r\n<p>For the MBs, when they rotate to the back row, the L plays for them in the back row.</p>\r\n<p>When the L would rotate to the front row the next MB comes into play front row.</p>\r\n<p>The exception is this:</p>\r\n<p>When the MB rotates to the back row to serve, one of two things can happen:</p>\r\n<p>1) The MB serves</p>\r\n<p>2) If your orders indicate the L should serve for one of the MB then that may happen (or the other MB serves)</p>\r\n<p>The advantage of having the L serve versus the MB is this (and I\'ve seen this strategy used in real volleyball)...</p>\r\n<p>When the MB serves (assuming they get it in) they may then need to be in a position to dig an attack from the other team\'s attackers (which would use the MB\'s DEF rating).&nbsp;&nbsp;</p>\r\n<p>When you look up and down your lineup (hey use that cool Javascript sort feature), who has a better DEF rating?&nbsp; The MB or the L?&nbsp; (hint: its the L).&nbsp;&nbsp;</p>\r\n<p>Back to Steve\'s question:</p>\r\n<p>Regardless (or irregardless?) of whether the L or MB serves...once they lose the point, the MB goes out, the L is back in (if they aren\'t already) and we\'re back to the 2 OH and 1 L on serve receive (RCV aka passing).</p>\r\n<p>Yes, the L plays anyway when back to that Steve.&nbsp; Please ask further if I missed something.</p>','Allan Sellers','2021-10-20 02:25:10',NULL,'QRM','Worst Receiver and MB-L combos'),(213,13,'<p>I just wanted to say you all had a great season and.....lets just get to the point. I am determined to win these next 2 games so...warning, Micki will beat you.</p>','Micki McIntosh','2021-10-23 20:12:28',NULL,'ABQ','Well....'),(214,5,'<p>Tip o\' the cowboy hat to Micki. Undisputed press champ thus season in TMVL!</p>','Phil McIntosh','2021-10-23 22:35:32',NULL,'CC',''),(215,8,'<p>Final matches of the season in just under 4 hours... Antioch is REALLY hoping for some good fortune to balance out what has been a rather disappointing season.&nbsp;</p>','Rob Peterson','2021-10-30 21:03:04',NULL,'AA','The Final Countdown'),(216,2,'<p>I play one or two of these games and do best when I plan ahead rather than \"play each game as it comes\". So in SESL (a soccer game coded by our Mr Sellers for those that don\'t know) I do well. I\'ve just taken over a bottom side and rebuilding - this will take two years real time to get competitive in the top division. This season is nearly over but I\'ve already planned next season\'s coaching and spending. The other two similar games are not so good - I play each game.as it comes (well maybe look to see if there\'s a cup game).</p>\r\n<p>However in TMVL I haven\'t planned anything yet. Season 2, my first, I really didn\'t have a clue. I realised just in time about XP so I didn\'t waste CP. But I recruited two good OH when I needed just one and a MB. So the MB turned out to be a walk on 3*.</p>\r\n<p>Then this season I forgot who I\'d recruited and just acted on what I saw each week. My 888 RP 4* OH freshman was forgotten until too late. I wasted 29 CP on him and played just 6 games. My other OH was lucky as he\'s got enough XP for the top five skills. But not enough CP was used. I only realised after session 9 that only OH and L receive and I hadn\'t even used CP there.</p>\r\n<p>Then there\'s Torres. He has 47 XP and I need 50. He played in match 6 (to allow my second best RS to get fit) and then march 22 onwards. All he needed was one more match. I threw the first two away games and he should have played there. But I didn\'t plan ahead&nbsp;</p>\r\n<p>Apart from getting recruiting right I think I\'m set right for this game now. I\'m not saying I\'ll be good at it but at least I know what I\'m trying to do.</p>\r\n<p>So watch out in season 5 (next season is a rebuilding season ðŸ˜‡)</p>\r\n<p>&nbsp;</p>','Steve Turner','2021-11-04 16:59:16',NULL,'CFC','(Bad) planning'),(217,2,'<p>Surely Group 3 is the Group of Death.ðŸ˜</p>','Steve Turner','2021-11-21 22:05:35',NULL,'CFC','William Morgan Cup'),(218,13,'<p>Ok. We all need to have a little chat. The only reason I am playing this season is to give you guys a second chance. The trash talking needs to improve dramatically. You guys are talking like 80 year old men. PLEASE become more exciting. I am literally going to die of boredom. That is not a good thing. ðŸ˜’</p>','Micki McIntosh','2021-11-23 05:48:43',NULL,'ABQ','Chat Time'),(219,9,'<p>Calling us old man for not trash talking.....Can I get an accurate age on Micki before the trash talking starts. LOL&nbsp;&nbsp;</p>','Aires Martins Jr','2021-11-24 14:36:26',NULL,'BB','Micki'),(220,2,'<p>I have a step-daughter about your age so you don\'t scare me young lady. Even if I am the old man of the game.</p>','Steve Turner','2021-11-24 20:35:35',NULL,'CFC','Re: Micki'),(221,8,'<p>Last season ended very poorly for Antioch. For the 3rd straight season, we brought home no silverware, no accolades. We did manage to pull in a gold mine in recruits, so we\'re hoping for a new beginning to this season... that culminates in actually winning something.&nbsp;</p>','Rob Peterson','2021-11-27 21:40:12',NULL,'AA','Every new beginning... '),(222,13,'<p>Ok, first of all, I\'m 11. Second, it\'s pretty sad that I am trash talking better than all of you old people. I also wanted to say that none of you old men scare me one bit. Oh, and by the way Steve, expect me to be way more annoying than your step-daughter.ðŸ˜ˆ</p>','Micki McIntosh','2021-11-27 23:59:49',NULL,'ABQ','Oh Reallyâ€¦.'),(223,2,'<p>Ok a bit younger than my step-daughter so nowhere near as annoying yet.</p>','Steve Turner','2021-11-28 16:31:28',NULL,'CFC','Re: oh really'),(224,2,'<p>Seven teams interested - expect him to go for quite a lot over the minimum bid.</p>','Steve Turner','2021-11-28 16:35:35',NULL,'CFC','William Dorsey'),(225,6,'<p>Steve is spot on.&nbsp; Mr. Dorsey is attracting a lot of attention with Mav Lambert just behind.</p>\r\n<p>Today I listened to the Illinois Women\'s team beat Kentucky (defending National Champs) on the radio.&nbsp; The Illini won AT KENTUCKY (did I mention I\'m an Illinois Alum?) to advance to the Sweet 16.</p>\r\n<p>Anyway, the radio announcers were actually <strong>really</strong> knowledgeable.&nbsp; So knowledgeable that I had to ask Max the meaning of a couple things they said.&nbsp; &nbsp;</p>\r\n<p>The funniest comment though was after Illinois won, the announcer said:</p>\r\n<p>\"The Kentucky Wildcats are suddenly available to hang out with their boyfriends.\"</p>\r\n<p><span style=\"font-size: 18pt;\">ðŸ˜Ž ðŸ™ ðŸ¤”</span></p>','Allan Sellers','2021-12-05 05:55:45',NULL,'QRM','Recruiting and Other things'),(226,13,'<p>This is most definitely not a regular blog post. Because instead of a blog post like Steve\'s, mine actually has trash talking. While a crab is very low on the food chain, a raccoon is much higher on the food chain than a crab. Very often raccoons come by the beach and eat some crabs for a bit of light eating. (They are trying to go on a diet)</p>','Micki McIntosh','2021-12-05 07:29:30',NULL,'ABQ','Just a regular blog post'),(227,16,'<p>Seven games in, all lost, five by 0-3. Not sure that I am really getting to grips with this game</p>','Martyn Hathaway','2021-12-05 22:07:54',NULL,'SCC','Sleeping giant'),(228,2,'<p>&nbsp;</p>\r\n<div id=\"m#msg-a:r2902363539929211003\" class=\"mail-message expanded\" style=\"font-family: sans-serif; font-size: 12.8px;\">\r\n<div class=\"mail-message-header spacer\" style=\"height: 82px;\">&nbsp;</div>\r\n<div class=\"mail-message-content collapsible zoom-normal mail-show-images \" style=\"overflow-wrap: break-word; width: 328px; margin: 16px 0px; user-select: auto;\">\r\n<div class=\"clear\">\r\n<div dir=\"auto\">Well around 50 years anyway. Me and my siblings always had board games as kids and sometime after we moved in 1970 to where my mum still lives we met Owen from up the street. He also liked board games. So much that he bought a magazine that was around those days called Games and Puzzles.\r\n<div dir=\"auto\">&nbsp;</div>\r\n<div dir=\"auto\">I read them and there were often articles about a game called Diplomacy which intrigued me. I found a book in the library about board games and there was a chapter in there also about the game.</div>\r\n<div dir=\"auto\">&nbsp;</div>\r\n<div dir=\"auto\">Jump to the early 80s and somehow I read about postal Diplomacy and magazines (zines) dedicated to playing postally. I managed to get a game in one but the zine folded before the game started. I gave up.</div>\r\n<div dir=\"auto\">&nbsp;</div>\r\n<div dir=\"auto\">Forward to 1987 and I overheard a work colleague and guessed the subject. He was playing postal Diplomacy in a zine called Springboard which he\'d found as flyers were put in the boxes. Springboard was for beginners who had never played postal Diplomacy. I got a&nbsp; couple of games then moved on to other zines. Both of these eventually folded and one of the games was rehoused in Spring Offensive. But by then, 1990, I was in a relationship and let my subscription lapse.</div>\r\n<div dir=\"auto\">&nbsp;</div>\r\n<div dir=\"auto\">Fast forward to 1999 and I\'m single again and decided to get my first PC. I discovered newsgroups and one of these was a Diplomacy one. And in there I found a message that Spring Offensive was now online. I emailed and got a game but suddenly all his games were transferred to Tom Tweedy\'s Diplomacy 2000.&nbsp;</div>\r\n<div dir=\"auto\">&nbsp;</div>\r\n<div dir=\"auto\">Whist there I tinkered with the software that was used to adjudicate the games. Tom used to create maps manually and save them as JPGs. The map that came with the adjudicator was rubbish but I was able to add another much cleaner map that could be saved as a GIF using less memory. This was in dialup days so quite useful. It also meant other GMs could run games and create maps saving Tom a lot of work.</div>\r\n<div dir=\"auto\">&nbsp;</div>\r\n<div dir=\"auto\">I was also able to create variants and this caught the attention of Mike Dean who played on Dip2000 and also ran his own online zine. He wanted me to create variants for his site, Psychopath.</div>\r\n<div dir=\"auto\">&nbsp;</div>\r\n<div dir=\"auto\">Also on Psychopath was Psychos[h]occer ran by Rob of Antioch Anglerfish. I eventually, in 2004, applied for a game. There wasn\'t any easily obviously available rules but the software was there. I could load it into a text program and worked through it finding out how it worked, creating spreadsheets that calculated everything. The beginning of Olmec Steve I guess.</div>\r\n<div dir=\"auto\">&nbsp;</div>\r\n<div dir=\"auto\">A game called MSWL was often mentioned so I looked for that and got on the waiting list. Mark Creasey at SESL and Kev Hull at SaSo saw my name and got me in their games first. I still play in SESL. Then Al gave me a team in MSWL.</div>\r\n<div dir=\"auto\">&nbsp;</div>\r\n<div dir=\"auto\">I left all but MSWL in around 2009 but MSWL also stopped. Al was creating/developing United. I tried but didn\'t get it (or I\'d tried and left before 2009) but joined United 2 later after a proper read of the rules.</div>\r\n<div dir=\"auto\">&nbsp;</div>\r\n<div dir=\"auto\">And of course that led me to here - my favourite so far.</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"mail-message-footer spacer collapsible\" style=\"height: 0px;\">&nbsp;</div>\r\n</div>','Steve Turner','2021-12-06 20:09:51',NULL,'CFC','Olmec Steve - 50 years in the making'),(229,11,'<p>What has happend to the new class of freshmen?<br />From last week to this 17 of them have dropped in grade to F.<br />Why is that?<br />Some of them from grade C to F. A big drop.</p>\r\n<p>At the top of freshmen we have Gibson of Burlington at B. And Douglas of Schenectady at B-.</p>\r\n<p>All those F-grades are a bit funny (=strange)</p>','Christer Kallin','2021-12-07 23:59:53',NULL,'SS','Freshmen not developing in TMVL'),(230,6,'<p>Steve:&nbsp; Great post. It is a lot of fun reading about others backgrounds and how they arrived here, thanks! &nbsp;<span style=\"font-size: 14pt;\">ðŸ˜€</span></p>\r\n<p><span style=\"font-size: 12pt;\">Christer: I had a broken query where for the players that should be an F weren\'t getting the proper grade after session 1 was run.&nbsp; So I had to: 1) Fix the query, 2) Do a manual db update and that has resolved it in advance of session 2.&nbsp; </span></p>\r\n<p><span style=\"font-size: 12pt;\">C was the \"default\" so that\'s why it was appearing (Steve pointed it out to me).&nbsp; The summary is that while it showed your grade higher than it should have been that didn\'t impact your 6 skills which is what the simulator uses.&nbsp; The grades are just there to represent the overall player strength.&nbsp;&nbsp;</span></p>\r\n<p><span style=\"font-size: 12pt;\">And you are quite right, not all freshmen are \"F\", many have some pretty good numbers.</span></p>','Allan Sellers','2021-12-08 02:33:17',NULL,'QRM','Olmec Steve & Christer\'s Question'),(231,15,'<p>I was glad to see Steve put his entry in about himself, and thought it was a pretty good idea to maybe put one in for myself! I don\'t have the 50 years of gaming in that Steve does, but it starts in a similar place. My brother and sister and I were always playing board games as kids, and when I was in high school, I had three or four friends that would get together on a regular basis for them as well. Axis &amp; Allies and Risk were our global dominations games of choice until we, too, discovered Diplomacy. We were amazed you could have a game of conflict and cooperation without having to worry about unlucky dice. We were never quite able to get full seven player games, but just after college I stumbled on Diplomacy2000 where we could play by email online. I believe I may have crossed armies with Steve once or twice there, but I may be misremembering, and the records aren\'t online anymore as far as I can tell. I told Rob Peterson about it. I think he and I and some others tried to get games going while we were roommates in college as well. In return, Rob introduced me to Psychos[h]occer, where I ran the \"American Governors\" football team. (As Al knows, I\'m a bit into politics.) From Psychos[h]occer, I think Rob and I also got into The Paris Tribune, a game of En Garde!, but all that sort of ran its course and I fell away from online board/rpg gaming and stuck to PC and console gaming.</p>\r\n<p>But then Rob pulled me back in! I think he knew I enjoyed soccer online, and knew I played volleyball in college, so it was the perfect fit!</p>\r\n<p>I\'m not the type of coach that can work out the spreadsheet and dig into the algorithms, but it\'s been good to get back into a community like this and just play around with some top level strategy.&nbsp; Thanks to you all for a great couple seasons so far.</p>\r\n<p>&nbsp;</p>','Mike Halpin','2021-12-09 09:08:08',NULL,'BRB','Another Coach Origin Story'),(232,2,'<p>I\'m afraid I don\'t remember the American Governors or most of the other teams. I did a search for Diplomacy 200 and found this: http://www.diplomacy-archive.com/resources/postal/howdoigm.htm which I don\'t remember writing.&nbsp;</p>','Steve Turner','2021-12-09 15:46:48',NULL,'CFC','Mike'),(234,6,'<p>One of the interesting things about the Internet is the \"Wayback Machine\" where you can go to old websites and see what they looked like \"back in the day\". &nbsp;<span style=\"font-size: 14pt;\">ðŸ˜Ž</span></p>\r\n<p>Here\'s a link:</p>\r\n<p>https://web.archive.org/web/20040815073850/http://www.psychozine.co.uk/</p>\r\n<p>I\'m please to confirm that the right honorable Bananas coach is telling the truth!&nbsp;&nbsp;<span style=\"font-size: 14pt;\">ðŸ˜‡</span></p>\r\n<p><span style=\"font-size: 12pt;\">I did cover up emails...</span></p>\r\n<p><img src=\'images/psfa.png\' align=\'left\' alt=\'ball\' width=\'700\'></p>\r\n','Allan Sellers','2021-12-09 22:41:00',NULL,'QRM','Mr. Turner, Halpin, and Peterson...'),(235,15,'<p>I love the Wayback Machine. Here\'s the page from the En Garde! game:&nbsp;&nbsp;https://web.archive.org/web/20040613035608/http://www12.brinkster.com/popinjay/whowwho.htm</p>','Mike Halpin','2021-12-10 03:55:06',NULL,'BRB','Way Way Back. Nostalgia turned up to 11'),(236,3,'<p>Any moment now I\'m expecting Phil to post his origin stories reminding us all of how he pretty much won season 1 of every online game he\'s played.&nbsp; I can\'t remember all of them, and I think half of them may have been back from when the Internet was called ARPANet.&nbsp; He will, of course, need to refresh our collective memories.&nbsp; Looking forward to it!</p>','Kevin Martin','2021-12-10 20:22:21',NULL,'NOS','Awaiting Phil\'s post'),(237,13,'<p>I wonder why Phil has not said anything yet. I think he has just lost his touch. Anyway, I think Steve is trying to avoid me...he seems awfully quiet...I think I have proved my self more annoying than his stepdaughter.ðŸ˜</p>','Micki McIntosh','2021-12-11 08:52:41',NULL,'ABQ','Mhmmmmâ€¦'),(238,5,'<p>It\'s a great story. You\'ll get your money\'s worth on this one. The Inaugural Season of MSWL took place in the early \'90\'s. There was an earlier incarnation of the game, but there were only three or four teams and games were played bi-annually and outcomes determined largely by \"drawing straws.\" THEY (whoever \"they\" are...ok, twist my arm...it was Al Sellers, Jeff Bagby, Jay Patrick Wilkins whom everybody feared because he didn\'t cut his hair for nine years and apparently didn\'t wash it either) wouldn\'t let me play the game. They feared me already. Al had seen my abilities on the tennis court in Champagne, Illinois, and the others feared my analytical skills and press abilities. BUT, when the game got a reboot they welcomed me with open arms. I think there were 8 teams in the league. I remember myself, Al (Memphis PHAY-roads...why Jeff called them that I do not know), JPW (New York Trash Talkers...and his press lived up to the name), Jeff (St. Louis Archies)...there was a manager from Hawaii--Rainer Buschman who had the Screaming Tribesmen and taught me how to say Mele Kalikimaka. We played by snail mail back then, and we would receive the thick packet of results precisely every two weeks.&nbsp;</p>\r\n<p>The key to this whole \"inaugural season\" story is to understand the significance of the \"inaugural season.\" In the inaugural season, everything is equal. The teams, the players, the SL...everything is square. EXCEPT the one single solitary lonely factor that would set the teams apart: MANAGERIAL SKILL. That\'s the only variable, folks.&nbsp;</p>\r\n<p>The season got off to a HORRIBLE start when my starting GK broke his leg the very first session of the season. Out for the year plus a loss of SL for the next season. Now my team was no longer equal. It was clearly subpar. Now I knew I would have to dig deep for extra managerial skill to overcome this newly uneven playing field. Well, folks, it was a long season. &nbsp;Did not win every game. I think I barely won half my games. Jeff\'s SLA team was dominant but Al\'s team was right there with him. My team limped along with two back up GK\'s and just kinda \"hung around to see what happens.\" If I remember right, my team got hot late and won some matches, especially the last one. SLA and MP.squared off in the final match and stumbled their way to a draw when Jeff Bagby\'s star missed a late PK...allowing my team to leapfrog the pack and walk away with the inaugural season title.</p>\r\n<p>MANAGERIAL SKILL...that was the only variable, folks.</p>\r\n<p>(I need to pull out my newsletter from nearly 30 years ago and see how much of that I got right...)</p>','Phil McIntosh','2021-12-11 11:10:17',NULL,'CC','MSWL Origins'),(239,8,'<p>I absolutely love reading everyone\'s orgin stories.&nbsp;</p>\r\n<p>Mine is linked to the esteemed Mr. Halpin\'s, as he related getting our dorm unit into Diplomacy in college. We did play a few games, but not many people\'s hearts were in it like ours were. And then Mike got me into Diplo2000 shortly after college. It was a great game that I enjoyed very much and wished was still running in some fashion. I was never as good as Mike or SteveT because I wasn\'t as underhanded and shrewd as they were. I actually took people at their word, trusted them, and kept my word (largely). But it was a lot of fun.</p>\r\n<p>Around that time, I found the \"MSWL community\" - I\'m not sure if I found MSWL first, or PsychoS[h]occer, but I was on the waitlist for MSWL for a while, but did get into PSFA in it\'s inaugural season. It was a custom version of MSWL run by a guy name Tev or Tal (21 years ago, can\'t remember exactly) - the big differences that I recall were that a number of the multipliers were ratched up (injuries, cards, more types of injuries). I was asked to help run the league after the first season, and took over shortly there after, which is how I got to know Al. I asked a LOT of questions early on about how the simulator ran, and how to handle certain situations. Surprised he put up with me LOL. One of the things I really liked about my time running PSFA was converting all of the statically generated HTML files and turning things into an ASP driven website. There was nothing that anyone ever had to email me, and all results for everything (auctions, matches, off-season stuff) was all processed and posted online. Kids today are probably like, \"well duh, how else would you do it\" but in circa 2002, that was quite the achievement! I was also quite proud of my team, the Boston Mythos - a team built around various mythological figures from Greek, Norse, and Egyptian mythology. I ran PSFA until the Psychozine site itself folded. At that point, I had gotten into MSWL, SESL, TheManager, and probably some other stuff.&nbsp;</p>\r\n<p>Simultaneous with PSFA, as Mike mentioned, we got into TheParisTribune, an En Garde! email based RPG. That game was a lot of fun, was definitely different than any other game I had played till that point, but those all slowly died out over time too. That\'s another game that, if it were to start up, I would play in a heart beat.</p>\r\n<p>Once Al graciously allowed me into MSWL, I really got to know the larger community. I think my team was the Boston Stars there - filled with all American soccer stars from past and (then) present. Sadly, the Boston Stars were about as successful as American soccer to that point.&nbsp;</p>\r\n<p>Then United 1, then United 2... then The Max baseball league (which I would love to see make a resurface at some point hint hint Al!), and now TMVL. Volleyball is my least knowledgable sport, but Al\'s provided some good guides and strategies... I just haven\'t put it all together yet.&nbsp;</p>\r\n<p>There was also eWFL too - an online football simulator. Using real NFL players\' stats, it was VERY in depth, detailed, and required a TON of time to really do well. Eventually, the time required to stay competitive was just too much and I had to step down. Sadly, that league is no longer running either.</p>\r\n<p>Along the way, I\'d dabbled in trying to create my own basketball simulator, using a lot of the principles that\'s made United so successful. I just never had both the time and programming knowledge at the same time to get it really together.&nbsp;</p>\r\n<p>I\'ve been VERY happy about the MSWL community I\'ve found myself in. I know my wife would initially roll her eyes or make fun of me for my \"online nerd friends\" and initially was like, \"who\'s this Al guy?\" but now she just knows it\'s a part of our life LOL. I\'m also happy about the folks I\'ve brought into the community, either directly or indirectly.</p>\r\n<ul>\r\n<li>MikeH - TMVL</li>\r\n<li>MikeC - United, The Max, TMVL</li>\r\n<li>Brent - eWFL</li>\r\n<li>Aires (via Mike) - United, The Max, TMVL</li>\r\n<li>RobB (via Mike) - The Max</li>\r\n<li>Abe (via Mike) - United</li>\r\n</ul>\r\n<p>And we all have Al to thank for this. -- Thank you Al!</p>','Rob Peterson','2021-12-11 21:10:21',NULL,'AA','Both Heroes and Villains have Origin Stories'),(240,3,'<p>Anyone else noticing how the current league leaders are Max and his teammate, Pratham?&nbsp; Maybe the guys currently playing collegiate volleyball know something we don\'t.&nbsp; Perhaps it\'s time to start showing some sincere flattery (i.e. flat-out imitating whatever they do).</p>','Kevin Martin','2021-12-14 03:10:36',NULL,'NOS','League leaders'),(241,13,'<p>I love how Steve is still being quiet. Now I KNOW that I am more annoying than his stepdaughter.ðŸ˜ Anyway, if you haven\'t noticed, I have gone up a rank in the rankings. And I have already recruited a player and am about to get another one. You guys are so going to be surprised when I reveal my plan.*Pauses to laughs evilly* So you dogs keep on chasing your tails and be ablivious to what I am doing.ðŸ¶</p>','Micki McIntosh','2021-12-15 09:05:59',NULL,'ABQ','Ahemâ€¦'),(242,11,'<p>My MSWL history is not that long that others, and long from as successful. I joined with Sheffield in U1 some seasons ago. Not sure exactly but the stats say I have lead them&nbsp; for 626 games now. Then a few seasons after came U1 and then TMVL.</p>\r\n<p>But this is not my first game. I started with a league I cant remember the name of. It was postal and you had to wait for that letter with all results to drop in the mailbox. It must have been in 1996 or so. On the web one of my first leagues was L&amp;AEFL. It had a very interesting twist with known skills and unknown \"talent\" on the players. So you had to figure out why they performed bad or good for you in games. I loved that game. As it foulded Peter Babcock started SAEFL with the same rulesets and the fun continued some seasons more. But it died...</p>\r\n<p>I then tried a few games and am not sure how I ended up here, but I love this game and the community even if its most americans ;-)</p>','Christer Kallin','2021-12-18 02:24:05',NULL,'SS','History'),(243,10,'<p>I don\'t know if Al knows this but I used a version of OLMEC to simulate my own leagues when I was a kid. I had a couple fictional five-division football leagues and OLMEC was the engine - I\'d simulate round by round. I changed tactics and teamsheets annually. Later when SESL had an opening I jumped in there and since completely transitioned to MSWL games.</p>','John Holden','2021-12-18 22:59:52',NULL,'SVB','Origin story'),(244,2,'<p>Nasty cough you have there, Micki.</p>\r\n<p>Sorry for being rude and not replying sooner but I\'ve been rather busy with the run up to Christmas and sorting out my very, very annoying stepdaughter. Unfortunately you are too polite to be annoying but I\'m sure that will change in a couple of years ðŸ˜‡</p>','Steve Turner','2021-12-20 00:09:21',NULL,'CFC','re: Ahem'),(245,13,'<p>Thanks for saying I am polite, but in this case I am offended. And I also noticed that you have no recruited players so far. That\'s sad Steve. Just plain sad. What do you have to say for yourself? I think crabs put themselves in self-isolation for too long. They all have become hermit crabs. Who brings presents to young crabs? Santa claws!</p>','Micki McIntosh','2021-12-20 05:40:34',NULL,'ABQ','Oh Steve...'),(246,2,'<p>We have one if those countdown to Christmas things with two wooden blocks that you arrange to show numbers from 24 (assuming you start on Dec 1st) to 1. One idle day when I wasn\'t trying to work out how to beat the Raccoons on Jan 22nd I wondered how it was done.</p>\r\n<p>Two cubes have 12 faces. You need all the numbers from 0 to 9. You need two 1s to show 11 and two 2s for 22. You also need two 0s for 01 to 09 as you can\'t get 1 to 9 on one block. 0 to 9 is 10 faces plus extra 0, 1 and 2 makes 13.&nbsp;</p>\r\n<p>So how do you get the 13 numbers on two cubes?</p>','Steve Turner','2021-12-20 17:46:32',NULL,'CFC','Christmas Puzzle'),(247,3,'<p>You never need 6 &amp; 9 at the same time.&nbsp; Turn it upside down to get one or the other as needed.</p>','Kevin Martin','2021-12-23 03:04:37',NULL,'NOS','Christmas Puzzle'),(248,13,'<p>I hope everyone gets their Christmas wish! (Except the people going against me. They will never win those matches against ABQ.)ðŸ˜œ</p>','Micki McIntosh','2021-12-25 04:11:12',NULL,'ABQ',' Merry Christmas'),(249,2,'<p>It\'s a few minutes past 2021&nbsp; here in the UK and I\'m still awake and sober so I\'d like to wish every one here a very Happy New Year&nbsp;</p>','Steve Turner','2022-01-01 05:18:28',NULL,'CFC','Happy New Year'),(250,13,'<p>I just wanted to stop by and say that anyone who is going against me this weekend is going to get their bu** kicked.ðŸ˜ˆ</p>','Micki McIntosh','2022-01-08 08:56:48',NULL,'ABQ','Helloâ€¦.'),(251,8,'<p>For all the butt-kicking Micki is always boasting about, I sure am glad Antioch doesn\'t play Albuquerque very much!</p>','Rob Peterson','2022-01-08 21:42:15',NULL,'AA','Trash Pandas'),(252,6,'<p><span style=\"font-size: 12pt;\">The Player pages should now have all the stats updates (separated by offensive and defensive).</span></p>\r\n<p><span style=\"font-size: 12pt;\">I\'ve also revamped the main Stats link at the top menu and added:</span></p>\r\n<ul>\r\n<li><span style=\"font-size: 12pt;\">Player Offensive Stats by Season&nbsp;</span></li>\r\n<li><span style=\"font-size: 12pt;\">Player Defensive Stats by Season&nbsp;</span></li>\r\n<li><span style=\"font-size: 12pt;\">Player Offensive Stats by Match&nbsp;</span></li>\r\n<li><span style=\"font-size: 12pt;\">Player Defensive Stats by Match&nbsp;</span></li>\r\n</ul>\r\n\r\n<p><span style=\"font-size: 12pt;\">All of this includes the newer stat categories we added in season 3.&nbsp;&nbsp;</span></p>\r\n<p><span style=\"font-size: 12pt;\">Now that I think we have some good visibility one of the next areas Max and I thought about doing was adding something like a \"Top 5 Offensive Players of the Week\" and&nbsp;</span><span style=\"font-size: 12pt;\">\"Top 5 Defensive Players of the Week\"</span><span style=\"font-size: 12pt;\"> .</span></p>\r\n<p><span style=\"font-size: 12pt;\">This would also then have a </span><span style=\"font-size: 12pt;\">\"Offensive Player of the Week\" and </span><span style=\"font-size: 12pt;\">\"Defensive Player of the Week\"</span><span style=\"font-size: 12pt;\"> type honor.&nbsp;&nbsp;</span></p>\r\n<p><span style=\"font-size: 12pt;\">Two final points on stats:</span></p>\r\n<ol>\r\n<li><span style=\"font-size: 12pt;\">If you can think of other interesting stats we\'re not tracking or we are tracking but not showing please call those out.&nbsp;&nbsp;</span></li>\r\n<li><span style=\"font-size: 12pt;\">There is a bug with the OH players when they set.&nbsp; The bug is we aren\'t counting ALL of their setting attempts.&nbsp; So their \"pct\" of successful sets that become assists are inflated a bit.&nbsp; We\'ll fix that one soon I hope.</span></li>\r\n</ol>','Allan Sellers','2022-01-11 23:06:43',NULL,'QRM','Player Stats Update'),(253,13,'<p>I think I am going bannas. That loss was just plain sad. *sigh* Well, at least I beat the cowering Cameleons!</p>','Micki McIntosh','2022-01-13 08:18:20',NULL,'ABQ','Haha'),(254,2,'<p>So I need three more recruits but can only afford two. I have the libero as the other two teams have their four already so he\'s mine for 350 RP. That leaves me with 626 RP next session after paying for the libero visit.</p>\r\n<p>So do I:</p>\r\n<p>1. Cancel the visits for the OH and MB this session and have all 626 to bid on the MB. If that fails I\'m stuck with two recruits.</p>\r\n<p>2. Arrange visits for both and then only have 576 RP for this session\'s MB. At least then I\'ll have the chance of with in session 9.</p>\r\n<p>3. Just arrange for the OH (more important I reckon).</p>','Steve Turner','2022-01-16 15:36:13',NULL,'CFC','Choices'),(255,2,'<p>When I realised Columbia was likely to be the only team recruiting Jeremy Payne next session I had to make sure we\'d have enough RP for him. Hence the bid we made. I suppose I could have withdrawn the visit of Dominic Hunter and bid 25k more but I wasn\'t risking any more than that.</p>\r\n<p>I\'ve looked at all the other teams and reckon that Hunter is wanted by all five teams. Unfortunately we can only afford 576 RP and I\'m sure he\'ll go for more than that. In fact I know he will because I like to cause a bit of mischief when I can.</p>\r\n<p>Pineda on the other hand is really only needed by us and the Ninjas (I think). Will Pratham bid 577 RP? Will it be enough.</p>\r\n<p>After all we need an OH and an MB more than we need an L.</p>','Steve Turner','2022-01-17 03:09:49',NULL,'CFC','Recruiting and tactical bidding'),(256,15,'<p>Al,</p>\r\n<p>Could you go over again how end of season recruiting will work for this season? I\'ve read through the rules, but am not clear on how it will work.</p>\r\n<p>Thanks,</p>\r\n<p>Mike</p>','Mike Halpin','2022-01-17 06:54:10',NULL,'BRB','End of Season Recruiting for Season 4'),(257,6,'<p>Micki: Does your dad withdraw from your allowance if the ABQ defeats the Chameleons?</p>\r\n<p>Steve: I love the bidding updates and all the mischief!&nbsp; :-)</p>\r\n<p>Mike: Forum post added.&nbsp; Please ask any follow-on questions for anything I missed.</p>','Allan Sellers','2022-01-18 04:58:41',NULL,'QRM','Micki, Steve, and Mike H'),(258,13,'<p>To my fathers sadness, no, my mom won\'t let him take any money from my bank account. Anyway, its been a long time since I\'ve trash talked, here it goes. Honestly, you all are going to loose against me. Okay. Thats all I have to say.</p>','Micki McIntosh','2022-01-22 08:22:55',NULL,'ABQ','Re:Micki'),(259,2,'<p>You <strong><em>might</em></strong><em> </em>have a chace against us today because I <em><strong>might </strong></em>need to concentrate on gaining XP for my younger players.</p>','Steve Turner','2022-01-22 13:25:26',NULL,'CFC','Micki'),(260,6,'<p>With 4 (FOUR) recruits in competitive recruiting, Micki has ABQ looking good for next season.&nbsp; Her signings:</p>\r\n<p>1) Check all the boxes for graduating seniors</p>\r\n<p>2) Include one 5-star and THREE 4-stars</p>\r\n<p>3) Put the Raccoons to be on the map to build if they focus on growing each of these players next season...</p>','Allan Sellers','2022-01-23 05:43:58',NULL,'QRM','Recruiting (Spoiler)'),(261,9,'<p>Very Excited to announce that the Bullfrogs pulled in two 5 star recruits for next year!&nbsp; Future is looking bright</p>','Aires Martins Jr','2022-01-26 13:23:08',NULL,'BB','Burlington '),(262,2,'<p>Or does anyone else change their orders several times? Saturday or Sunday I enter preliminary orders, setter at I, outside hitter at II etc. picking T7 if I want (like last weekend versus Sheboygan). I do this for two reasons: 1. well you never know I might not get back to the keyboard/phone so wont NMR and 2. it avoids being called out by Al.</p>\r\n<p>Then I start swapping a few players, especialy now where I\'m trying to maximise XP gains. And then it\'s a bit of fine tuning - do I want my best blocker at IV so he\'s at the net longer even though he\'s one of my best servers - if so where does the setter go?. Do I want my rubbish attack middle blocker next to my setter in case it\'s a pass (3) while the latter is at the net.</p>\r\n<p>I just wish I could tweak my recuiting better ðŸ˜„</p>','Steve Turner','2022-01-29 04:48:46',NULL,'CFC','Is it just me?'),(263,15,'<p>Definitely not just you. I do a snap set of orders just to make sure I have something in. Then I go back two or three times during the week and reevaluate.</p>','Mike Halpin','2022-01-29 07:23:58',NULL,'BRB','Not Just You'),(264,13,'<p>Well, you all may now call me the best recruiter because I am and always will be. So basically <em><strong>Fear me!!!</strong></em></p>','Micki McIntosh','2022-01-29 22:14:13',NULL,'ABQ','Going down (I mean YOU)'),(265,4,'<p>Looks like the Bullfrogs and the Swordfish are playing a best of three games series at the end of this season as we play them for our last three games.</p>\r\n<p>Will they all turn out to be 5 set thrillers like the first game???</p>','Matt White','2022-01-31 20:50:29',NULL,'SDS','Best of Three'),(266,2,'<p>Because I knew we were expanding (but not when) I thought I\'d try and write some articles about how to play (not how to win) TMVL, especially for those who aren\'t sure if they want to play, but also for coaches like me who didn\'t know what was going off half the time.</p>\r\n<p>According to Guinness World records, the word with the most entries in the Oxford English dictionary is \"set\". I actually knew this but it\'s a right pain when trying to write this stuff.&nbsp;</p>\r\n<p>When your OH receives the serve he tries to pass to your Setter but if the serve was good and the OH didn\'t do a good job it might go to the Libero instead. So when I\'m mentioning that if the setter is at the net he might attack rather than set I\'m having to distinguish between the Setter and the setter who might be the Libero.</p>\r\n<p>Then of course there is the setter\'s set skill which determines the set rating when he sets the attacker which determines blocking and attacking.</p>','Steve Turner','2022-02-14 17:54:38',NULL,'CFC','Who came up with this terminology'),(267,2,'<p>We play the best of 5 sets...</p>','Steve Turner','2022-02-14 18:00:03',NULL,'CFC','Oh and I forgot'),(268,5,'<p>Was Mr. Sellers holding out on us? Did he intentionally save all the cool team names for the second wave of managers? I mean, c\'mon, man. Denali is cool no matter what the mascot. But add to that the Bloodhounds, Red Pandas, Pekin Peas (who are, I might add, actually peakin\' in their team logo). We are already preparing our litigation for copyright infringement against San Jose. Teams will forever be confused by the identical nature of the two designs and color schemes, which the league office no doubt did purposefully and to cause irreparable harm. To my team.&nbsp;</p>\r\n<p>Now, for the rest of this practice session I will practice wearing my hat.</p>','Phil McIntosh','2022-03-05 22:05:01',NULL,'CC','Team Names'),(269,5,'<p>...and why did Al name a team \"Shamrocks?\" Could we not find any real rocks?</p>','Phil McIntosh','2022-03-05 22:13:20',NULL,'CC','Team Names...cont\'d'),(270,13,'<p>Well, to begin, I\'m Micki McIntosh. I may be young, but I come with a kick. You can ask Steve Turner about that.ðŸ˜ Anyway, you rookies better watch out because I am going to dominate this league! So in the end I am really just saying,&nbsp;<em>FEAR ME!!!</em></p>','Micki McIntosh','2022-03-05 22:14:39',NULL,'ABQ','Attention all rookies!'),(271,5,'<p><img src=\"data:image/jpeg;base64,\" alt=\"Hanna- Barbera\'s Snagglepuss | Favorite cartoon character, Cartoon, Old  cartoons\" /></p>','Phil McIntosh','2022-03-05 22:24:13',NULL,'CC','Starkville Mascot Reminds Me of Sat a.m. Cartoons as a Kid..'),(272,22,'',NULL,'2022-03-06 06:02:47',NULL,'NRP','Sat Morning TV'),(273,4,'<p>Looking forward to the new season and hopefully a mining season for the swordfish. Looking at some of the new squad it is not going to be a walk over. Need to get my head around recuitng yet so must do better this go around.&nbsp;</p>','Matt White','2022-03-07 01:11:58',NULL,'SDS','Looking forward'),(274,22,'<p>Google Chrome did not open the Blog entry option so the Pandas have turned to the Firefox to open up the box.</p>\r\n<p>I am curious where my profile picture came from though as it\'s not a photo I\'m using on any of the SOS or Olmec sites.</p>\r\n<p>If I remember I\'m going to get my old school yearbook out when I visit my parents tomorrow to see if I can use a photo taken in college.</p>','Roy Rolsten','2022-03-08 07:04:19',NULL,'NRP','Pandas Turn to Firefox'),(275,6,'<p>...guilty as charged.&nbsp; Found that one on Facebook.&nbsp; I wanted to lend some class to the website to offset all the Phil McIntosh hats...ðŸ˜ŽðŸ¤ </p>','Allan Sellers','2022-03-09 05:20:02',NULL,'QRM','Sorry Roy...'),(276,6,'<p><strong>All Managers: </strong>Yes, \"rookies\" beware of Phil\'s daughter Micki and the Raccoons...</p>\r\n<p><strong>Phil:</strong> Yes, we intentionally kept you from getting a cool team name/logo.&nbsp;&nbsp;</p>\r\n<p>Matt: Yes, and good luck!</p>','Allan Sellers','2022-03-10 05:27:47',NULL,'QRM','BLOG MISC'),(277,11,'<p>I cant see why Phil is concerned that San Joses logo is similar to Carlsbads. Carlsbad can not loose anything by that. San Jose on the other hand have a case here.</p>','Christer Kallin','2022-03-10 23:59:17',NULL,'SS','San Jose/Calsbad logo'),(278,28,'<p>Just who do these carlsbad critters think they are trying to impersonate the town of a million shrimps. get back to your poxy little backwater swamp we say and prey you don\'t have to meet the shrimps anytime soon!</p>','Vick Hall','2022-03-12 01:55:49',NULL,'SJS','karma karma karma chameleon'),(279,13,'<p>When I look at the new team names, here\'s what I see on a few of them:</p>\r\n<p>The Kentucky Fried Kittens</p>\r\n<p>The Ames Choking Artechokes</p>\r\n<p>The Arlington Antbeaters</p>\r\n<p>The Manitowok Gargling Gargoyles</p>\r\n<p>And The Tuscan Fighting Saggypants</p>','Micki McIntosh','2022-03-12 10:03:23',NULL,'ABQ','Team names'),(280,20,'<p>...or does a certain TMVL manager look a bit like an older version of The Killers very own Brandon Flowers?!? ðŸ˜†</p>\r\n<p>Who could I possibly be referring to?!</p>\r\n<p>Answers on a postcard....</p>\r\n<p>(Hope this works.....)</p>\r\n<p><img class=\"rg_i Q4LuWd\" src=\"data:image/jpeg;base64,\" alt=\"Pin on Smile Like You Mean It\" width=\"322\" height=\"158\" data-deferred=\"1\" data-atf=\"true\" data-iml=\"1252\" /></p>','Craig Bucknall','2022-03-12 23:49:35',NULL,'DAL','Is It Me....'),(281,27,'<p>Hi everyone, good to see some familiar names from other Olmec games, and nice to meet everyone else.</p>\r\n<p>Looking forward to getting started and as a newbie to the game of volleyball its been interesting watching a few videos and learning a bit of the game over the past couple of weeks.&nbsp; I had no idea it was such a popular sport.&nbsp;&nbsp;</p>\r\n<p>I played a little volleyball at school but this was 25 years ago and I was truly awful at it - my experience of playing any sport at school is if you werent talented you just got shouted at a lot rather than being taught anything that might help!</p>\r\n<p>Good luck everyone!&nbsp;&nbsp;</p>\r\n<p>&nbsp;</p>','David Campbell','2022-03-13 01:33:44',NULL,'ARL','Hello'),(282,2,'<p>In my opinion the best way to check your results is through the Viewer. Just above the row of matches it days Session 1 Match 1 Match 2 etc. Click on match 1 and select viewer for your game here. You can pause, speed up.or slow it down. You can see both line ups here and see if you have a chance based on the ratings shown. Viewer only gives the server and who made the final kill/error.</p>\r\n<p>The other two are Summary and Report. I could have these the wrong way round but I think Report gives you stats from the game. Surprised you lost? Maybe your weaker OH hit too many errors.&nbsp; The header for each stat has a tool tip if you mouse over that explains what the stat is. If you use a phone or tablet and can\'t guess then ask away.</p>\r\n<p>Summary is a hit by hit report on the match. Ratings (0-3 - see the tutorials) are given and it\'s more complete than the Viewer. There are some bugs here&nbsp; with bits missing but not many.</p>\r\n<p>When done go back to the Home Page and pick Match 2. Do NOT go to your team page if you don\'t want to get spoilered.</p>\r\n<p>&nbsp;</p>','Steve Turner','2022-03-13 03:24:32',NULL,'CCT','Can I suggest?'),(283,22,'<p>Is it possible to have a list/menu tab of coach names? Like there is in MSWL.</p>\r\n<p>&nbsp;</p>','Roy Rolsten','2022-03-19 04:01:44',NULL,'NRP','Can I suggest?'),(284,6,'<p>Good question Roy.&nbsp; Yes, I can put something together.&nbsp; In the meantime, please click Stats at the top menu and that should help.&nbsp;</p>','Allan Sellers','2022-03-19 04:13:44',NULL,'QRM','Coach and Team Names'),(285,11,'<p>Maybe I have missed some info but will pre-season be kept when season proper starts?</p>\r\n<p>Mostly interested in if the training will be saved or not.</p>','Christer Kallin','2022-03-19 18:15:59',NULL,'SS','Pre-season does it count?'),(286,2,'<p>I think you\'ll find that the slate will be wiped clean of everything.</p>','Steve Turner','2022-03-19 21:26:06',NULL,'CCT','Pre=season'),(287,13,'<p>I think Steve\'s ignoring me because I annoy him and he just doesn\'t want to admit it.ðŸ˜</p>','Micki McIntosh','2022-03-20 04:42:29',NULL,'ABQ','Hmmmm'),(288,2,'<p>I would never ignore you Micki. You just haven\'t said anything to annoy me yet.</p>\r\n<p>Nice hat by the way, much more impressive than your dad\'s.</p>','Steve Turner','2022-03-20 05:02:09',NULL,'CCT','Me?'),(289,6,'<p>Christer: Practice games will not count toward season 5.&nbsp; These are just purely for new coaches to get familiar with the setup in a non-official game way...</p>\r\n<p>Max and Amy having a strategy session just now...</p>\r\n<p><img src=\"images/amy-max-1.jpg\" alt=\"\" width=\"644\" height=\"396\" /></p>\r\n<p>Amy referred to \"splinters sitting on the bench\" for players she won\'t be playing.</p>\r\n<p>Also Amy calls bad players \"splinter material\".&nbsp; She was a 7-sport athlete in high school folks, so...</p>\r\n<p>&nbsp;</p>\r\n<p><img src=\"images/amy-max-2.jpg\" alt=\"\" width=\"694\" height=\"478\" /></p>','Allan Sellers','2022-03-20 19:18:44',NULL,'QRM','Christer\'s Question & Amy/Max Strategy Session'),(290,6,'<p><span style=\"font-family: \'Lucida Grande\', Verdana, Helvetica, Arial, sans-serif; font-size: 12px; background-color: #ffffff;\">Bog standard home banker = guaranteed home win that doesn\'t require any effort beyond the norm :)</span></p>\r\n<p><span style=\"font-family: \'Lucida Grande\', Verdana, Helvetica, Arial, sans-serif; font-size: 12px; background-color: #ffffff;\">According to CB...</span></p>\r\n<p><span style=\"font-family: \'Lucida Grande\', Verdana, Helvetica, Arial, sans-serif; font-size: 12px; background-color: #ffffff;\">I\'m saving this off from a CB post-match comment so I can use that at some point, maybe? (or more likely have it used against our poor Rabid Biting Mules)...</span></p>','Allan Sellers','2022-03-23 03:43:30',NULL,'QRM','Bog standard home banker'),(291,6,'<p>The rules have been updated and are online at the Rules link at the top menu.</p>\r\n<p>If you have questions or identify an issue please let me know.&nbsp; Thanks!</p>','Allan Sellers','2022-03-27 18:28:13',NULL,'QRM','TMVL Rules - Season 5'),(292,28,'<p>We were tempted to make Perez our first signing but seeing as to how much RP\'s those tomatoes, bananas and mules have I suspect we will have to plump for the less choice plums hanging from the recruiting tree....</p>','Vick Hall','2022-03-28 12:52:10',NULL,'SJS','Recruiting'),(293,2,'<p>This isn\'t gamesmanship or mind games but I agree with Vick. Perez is a top player and will go for over 800 RP maybe 1000. New teams only have 500 plus a bit for answering quizzes and will get 360 more if the participate for the full 40 RP each session (to be honest everyone should get this easily).&nbsp;</p>\r\n<p>I wouldn\'t waste 50 RP on the two rounds of pre-bidding for this player.</p>\r\n<p>Take a look at the recruiting History tab for last season\'s prices and also look at what recruits are coming up.</p>','Steve Turner','2022-03-28 13:50:55',NULL,'CCT','Re: recruiting'),(294,6,'<p>I had to laugh at this last Blog post from Steve.</p>\r\n<p>I LOVE how Steve tells Vick his thoughts by prefacing it with: \"This isn\'t gamesmanship or mind games...\".</p>\r\n<p>Does that mean when Steve doesn\'t provide this disclaimer it usually IS \"<span style=\"font-size: 12pt;\">gamesmanship or mind games</span><span style=\"font-size: 12pt;\">\".&nbsp;&nbsp;</span><span style=\"font-size: 12pt;\">ðŸ˜Ž</span></p>\r\n<p><span style=\"font-size: 12pt;\">Oh and Steve is 100% right in his comments too. Be selective about who you go for in STEP 1 and 2 (no need to throw RP on a player that other teams have more RP to get).&nbsp; But also if people aren\'t going after players you need and its 5-star or 4-star, by all means go for it.&nbsp;&nbsp;</span></p>','Allan Sellers','2022-03-29 02:55:21',NULL,'QRM','Gamesmanship and Mind Games'),(295,2,'<p>Not surprisingly there\'s a lot of interest in this future star player. Quincy will surely be the favourite to get him as they have the most RP. I wouldn\'t be surprised if he broke the record for RP spent on a player.</p>','Steve Turner','2022-04-03 13:08:50',NULL,'CCT','Perez'),(296,6,'<p>I was looking for this disclaimer* at the bottom of Steve\'s blog post on Perez.&nbsp; I don\'t see it, so we\'re in trouble on getting this 5-star OH Perez.&nbsp; Maybe we should bow out now? &nbsp;ðŸ˜‡</p>\r\n<p><em><span id=\"cNormalText\">* This isn\'t gamesmanship or mind games</span></em></p>\r\n<p>PS - Now on Day 5 of our 7 day road trip.&nbsp; 2000 miles logged.&nbsp; 1500 to go.&nbsp; Mesa Verde National Park on Monday...</p>','Allan Sellers','2022-04-04 06:22:25',NULL,'QRM','THAT Disclaimer...'),(297,2,'<p>Or should that be @ Al.</p>\r\n<p>Just to be clear and advice I give to the new managers will not be mind games. The rest of you take it as you will ðŸ˜‰</p>\r\n<p>As for Perez, unless one of the four teams richer than Columbia show interest in him then there won\'t be a new record. This stands at 1700 RP. Columbia only have 1382 and, assuming I take away interest in the other players and get the full 40 RP participation each session (and there\'s a reason Al caps this at 40 RP), then I can only force the price up to 1697 RP.</p>','Steve Turner','2022-04-04 15:51:42',NULL,'CCT','Disclaimers et al'),(298,25,'<p>Every extension / delay to Al\'s road trip only extends our undeafted record</p>','James White','2022-04-05 19:14:47',NULL,'ASE','Still Unbeaten'),(301,24,'<p>Looking forward to the games later today, hoping we can manage at least one win</p>','Paul Cockayne','2022-04-09 14:36:22',NULL,'KEN','Excited!'),(302,2,'<p>Looking at Paul\'s photo and what Roy said I really need to look for a photo of me that was taken Christmas 1979. I think it\'s in the loft but if so could be anywhere.</p>','Steve Turner','2022-04-09 14:39:06',NULL,'CCT','Photo'),(303,21,'<p>Orders are set and hopefully we will make a winning start.&nbsp;</p>','Andy Shaw','2022-04-09 20:18:17',NULL,'DEN','Round 1'),(304,13,'<p>Okay, before you rookies find out the hard way, I\'m TOTALLY going to win this thing. And all the \"grown ups\" think that I\'m just a small 11 year old. But I\'m 12, so.....HA! Oh, and also, I bite.</p>','Micki McIntosh','2022-04-09 20:31:23',NULL,'ABQ','Hi'),(305,2,'<p>4 hours to go and I still don\'t know whether to withdraw interest as three teams can outbid us or stay in and at least make sure he goes for a premium price wasting 50 RP&nbsp;</p>','Steve Turner','2022-04-09 21:04:17',NULL,'CCT','Perez (again)'),(306,2,'<p>No spoiler for which game but in one of my games the score in the viewer went from 24-21 to 26-21. In the viewer the point didn\'t show (the winning point is always repeated).</p>','Steve Turner','2022-04-10 02:03:50',NULL,'CCT','Bug?'),(307,28,'<p>just a couple of quick coaching questions.</p>\r\n<p>1) Can you coach players who are resting and not playing?</p>\r\n<p>2) What is the max fitness players can attain?</p>','Vick Hall','2022-04-10 02:27:25',NULL,'SJS','coaching'),(308,2,'<p>Yes you can CP when the player isn\'t playing (as in United)</p>\r\n<p>Maximum Fit is +1</p>','Steve Turner','2022-04-10 02:31:38',NULL,'CCT','Re: coaching'),(309,6,'<p>I just want to point out how unfair this schedule is to me.</p>\r\n<p>Last session: Big Ben (5 sets), Mad Max, and the lovely Mrs. Sellers.&nbsp; I was lucky to go 2-1.</p>\r\n<p>This session: CB, Steve, and Mr. Halpin.&nbsp; Likely 0-3</p>\r\n<p>I\'m pretty sure all six managers were/are out to get me.&nbsp; Very unfair to Quincy and I\'m sure you will no doubt have sympathy for me...</p>','Allan Sellers','2022-04-13 02:20:42',NULL,'QRM','Schedule Unfair to Rabid Biting Mules...'),(310,6,'<p>...Steve keeps responding to my <strong>factual</strong> match comments with things like:</p>\r\n<p>\"Can somebody pass the salt, please?\".</p>\r\n<p>Can someone please translate Steve\'s \"English\"?&nbsp; What does that mean? &nbsp;<span style=\"font-size: 18pt;\">ðŸ¤“</span></p>','Allan Sellers','2022-04-14 03:07:14',NULL,'QRM','This is usually Vick and CB territory, but...'),(311,28,'<p>I might leave this one to CB, unless he is suggesting you liven your comments up a bit next time!</p>','Vick Hall','2022-04-14 17:46:19',NULL,'SJS','Spice up your Life'),(312,20,'<p>...I think I\'ll pass too and leave it to Steve :)</p>\r\n<p>&nbsp;</p>','Craig Bucknall','2022-04-15 13:34:51',NULL,'DAL','Hmmm'),(313,2,'<p>I\'m sure everybody knows but just in case...</p>\r\n<p>I\'m taking Al\'s comments with a pinch (or grain for my American friends) of salt.</p>','Steve Turner','2022-04-15 14:09:01',NULL,'CCT','Seriously?'),(314,6,'<p>...</p>\r\n<p>I was probably thrown off by Mr. Turner\'s phrasing as (of course) all my pre-match comments are factual*. &nbsp;<span style=\"font-size: 18pt;\">ðŸ˜Ž</span></p>\r\n<p>&nbsp;</p>\r\n<p>* Note that all of Al\'s pre-match comments may not be factual.</p>','Allan Sellers','2022-04-15 17:09:43',NULL,'QRM','Oh now I get it!'),(315,13,'<p>Ok, so the beginning may have gotten off to a rocky start, but I know we will make a comeback. Trust me, it won\'t take long. Oh, and my hat looks better that Phil\'s.ðŸ˜‹</p>','Micki McIntosh','2022-04-16 00:55:44',NULL,'ABQ','Rocky'),(316,28,'<p>Good luck with the comeback! I will do my best to trample over Phil&acute;s hat, but yours is certainly the most spectacular.....</p>','Vick Hall','2022-04-16 12:32:09',NULL,'SJS','Dear Rocky'),(317,21,'<p>I think I need to read the rules, preferably before the season ends.</p>','Andy Shaw','2022-04-16 20:05:18',NULL,'DEN','Rules '),(318,24,'<p>Yes, reading the rules is a lot of fun</p>','Paul Cockayne','2022-04-16 21:05:38',NULL,'KEN','Rules'),(319,21,'<p>It\'s more fun if you\'re been drinking but harder to remember. &nbsp;</p>','Andy Shaw','2022-04-17 04:59:59',NULL,'DEN','Rules '),(320,4,'<p>Never read the rules that is a bit like looking at tree plans for flat pack furniture. Takes all the fun away</p>','Matt White','2022-04-17 21:12:11',NULL,'SDS','Rules'),(322,5,'<p>This league isn\'t big enough, even with expansion, for more than one hat. My hat is enough for us all.</p>','Phil McIntosh','2022-04-18 08:23:18',NULL,'CC','One Hat to Rule Them All'),(323,13,'<p>Well, since my hat can practically smush yours, Ali think my hat takes that spot.</p>','Micki McIntosh','2022-04-18 08:24:53',NULL,'ABQ','Ummm..'),(324,5,'<p>That\'s the kind of talk that got you grounded from the iPad. Which begs the question....if you are grounded from the electronics, Miss Micki, how are you posting on the blog?&nbsp;</p>\r\n<p>Gotcha....</p>\r\n<p>(You\'ve got to get up pretty early in the morning to pull one over on ol\' dad!)</p>','Phil McIntosh','2022-04-18 08:27:17',NULL,'CC','Ahem'),(325,5,'<p>That\'s the kind of talk that got you grounded from the iPad. Which begs the question....if you are grounded from the electronics, Miss Micki, how are you posting on the blog?&nbsp;</p>\r\n<p>Gotcha....</p>\r\n<p>(You\'ve got to get up pretty early in the morning to pull one over on ol\' dad!)</p>','Phil McIntosh','2022-04-18 08:27:18',NULL,'CC','Ahem'),(326,13,'<p>Well, considering that \"Ol\' Dad\" is sitting right next to me while he types in his \"Hip\" dad jokes, he could be telling me this in person right now.</p>','Micki McIntosh','2022-04-18 08:31:29',NULL,'ABQ','Ahem, Ahem'),(327,6,'<p>I think Micki is the winner of the recent daugher-dad dustup on the Blog.&nbsp; Extra points for the sarcastic double-quoted <strong><em>\"hip\" dad jokes</em></strong> comment...</p>','Allan Sellers','2022-04-18 21:55:27',NULL,'QRM','Micki Wins!'),(328,2,'<p>Still a lot to play for even if it\'s avoiding playing the top seeds. Top of each group will be seeded 1 to 8 and guaranteed home games in the next two rounds (if they win the first round). The rest will be seeded 9 to 32 and 3rd in a couple of groups could be better than 2nd in a couple and that means a home game as well for the 1st round.</p>\r\n<p>I think the draw is fixed after the knockout with winner of 1 vs 32 playing winner of 16 vs 17. The better seeded team always plays at home.</p>','Steve Turner','2022-04-21 02:11:32',NULL,'CCT','WGM'),(329,30,'<p><span style=\"font-size: 24pt;\"><strong>HAPPY 20TH BIRTHDAY TO MY MAX-MAN ! ðŸ¥³</strong></span></p>\r\n<p><span style=\"font-size: 24pt;\"><strong>MY PUMPKIN !&nbsp;</strong></span><strong style=\"font-size: 32px;\">ðŸŽƒ</strong></p>\r\n<p><strong style=\"font-size: 24pt;\">LOVE YOU AND MISS YOU! &nbsp;ðŸ˜ðŸ¥°ðŸ˜˜ðŸ˜»â¤ï¸ðŸ’•</strong></p>','Amy Sellers','2022-04-24 00:18:48',NULL,'TSS',''),(330,2,'<p>This weekend is the first knockout round of the WGM Cup. Winning this gives you a chance to XP up more youngsters in two games and go for T7 wins in the other two games (next weekend is a 4 match one with the first of the non conference games).</p>\r\n<p>The little teams might think they have no chance against like likes of Quincy, Baton Rouge and Columbia (other top teams are available). But the big teams might concentrating on the Conference, hoping for a title and/or home court advantage in the Conference tournaments. On the other hand they might be after the WGM itself giving little teams a chance to pull off a Conference upset.</p>\r\n<p>Any T7 can beat a B or C team - the trick is guessing which game(s) to T7.</p>','Steve Turner','2022-04-26 15:59:36',NULL,'CCT','Now it gets interesting'),(331,6,'<p>5 teams can lay claim to a 5-star MB this session:</p>\r\n<ul>\r\n<li>The Crazy Tomatoes (1831 RPs)</li>\r\n<li>The Swamp Rats&nbsp;&nbsp;(1879 RPs)</li>\r\n<li>The \'Jacks&nbsp;&nbsp;(475 RPs)</li>\r\n<li>The Bananas&nbsp;&nbsp;(1582 RPs)</li>\r\n<li>The Chihuahuas&nbsp;&nbsp;(1054 RPs)</li>\r\n</ul>\r\n<p>Which team will it be and should teams bid their maximum amount of RPs.&nbsp; Some people say they should.&nbsp; &nbsp;Is the author engaging in any \"shenanigans\" with this post?&nbsp; He probably is not... &nbsp;ðŸ˜Ž</p>\r\n<p>&nbsp;</p>','Allan Sellers','2022-04-29 03:56:21',NULL,'QRM','Emilio Gallo - The 5-star MB (with Max +1 ATK)'),(332,2,'<p>He\'s worth less than Perez so we won\'t be bidding maximum. Certainly not putting all our eggs in one basket but will be cock-a-hoop if we get him.</p>','Steve Turner','2022-04-29 13:32:34',NULL,'CCT','Gallo'),(333,2,'<p>I don\'t know why I never thought of this before.</p>\r\n<p>On recruiting does the \"showing interest\" and \"arranging visit\" RP come out before the bid for signing players?</p>','Steve Turner','2022-04-29 13:35:41',NULL,'CCT','Recruiting question'),(334,6,'<p>Steve asks a great question about the <strong>Order</strong> of processing recruiting relative to your RPs. I\'m 99% sure it works like this.&nbsp;&nbsp;</p>\r\n<p>1) Step 3 - Commit phase is processed first.&nbsp; The total RPs you have to start the session is the maximum the program will let you \"bid\" in order to commit a recruit in Step 3.&nbsp; For example, let\'s say you have 500 RPs coming in and you spend 480 RPs to commit a player.&nbsp;</p>\r\n<p>Another way of looking at this is that, for Step 3, you cannot go below 0 RPs.&nbsp;</p>\r\n<p>2) Steps 1 and 2 are processed last.&nbsp; This is a total of the players you have either shown interest in, or they visit your college, or both.&nbsp; Right now there is nothing in the code that says:</p>\r\n<p>- you spent ALL your RPs on a recruit in step 3</p>\r\n<p>- so we\'re going to NOT allow you to spend RPs on step 1 and 2.</p>\r\n<p>So in theory I believe you could go below 0 RPs&nbsp; with Step 1/2 choices but you\'ll very likely be back above 0 when you get the 140-180 RPs which comes after recruiting is processed.&nbsp; That would be too much for me to check and then \"decide\" which step 1/2 players NOT to process.&nbsp; In addition, there\'s really no advantage as I see it to the team that committed a great player in Step 3 but spent all their RPs.&nbsp; Going below 0 means the RPs you used in Steps 1 and 2 may not result in getting a player in their Step 3/commit phase due to your low RP count.</p>\r\n<p>Again, I\'m 99% sure this is the way it works Steve.&nbsp; If you see some teams fit into this \"used all their RPs in step 3\" scenario please take a look during the season and let me know if you see something different.&nbsp; I\'ve made a note to update the rules with this, but will await some real examples.</p>','Allan Sellers','2022-04-30 02:15:29',NULL,'QRM','Recruiting - Order of operations...'),(335,22,'<p>What did the mountain say to the low flying cloud?</p>\r\n<p>You cannot be cirrus.</p>','Roy Rolsten','2022-04-30 05:07:55',NULL,'NRP','Dad Joke'),(336,13,'<p>I took Micki to the daddy-daughter dance, and I rented a limo for $500. It didn\'t come with a driver. Can you believe that? &nbsp;All that money and nothing to chauffeur it.</p>','Micki McIntosh','2022-04-30 11:28:57',NULL,'ABQ','Dad Joke '),(337,30,'<p>Still don\'t think I know what I am doing, but I have two home matches this week, so maybe that will help? <span style=\"font-size: 24pt;\">ðŸ¤·</span></p>','Amy Sellers','2022-05-01 01:13:22',NULL,'TSS','Fingers Crossed'),(338,2,'<p>Next weekend is an important one for many teams.&nbsp;</p>\r\n<p>Apart from the WGM sweet 16 and the first round of non conference games we have the final conference matches that decide who gets top seeding for the conference tourneys.</p>\r\n<p>Up to now we\'ve only had 3 games per session which allows you to leave out your 4th OH and 4th MB, unless you played T7 in two of the three games and/or wanted to earn XP. 16 teams have 4 games which means playing all 14 players (yes we have 16 but 2 of those never play). There\'s going to be several weak lineups out there.</p>\r\n<p>For the conference games apart from trying to top yours by the end of the season for a decent RP bonus there\'s home court advantage to think about.</p>\r\n<p>Baton Rouge can afford to lose both games on Saturday and still get #1 seeding. Their non conference game is against Columbia and could decide the final overall top team. We are tied with Quincy but guaranteed #1 or #2 seeding but neither side will want to give ground in the conference. And all 3 will want to play strong in the WGM.</p>\r\n<p>For many teams the non conference games aren\'t important as there\'s only 15 RP for winning but it gives the little teams a chance to get some wins and maybe get into the Nationals rather than Holyoake.</p>','Steve Turner','2022-05-01 21:19:29',NULL,'CCT','Big weekend.'),(339,20,'<p>With no chance of winning anything whatsoever it is a small weekend for the Bulldogs.</p>\r\n<p>A nice, lazy weekend of walks and Netflix in the stands.</p>\r\n<p>Who needs a \'Match 16\' anyway? Just means more brain power used and less melting in front of Netflix.</p>','Craig Bucknall','2022-05-06 19:42:29',NULL,'DAL','Small Weekend'),(340,2,'<p>I could be wrong here so someone please tell me if I am.</p>\r\n<p>Mike, you are the only one able to bid on the setter this session. If you do then he\'s yours for 400 RP. This means you don\'t need to pay for a visit for the other setter (I\'m on the phone so hard to check names) unless:</p>\r\n<p>1. You want two 4*&nbsp; freshman setters (if so why?)*</p>\r\n<p>2. You want to make Shenectady bid higher than 400 for that setter as he\'s the other only one to have arranged a visit so far (and run the risk of getting him)</p>\r\n<p>One reason why is to have a better chance of a good roll if the dice.</p>','Steve Turner','2022-05-06 22:11:48',NULL,'CCT','PSA - Attention Mike Jaffe'),(341,2,'<p>And the same goes for Clark in the show interest section.</p>','Steve Turner','2022-05-06 22:13:06',NULL,'CCT','PSA addendum'),(342,19,'<p>Good advice for us newbies! Thanks!</p>','Mike Jaffe','2022-05-07 03:44:21',NULL,'SB','Thanks Steve!'),(343,13,'<p>I may not be number 1 in the league, but I am the \"Best Hat Owner in the League\". If anyone would like to challenge this statement, do so now.</p>','Micki McIntosh','2022-05-07 06:47:17',NULL,'ABQ','Number 1'),(344,19,'<p>Heading into our session 16 clash with the Crazy Tomatoes in the WGM Cup, what does a coach tell his team who has no shot at winning? Spike \'em boys!? Serve up some attitude!?<br />btw, congrats,on the MVP award!</p>','Mike Jaffe','2022-05-07 16:26:41',NULL,'SB','I need Maxâ€™s advice'),(345,2,'<p>Before the expansion to 32 teams we used to all play 4 matches for sessions 1, 2 and 5. I would play T7 in two games (one being the home conference game and the other depending) and B7 in two. It worked OK until I got the hang of things. For a season and a half I always referred to the lineup suggestions which I printed out.</p>','Steve Turner','2022-05-07 17:48:36',NULL,'CCT','Advice?'),(346,1,'<p>Thank you for congratulating me on MVP I appreciate it big dawg!</p>\r\n<p>&nbsp;</p>\r\n<p>I would just say the Tomatoes are expected to win so all of the pressure is on them to win!</p>\r\n<p>So why not pull off an upset to stun the whole league!</p>\r\n<p>We can\'t have Steve win all of the games can we?</p>\r\n<p>&nbsp;</p>\r\n<p>Mad Max</p>','Max Sellers','2022-05-07 20:04:28',NULL,'STC','My message to Mike Jaffe'),(347,2,'','Steve Turner','2022-05-07 20:40:34',NULL,'CCT','Max'),(348,2,'<p>Which game? I looked on Augustana site but couldn\'t see any games after April 1st.</p>\r\n<p>And we won\'t win every game - your dad saw to that. It\'s Mike that will win every game if we aren\'t careful.</p>','Steve Turner','2022-05-07 20:43:00',NULL,'CCT','Max'),(349,30,'<p>Hoping for some Mother\'s Day mojo, since that is probably all I have going for me.</p>','Amy Sellers','2022-05-07 23:21:03',NULL,'TSS','Hoping'),(350,13,'<p>If I\'m not going to be number 1 at volleyball, then I will be the ruler of the hats! With a very large hat that can smush any opponent, I think, sorry,I KNOW mine is the best. If anyone objects to this they will face the hat of death. And remember, I\'m just a sweet, innocent child.ðŸ˜</p>','Micki McIntosh','2022-05-14 07:38:53',NULL,'ABQ','Hats and Hats'),(351,5,'<p>Psst....that\'s not Micki\'s hat. It doesn\'t belong to her.&nbsp;</p>\r\n<p>I own my hat.&nbsp;</p>\r\n<p>And proudly wear it to bed every night.</p>','Phil McIntosh','2022-05-14 08:14:41',NULL,'CC','Hats'),(352,28,'<p>Explains why it looks a bit bent then if you have been sleeping on it......</p>','Vick Hall','2022-05-14 11:52:37',NULL,'SJS','Hats'),(353,19,'<p>The Hounds were howling this week! Haven\'t had a week like this before.ðŸ˜ƒ</p>','Mike Jaffe','2022-05-15 04:12:51',NULL,'SB','3-0 this week!'),(354,2,'<p>Almost another 4-0 session. We did just enough to beat Carlsbad and Antioch and Pekin brought their D team so that was an easy win. Then it was Schenectady in a close game, the type of game that we have won in the past when slightly the weaker side.&nbsp;</p>\r\n<p>The difference in stats was small, a couple of kills or aces here or there. We did better on blocks and especially excellent passes by the serve receivers but this didn\'t translate into more assists by the setter. Disappointed not to progress but not outraged at the result.&nbsp;</p>\r\n<p>The upside is that we don\'t have to try and win 3 games next weekend as the TMVL Cup starts up and we own that competition recently.</p>','Steve Turner','2022-05-15 16:55:53',NULL,'CCT','Almost'),(355,20,'<p>Is this Phil? Or his brother/son?</p>\r\n<p><img class=\"n3VNCb\" style=\"width: 525px; height: 270.703px; margin: 0px;\" src=\"https://images.thebrag.com/td/uploads/2017/06/Screen-shot-2017-06-29-at-7.49.49-PM-768x396.jpg\" alt=\"Brandon Flowers shows off his comedy skills in The Killers new album\" data-noaft=\"1\" /></p>\r\n<p>&nbsp;</p>','Craig Bucknall','2022-05-16 19:06:49',NULL,'DAL','Cowboy Phil'),(356,6,'<p>CB...I don\'t think I\'ve seen a new hat photo of Phil in at least 12 months...sad!</p>','Allan Sellers','2022-05-18 03:13:10',NULL,'QRM','Disappointment in Phil\'s Hats'),(357,13,'<p>For the record, I know Phil has only wear that hat ONCE. Me, on the other hand, had worn my hat at least 7 times annually.</p>','Micki McIntosh','2022-05-21 06:13:40',NULL,'ABQ','Hats'),(358,30,'<p>Maybe instead of a coaches\' poll, everyone can post a picture with their favorite hat and we can vote.&nbsp;</p>','Amy Sellers','2022-05-21 23:07:48',NULL,'TSS','Hats'),(359,5,'<p>...my hat IS everyone\'s favorite hat.</p>','Phil McIntosh','2022-05-21 23:08:56',NULL,'CC','Hats'),(360,13,'<p>Yes! We should do a poll. Beacause everyone knows that my hat is the greatest, we should make it official.</p>','Micki McIntosh','2022-05-21 23:36:03',NULL,'ABQ','Hats'),(361,2,'<p>9 of my players (team of 7 plus extra L and RS) haven\'t played a losing game this season. Maybe I should play them against Quincy for luck. Of the other 8, 6 were in both losses with 2 in single losses.</p>','Steve Turner','2022-05-23 21:07:20',NULL,'CCT','Don\'t know what losing means'),(362,30,'<p>I like Micki\'s hat</p>','Amy Sellers','2022-05-29 00:31:55',NULL,'TSS','My vote'),(363,30,'<p>I really hope that this week breaks the log-jam, 4-way tie for 3rd in our conference.&nbsp; We have been stuck in this pattern for a while.&nbsp;</p>','Amy Sellers','2022-06-02 07:07:24',NULL,'TSS','Pac 8'),(364,2,'<p>I like this new end of season schedule with the Conference games rather than Non-conference. It makes the choices harder which is a good thing.</p>\r\n<p>I dislike the fact that I haven\'t tweaked my orders for two days and can\'t see me doings before the deadline. Worrying times.</p>','Steve Turner','2022-06-04 02:07:41',NULL,'CCT','Like and Dislike'),(365,22,'<p>I\'ve been curious for a while who joined TVML this season and who\'s been around longer. You pick up the odd comment here or there about past seasons, but I finally got around to checking out the history links of each team.</p>\r\n<p>Here\'s the list of the newbies to TMVL:</p>\r\n<p>In PAC 8 there is Denali, Mat Su, San Jose and Tucson.</p>\r\n<p>In SEC there is Kentucky, Merritt Island, Nashville and Starkville</p>\r\n<p>In BIG 8 there is Ames, Arlington, Dallas and Portland</p>\r\n<p>and in BIG EAST there is Alton, Cincinnati, Manitowoc and Spokane</p>\r\n<p>The average league placing for newbies is between 4-7.</p>\r\n<p>Cincinnati and Mat Su however, you could argue, have excelled so far this season taking 2nd place in their leagues.</p>\r\n<p>And only Merritt Island sit 8th in their league.</p>\r\n<p>In the rankings Cincinnati are the highest places newbie in 9th place and then you have Dallas 12th and my Nashville 13th and so on sporadically down the list. League placing appears to have almost no impact on the rankings. Nashville are currently 7th in SEC but rank above Mat Su who are 2nd in PAC 8.</p>\r\n<p>Cincinnati have used fitness well to boost their performance with only one player on 0. Adding the fitness would increase a players value from B+ to -A (for an example see Nashville v San Jose pre-match comments for this weekend).</p>\r\n<p>So hopefully we may see a newbie lift some silverware this season.</p>','Roy Rolsten','2022-06-04 04:13:49',NULL,'NRP','Newbies'),(366,13,'<p>Obviously Phil is scared of the power that me and my hat hold. He is currently to afraid to challenge me for the power that me and my hat hold.So unless he speaks up, I am the true winner!!!</p>','Micki McIntosh','2022-06-04 20:00:15',NULL,'ABQ','Obviously'),(368,6,'<p>I\'m not sure when all the other teams lost their first home game, but I can report that only one team still stands undefeated at home this season.&nbsp; Your Cincinnati Winged Hogs...</p>\r\n<p>Mr. Tucker\'s Hogs are 11-0 entering the final 3 seasons with two home matches remaining:</p>\r\n<p>Session 10 - hosting John\'s Bats</p>\r\n<p>Session 12 - hosting Christer\'s Squirrels</p>\r\n<p>I don\'t have the historic stats on home court compiled yet but this is an amazing achievement for James.</p>\r\n<p>If the Hogs run the table in their final 3 matches they will be the Big East Conference Champions.</p>\r\n<p>HOWEVER, they are tied with the Squirrels at 8-3 and Sheboygan/Alton are 1 match back at 7-4.</p>\r\n<p>The Winged Hogs have to play ALL THREE of the above to finish the season (Screaming Eagles on the road).</p>\r\n<p>Should be interesting over in the Big East!</p>','Allan Sellers','2022-06-06 03:30:48',NULL,'QRM','And Then There Was One...'),(369,22,'<p>The Pandas are currently 0-10 for their Away game stats.</p>\r\n<p>There are still a couple of other teams without an away win this season, but I believe we\'re the only ones into double digits</p>','Roy Rolsten','2022-06-07 21:52:03',NULL,'NRP','The Unwanted Accolade'),(370,28,'<p>Our recruiting policy has not gone quite to plan so far and with only two players signed up I am not sure where the other two are going to come from as there does not look enough RP in the bank. I guess the Shrimps might be happy to settle for 3 decent players but it is not setting us up for a great next season.</p>','Vick Hall','2022-06-11 00:45:48',NULL,'SJS','Recruiting has not gone to plan'),(371,26,'<p>Great write up and review from Roy earlier this week.</p>\r\n<p>My spirits were lifted at at least one eye brow lifted when I read \"So hopefully we may see a newbie lift some silverware this season...\"</p>\r\n<p>then crashed back to earth with the realisation that of the 16 newbies...</p>\r\n<p>only Merritt Island sit rock bottom in their league! &nbsp; ðŸ¤¡</p>\r\n<p>&nbsp;</p>','Mark Creasey','2022-06-11 02:08:46',NULL,'MIM','Newbies update by Roy'),(372,18,'<p>Some newbies have won some silverware this season already. Don\'t forget about Tucson and Cincy winning their respective conference tournaments!</p>','Bryce Kalmbach','2022-06-11 08:18:34',NULL,'MSM','Re: Newbies Update'),(373,14,'<p>We got you by one one, Roy!&nbsp;<img style=\"font-size: 12pt;\" src=\"data:image/png;base64,\" alt=\"\" /></p>','Mike Cabral','2022-06-11 22:30:23',NULL,'TT','0-11 AWAY'),(374,30,'<p>No home games in Spikin\' Saguaro Stadium. Hope our loyal fans show up to cheer us on in these imporant matches.&nbsp;</p>','Amy Sellers','2022-06-11 23:41:29',NULL,'TSS','Nervous about this week'),(375,22,'<p>What was I saying about reading the Rules? I commented on one of Micki\'s recruits last night and then I read Al\'s follow up comment.</p>\r\n<p>Squads need to have at least 16 players at the start of the next season. With 2 x Libero, 2 x Setter, 4 x Outside Hitters,&nbsp; 2 x Right Side and 4 x Middle Blocker = 14 players. Don\'t ask me why but I thought it would be 16. If you click on your dashboard it even tells you which positions you need and how many more are required. That Recruitment menu is very useful.</p>\r\n<p>I\'m hoping to pick up an OH soon which would complete the position requirement but leave me with 15 players, I can pick up one 3 star player for free after the season. Which is the advice Al was giving Micki.</p>\r\n<p>So then I had a look at some of the other teams - Denali are like me they\'re currently chasing an MB but will still be one player short and have the option for the free pick up.</p>\r\n<p>Schenectady need 3 players, they\'re currently chasing 2 five star players and have 1000+ RP but they haven\'t recruited and RS and will need to recruit one post-season.</p>\r\n<p>Pekin need 4 players have almost twice as much RP as anyone else but have no current bids or recruited anyone this season.</p>\r\n<p>Looking at the rules - after the free 3 star pick up and other recruits get expensive and any shortfall in player after your RP is used up will be made with 1 star players.</p>','Roy Rolsten','2022-06-12 19:28:10',NULL,'NRP','Minimum Squad of 16'),(376,13,'<p>You read it right. I have three 4 stars. Which can only mean one thing. I am SOO better than Phil! (And that you guys will have no chance of winning against me next season ðŸ˜)</p>','Micki McIntosh','2022-06-18 22:23:13',NULL,'ABQ','3 4 stars'),(377,30,'<p>To all of you who are fathers, I hope you have a happy Father\'s day weekend and enjoy yourselves. ðŸ˜</p>','Amy Sellers','2022-06-18 22:54:34',NULL,'TSS','HAPPY FATHER\'S DAY'),(378,30,'<p>I went 2-0 and surprisingly got a good OH for next year!&nbsp; Time to celebrate!</p>','Amy Sellers','2022-06-19 03:23:51',NULL,'TSS','A good week'),(379,6,'<p>A few notes and comments for the final session:</p>\r\n<h2>XPs</h2>\r\n<p>If you haven\'t grasped XPs yet (and it may take a season or two), please ask me and I will help and point you to some info.&nbsp; XPs are a big part of the game and the sooner you begin to grasp their impact the better.</p>\r\n<h2>FIT and Session 12</h2>\r\n<p>You can play your stars in every match in session 12.&nbsp; When we start session 6 all FIT is reset to 0.</p>\r\n<p>But should you?&nbsp;&nbsp;</p>\r\n<p>The reason you may want to play other players is that you can hit your XP numbers and improve their skills in session 13 where you can use your XPs and sign walkons so you can meet all the roster minimums for season 6.</p>\r\n<h2>Roy</h2>\r\n<p>Great observations by Roy on the squad minimums.&nbsp; And also glad that many of you are reading the rules.&nbsp; &nbsp;:-)</p>\r\n<h2>The McIntosh\'s</h2>\r\n<p>Phil is at #6 and Micki at #14 as the tandem is doing pretty well with 7 of the 8 maximum competitive recruits signed.&nbsp;&nbsp;</p>\r\n<h2>Session 13</h2>\r\n<p>After next Saturday you will be able to sign the rest of the recruits you need to hit the position and roster minimums.&nbsp; There\'s not an option to NOT get your roster to the proper minimums and these session 13 walkons cost MORE than normal with one exception.&nbsp; ALL teams get ONE free 3-star walkon.&nbsp; After that you can sign 3, 2, or 1-star players at high RP levels (see the rules if you think you will only have 1 or 2 recruits after session 12 for more).&nbsp;</p>\r\n<h2>Summary</h2>\r\n<p>As always, please ask questions on the site or feel free to email me.&nbsp; Heck, you\'ve got #1 Steve basically giving away his lineup strategy so that should tell you that we\'re all here to answer questions and provide help (special thanks to Steve for all his responses!).&nbsp;&nbsp;</p>\r\n<p>&nbsp;</p>','Allan Sellers','2022-06-19 04:25:23',NULL,'QRM','Session 12 // June 25 Notes (In advance)'),(380,11,'<p>Al I am reading you wrong when I read that I can use XPs to sign walkons, right?<br />What you mean and probably writes is I can use XPs to train players in session 13 and also sign walkons in session 13. Walkons signed with RPs.</p>\r\n<p>Got me confused here.</p>','Christer Kallin','2022-06-19 10:42:08',NULL,'SS','My english'),(381,2,'<p>I think it\'s the first headline that\'s confused you Christer.</p>\r\n<p>XPs are used in session 13 to increase skills like CPs do,</p>\r\n<p>RPs are used to sign walkons (apart from the first free 3*)</p>\r\n<p><strong>They are also used to get players in the competitive bidding like you could have last session so wouldn\'t have enough to outbid me for that 5* OH in session 12!</strong></p>','Steve Turner','2022-06-19 11:35:12',NULL,'CCT','XPs and RPS'),(382,2,'<p>I entered my orders on Sunday. I have just checked them and left them unchanged and can\'t see any reason to change them.</p>','Steve Turner','2022-06-20 21:34:36',NULL,'CCT','First time for everything'),(386,13,'<p>Great season everyone.......BUT, I am just going to say now that you all are SO going down nex season!</p>','Micki McIntosh','2022-07-02 08:25:38',NULL,'ABQ','Mwahahahah'),(387,16,'<p>I know almost nothing about volleyball so how come I have finished fourth in the overall standings?&nbsp; I would claim to know something about football [that\'s football not gridiron] and have decades of mediocrity, at best, playing United</p>\r\n<p>In&nbsp; fact all I really know about volleyball was that I wasn\'t going to play it other than very occasionally having seen what it had done to the knees of a serious-volleyball-playing friend only in his thirties</p>','Martyn Hathaway','2022-07-02 17:49:00',NULL,'SCC','It\'s not right'),(388,28,'<p>I suspect santa clara can be proud of coming top of our conference by a mile and has boosted their rankins spot! hurrah</p>','Vick Hall','2022-07-02 22:31:44',NULL,'SJS','ItÂ´s not right!'),(389,8,'<p>Yet another season in the books with Antioch bringing home no silverware. We clearly must be using the wrong bait, because we can\'t catch anything!</p>','Rob Peterson','2022-07-02 23:14:17',NULL,'AA','Perpetually Next Year'),(390,24,'Hi everyone,\r\n\r\nLooking forward to interacting with you all. I do not have much experience with volleyball so will hopefully be a fun learning experience.\r\n\r\nWas wondering what the best way to put my team together might be. Do I recruit the best I can find or build up over time?\r\n\r\nThanks',NULL,'2022-07-17 05:48:16',NULL,'KEN','Team Building'),(391,24,'Hi everyone,\r\n\r\nLooking forward to interacting with you all. I do not have much experience with volleyball so will hopefully be a fun learning experience.\r\n\r\nWas wondering what the best way to put my team together might be. Do I recruit the best I can find or build up over time?\r\n\r\nThanks',NULL,'2022-07-17 05:48:28',NULL,'KEN','Team Building'),(392,24,'Greetings everyone, looking forward to interacting with you all. My question regarding recruiting is do I just pick the highest ranked player I can find for the position needed or is it better to do it another way.\r\nThanks',NULL,'2022-07-17 11:44:03',NULL,'KEN','Hello'),(393,16,'<p>So another season of a game I don\'t really understand is underway.&nbsp; Last season went better than expected so I will just repeat those tactics</p>\r\n<p>Oh, there weren\'t any</p>','Martyn Hathaway','2022-07-17 23:10:01',NULL,'SCC','Journey into the unknown'),(394,32,'<p>I know I\'m bucking a trend here, but I\'d like to thank the Olmec Head for giving most of my recruiters skill levels at the top of their star ranges. Now we have no excuses not to improve on last season.</p>','Jason Halpin','2022-07-19 03:07:32',NULL,'SPO','Praise the Olmec Head'),(395,3,'<p>Perhaps Micki can weigh in and tell the rest of us whether or not she intends to flex her league-best Recruiting Points and dominate the early recruiting, snatching the early 5+ players while we all look on unable to oppose her recruiting acumen?&nbsp; Three of expected league powers, Columbia, Quincy, and Baton Rouge, are surely all looking over their shoulders to see where the Raccoons are going to focus their attention.</p>','Kevin Martin','2022-07-20 20:09:46',NULL,'NOS','Robust Raccoon Recruiting?'),(396,21,'<p>Angry Wolves won eleven games last season, so try and make it twelve this season. Tactic. Be more selective with team selection.</p>\r\n<p>We only managed to win two recruits last season. Try and win at least three, one of which should be a five star. Tactic. Be more selective with my bids.</p>\r\n<p>Recurring theme here me thinks.&nbsp;</p>','Andy Shaw','2022-07-22 20:08:49',NULL,'DEN','Season 6 goals '),(397,2,'<p>It\'s points you need, not goals. United is over there.</p>','Steve Turner','2022-07-23 02:01:53',NULL,'CCT','Andy'),(398,21,'<p>Points for season 6 doesn\'t have the same ring to it.&nbsp;<br /><br /></p>\r\n<p>It doesn\'t really matter though, make my excuses early on either game.&nbsp;</p>','Andy Shaw','2022-07-23 03:27:28',NULL,'DEN','Steve'),(399,28,'<p>here we go again with our opeming games against the evil McIntosh clan. Raccoons and Chameleons. Our poor shrimps will be up against it from the start.</p>\r\n<p>&nbsp;</p>','Vick Hall','2022-07-25 01:57:01',NULL,'SJS','PAC8'),(400,2,'<p>12 people have voted and only 2 points between&nbsp; 1st and 3rd. I expect the poll to close when Al next logs on.</p>','Steve Turner','2022-07-26 00:18:23',NULL,'CCT','Coach poll'),(401,22,'<p>We kick off (is there a different phrase I should use for volleyball?) our 2nd season in TMVL later today.</p>\r\n<p>The new recruits will be an interesting addition to the squad, we had some decent Senior players last season and trained up some decent Freshmen but out Juniors and Sophomores weren\'t so great so will see how that affects results.</p>\r\n<p>Hopefully the Pandas can win an away game this season, but looking at the ficture list we face a tricky opening set of home games with Antioch, Baton Rouge and New Orleans our first 3 opponents. They rank 3rd, 4th and 5th in the T7 stats...</p>','Roy Rolsten','2022-07-30 05:38:18',NULL,'NRP','Looking Forward to the New Season'),(402,22,'<p>That should be 4th, 5th and 6th</p>','Roy Rolsten','2022-07-30 05:39:23',NULL,'NRP','Adendum'),(403,5,'<p>Kevin hits on a great point...Maybe Albuquerque needs to be \"Albuquerque Robust Racoons.\" ARR! Goes along with the trash pirate theme...</p>','Phil McIntosh','2022-07-30 19:13:28',NULL,'CC','Racoon name change'),(404,13,'<p>Just so you know, I am SO going to dominate this season. You are all going to be calling your mommies by the end of the season! MWUHAHAHAHA!</p>','Micki McIntosh','2022-07-30 19:27:53',NULL,'ABQ','*evil laugh*'),(405,26,'<div style=\"font-family: \'Lucida Grande\', Verdana, Helvetica, Arial, sans-serif; font-size: 13px; border: 0px none; outline: 0px; padding: 0px; margin: 0px; background-color: #ffffff;\">\r\n<p style=\"font-weight: inherit; font-family: inherit; font-style: inherit; border: 0px none; outline: 0px; padding: 0px; margin: 0px 0px 15px 1px;\">We kick off / wrist off / volley off our 2nd season in TMVL today.</p>\r\n<p style=\"font-weight: inherit; font-family: inherit; font-style: inherit; border: 0px none; outline: 0px; padding: 0px; margin: 0px 0px 15px 1px;\"><span style=\"font-weight: inherit; font-family: inherit; font-style: inherit; border: 0px none; outline: 0px; padding: 0px; margin: 0px;\">I have an \" F \" rated player on the team.&nbsp;</span></p>\r\n<p style=\"font-weight: inherit; font-family: inherit; font-style: inherit; border: 0px none; outline: 0px; padding: 0px; margin: 0px 0px 15px 1px;\"><span style=\"font-weight: inherit; font-family: inherit; font-style: inherit; border: 0px none; outline: 0px; padding: 0px; margin: 0px;\"><span style=\"font-weight: inherit; font-family: inherit; font-style: inherit; border: 0px none; outline: 0px; padding: 0px; margin: 0px;\">Just how bad is that, and what does the F stand for (keep it clean)?</span></span></p>\r\n<p style=\"font-weight: inherit; font-family: inherit; font-style: inherit; border: 0px none; outline: 0px; padding: 0px; margin: 0px 0px 15px 1px;\">&nbsp;</p>\r\n<table id=\"roster\" class=\"tablesorter border tablesorter-blue tablesorter20c4e7a6cca5e\" style=\"font-weight: inherit; font-style: inherit; font-size: 9pt; border: 2px solid #000000; outline: 0px; padding: 0px; margin: 0px 0pt 15px; width: 601.453px; height: 20px; vertical-align: bottom; background-color: #cdcdcd;\" role=\"grid\">\r\n<tbody style=\"font-weight: inherit; font-family: inherit; font-style: inherit; border: 0px none; outline: 0px; padding: 0px; margin: 0px;\" aria-live=\"polite\" aria-relevant=\"all\">\r\n<tr class=\"even\" style=\"font-weight: inherit; font-family: inherit; font-style: inherit; border: 0px none; outline: 0px; padding: 0px; margin: 0px;\" role=\"row\" valign=\"top\">\r\n<td class=\"no2\" style=\"font-weight: inherit; font-family: inherit; font-style: inherit; border: 0px none; outline: 0px; padding: 2px; margin: 0px; color: #3d3d3d; vertical-align: top; background-color: #dddddd;\"><a style=\"font-weight: inherit; font-family: inherit; font-style: inherit; border: 0px none; outline: 0px; padding: 0px; margin: 0px; text-decoration-line: none; color: #0a54a3;\" href=\"players.php?player_id=899&amp;type=detail\">Dillon&nbsp;Lambert</a>&nbsp;</td>\r\n<td class=\"no2\" style=\"font-weight: inherit; font-family: inherit; font-style: inherit; border: 0px none; outline: 0px; padding: 2px; margin: 0px; color: #3d3d3d; vertical-align: top; background-color: #dddddd;\">OH&nbsp;</td>\r\n<td class=\"no2\" style=\"font-weight: inherit; font-family: inherit; font-style: inherit; border: 0px none; outline: 0px; padding: 2px; margin: 0px; color: #3d3d3d; vertical-align: top; background-color: #dddddd;\">Fr&nbsp;</td>\r\n<td class=\"r no2 col3c\" style=\"font-weight: inherit; font-family: inherit; font-style: inherit; border-width: 0px 1px 0px 0px; border-style: none solid none none; border-image: initial; outline: 0px; padding: 2px; margin: 0px; text-align: right; color: #3d3d3d; vertical-align: top; background-color: #dddddd; border-color: initial #2e2e2e initial initial;\">0&nbsp;</td>\r\n<td class=\"no2\" style=\"font-weight: inherit; font-family: inherit; font-style: inherit; border: 0px none; outline: 0px; padding: 2px; margin: 0px; color: #3d3d3d; vertical-align: top; background-color: #dddddd;\">F</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<span id=\"cNormalText\" style=\"font-weight: inherit; font-family: inherit; font-style: inherit; border: 0px none; outline: 0px; padding: 0px; margin: 0px;\"></span></div>','Mark Creasey','2022-07-30 23:26:41',NULL,'MIM','Looking Forward to the New Season'),(406,2,'<p>Columbia have 3 F rated players. Boy do we have problems.</p>\r\n<p>&nbsp;</p>','Steve Turner','2022-07-31 01:19:11',NULL,'CCT','Only 1?'),(407,30,'<p>Whelp! Could be a little rough as I have lost my really great Libero and rebuilding.&nbsp; Good Luck to everyone!</p>','Amy Sellers','2022-07-31 02:02:31',NULL,'TSS','Welcome back!'),(408,2,'<p>10 coaches interested but of the other 9 only 1 has enough to beat me. Are the rest willing to pay 50 RP just to oush the price up?</p>\r\n<p>This might be \"mind games and gamesmanship\" or simply a public service announcement.</p>','Steve Turner','2022-07-31 13:16:36',NULL,'CCT','Michael Brink'),(409,28,'<p>Those top two recruits are totally awesome so no wonder there is so much competition for them. sadly i have nowhere near enough RP&acute;s to compete so will wait for the crumbs to fall off the table in later rounds.</p>','Vick Hall','2022-07-31 17:03:09',NULL,'SJS','Brinkmanship'),(410,12,'<p>\"...10 coaches interested but of the other 9 only 1 has enough to beat me...\"</p>\r\n<p>Many apologies in advance Steve. &nbsp;Unfortunately it only takes 1 and you did advise me to get an OH :)</p>','Roger Mendonça','2022-07-31 21:06:45',NULL,'PPP','Brinkmanship'),(411,6,'<p>...is my favorite TMVL phrase.</p>\r\n<p>An interesting sentence from Roger there, let\'s break it down...</p>\r\n<p><span style=\"font-family: tahoma, arial, helvetica, sans-serif;\"><em><span style=\"font-size: 13px; background-color: #ffffff;\">Many apologies <span style=\"font-size: 14pt;\"><strong>in advance</strong></span> Steve.</span></em></span></p>\r\n<p>Do the Pushin Peas intend to sign an all-star OH?&nbsp; :-)</p>','Allan Sellers','2022-08-01 03:46:24',NULL,'QRM','Mind games and gamesmanship...'),(413,12,'<p>Ouch! that accusation of gamesmanship stings Al :-)</p>\r\n<p>The reality is that in my very short time in TMVL I\'ve noticed how helpful, kind and generous everyone is. &nbsp;And in that same spirit of love and harmony I thought it was my duty to try and stop my fellow coaches throwing away their hard-earned RPs on a player who clearly has his heart set on playing at Pekin next year... :-)</p>\r\n<p>I guess there might be coaches out there thinking of wasting RPs to push the price up to prevent a top team getting another All Star, but I\'m sure they\'re smart enough to realise that the rock bottom Peas and their rookie manager are no threat to them ;-)</p>','Roger Mendonça','2022-08-01 10:44:34',NULL,'PPP','Game Minds'),(414,20,'<p>Al said.....\'Mind games and gamesmanship is my favourite TMVL phrase\'</p>\r\n<p>There is literally no news here at all.</p>\r\n<p>It\'s a \'zero effort\' blog for 5k</p>\r\n<p>Pfft</p>','Craig Bucknall','2022-08-02 00:30:02',NULL,'DAL','Zero Shock'),(415,8,'<p>I just came here to talk about the MASSIVE amount of interest surrounding Michael Brink in recruiting, and hopefully to make some comments to draw attention and drive up the cost. But I see several others have already beaten me to the punch there! lol</p>','Rob Peterson','2022-08-05 22:24:02',NULL,'AA','Brink'),(416,22,'<p>fdsfds</p>\r\n<p><span dir=\"ltr\" style=\"left: 232.8px; top: 505.641px; font-size: 18.4px; font-family: sans-serif; transform: scaleX(0.940378);\" role=\"presentation\">I was on the site yesterday and couldn\'t work out where Al\'s comments had gone when he reacted to Matthew\'s \"Nice Start\" team news post. Then I saw his email saying posts had disappeared.<br /></span></p>\r\n<p><span dir=\"ltr\" style=\"left: 232.8px; top: 505.641px; font-size: 18.4px; font-family: sans-serif; transform: scaleX(0.940378);\" role=\"presentation\">So I thought it might be useful to post the fitness rules for our newbies. Players start with 0 fitness, can increase it to 1 for a +1 modifier to ALL their skills or have it reduced by playing players 3+ games in a session. Matthew played his best 7 players in all 3 games for the first session and got some good results.</span></p>\r\n<p><span dir=\"ltr\" style=\"left: 232.8px; top: 505.641px; font-size: 18.4px; font-family: sans-serif; transform: scaleX(0.940378);\" role=\"presentation\">I don\'t know whether this was a deliberate tactics, but just in case it wasn\'t I\'ve copied the section on fitness from the Rules:</span></p>\r\n<p><span dir=\"ltr\" style=\"left: 232.8px; top: 505.641px; font-size: 18.4px; font-family: sans-serif; transform: scaleX(0.940378);\" role=\"presentation\"> Reductions to Fitness Modifier</span><br role=\"presentation\" /><span dir=\"ltr\" style=\"left: 262.8px; top: 529.17px; font-size: 18.4px; font-family: monospace;\" role=\"presentation\">&bull;</span><span dir=\"ltr\" style=\"left: 271.264px; top: 529.17px; font-size: 18.4px; font-family: monospace;\" role=\"presentation\"> </span><span dir=\"ltr\" style=\"left: 292.8px; top: 528.841px; font-size: 18.4px; font-family: sans-serif; transform: scaleX(0.899561);\" role=\"presentation\">If a player plays</span><span dir=\"ltr\" style=\"left: 408.738px; top: 528.841px; font-size: 18.4px; font-family: sans-serif;\" role=\"presentation\"> </span><span dir=\"ltr\" style=\"left: 412.898px; top: 528.841px; font-size: 18.4px; font-family: sans-serif; transform: scaleX(0.968667);\" role=\"presentation\">in</span><span dir=\"ltr\" style=\"left: 426.766px; top: 528.841px; font-size: 18.4px; font-family: sans-serif;\" role=\"presentation\"> </span><span dir=\"ltr\" style=\"left: 430.882px; top: 528.841px; font-size: 18.4px; font-family: sans-serif; transform: scaleX(0.898144);\" role=\"presentation\">3 matches in a session, his Fitness Modifier reduces by 1</span><span dir=\"ltr\" style=\"left: 849.776px; top: 528.841px; font-size: 18.4px; font-family: sans-serif;\" role=\"presentation\"> </span><span dir=\"ltr\" style=\"left: 853.766px; top: 528.841px; font-size: 18.4px; font-family: sans-serif; transform: scaleX(0.934242);\" role=\"presentation\">at the end</span><br role=\"presentation\" /><span dir=\"ltr\" style=\"left: 292.8px; top: 551.241px; font-size: 18.4px; font-family: sans-serif; transform: scaleX(0.903295);\" role=\"presentation\">of the session.</span><br role=\"presentation\" /><span dir=\"ltr\" style=\"left: 262.8px; top: 584.77px; font-size: 18.4px; font-family: monospace;\" role=\"presentation\">&bull;</span><span dir=\"ltr\" style=\"left: 271.264px; top: 584.77px; font-size: 18.4px; font-family: monospace;\" role=\"presentation\"> </span><span dir=\"ltr\" style=\"left: 292.8px; top: 584.441px; font-size: 18.4px; font-family: sans-serif; transform: scaleX(0.901756);\" role=\"presentation\">If a player plays in 4 matches in a session, his Fitness Modifier reduces by 2 at the end</span><br role=\"presentation\" /><span dir=\"ltr\" style=\"left: 292.8px; top: 606.841px; font-size: 18.4px; font-family: sans-serif; transform: scaleX(0.903295);\" role=\"presentation\">of the session.</span><br role=\"presentation\" /><span dir=\"ltr\" style=\"left: 232.8px; top: 646.041px; font-size: 18.4px; font-family: sans-serif; transform: scaleX(0.932756);\" role=\"presentation\">Increasing Fitness Modifier</span><br role=\"presentation\" /><span dir=\"ltr\" style=\"left: 232.8px; top: 668.441px; font-size: 18.4px; font-family: sans-serif; transform: scaleX(0.908215);\" role=\"presentation\">A player playing no matches in</span><span dir=\"ltr\" style=\"left: 460.399px; top: 668.441px; font-size: 18.4px; font-family: sans-serif;\" role=\"presentation\"> </span><span dir=\"ltr\" style=\"left: 464.482px; top: 668.441px; font-size: 18.4px; font-family: sans-serif; transform: scaleX(0.887407);\" role=\"presentation\">a session increases his Fitness by 1, unless it is already at the</span><br role=\"presentation\" /><span dir=\"ltr\" style=\"left: 232.8px; top: 690.841px; font-size: 18.4px; font-family: sans-serif; transform: scaleX(0.937308);\" role=\"presentation\">maximum of</span><span dir=\"ltr\" style=\"left: 326.734px; top: 690.841px; font-size: 18.4px; font-family: sans-serif;\" role=\"presentation\"> </span><span dir=\"ltr\" style=\"left: 330.849px; top: 690.841px; font-size: 18.4px; font-family: sans-serif;\" role=\"presentation\">1</span><span dir=\"ltr\" style=\"left: 340.141px; top: 690.841px; font-size: 18.4px; font-family: sans-serif; transform: scaleX(0.909193);\" role=\"presentation\">. A player\'s Fitness Modifier may also increase through</span><span dir=\"ltr\" style=\"left: 745.99px; top: 690.841px; font-size: 18.4px; font-family: sans-serif;\" role=\"presentation\"> </span><span dir=\"ltr\" style=\"left: 750.153px; top: 690.841px; font-size: 18.4px; font-family: sans-serif; transform: scaleX(0.877559);\" role=\"presentation\">Coaching.</span></p>\r\n<p><br role=\"presentation\" /><span dir=\"ltr\" style=\"left: 870.179px; top: 1070.44px; font-size: 18.4px; font-family: sans-serif;\" role=\"presentation\"><br /></span></p>','Roy Rolsten','2022-08-06 02:40:01',NULL,'NRP','Fitness'),(417,24,'<p>Thank you Roy for your post. I had read the rules but must have got too focused on getting my lineups done. Mind you I\'ve done the same thing this time around as well so see what happens.</p>\r\n<p>&nbsp;I did train a couple of players in fitness this time around though.</p>\r\n<p>Thanks again&nbsp;</p>','Matthew Fowler','2022-08-06 14:15:08',NULL,'KEN','Fitness '),(418,24,'<p>Thank you Roy for your post. I had read the rules but must have got too focused on getting my lineups done. Mind you I\'ve done the same thing this time around as well so see what happens.</p>\r\n<p>&nbsp;I did train a couple of players in fitness this time around though.</p>\r\n<p>Thanks again&nbsp;</p>','Matthew Fowler','2022-08-06 15:04:28',NULL,'KEN','Fitness '),(419,2,'<p>I\'ve been thinking about this on and off this week. Is it better to win 3-0 or 3-2? (Lose would always be 2-3 I should think).</p>\r\n<p>This could be construed as Gamesmanship if you think that way.</p>\r\n<p>If you win 3-2 it\'s 5 sets towards XP which has to be a \"good thing\". However 3-0 is better for those tie breakers: WGM seeding, Nationals/Holyoake seeding, Conference tournament seeding, although for Conference seeding for the following season\'s non-conference games 5th could be seen as better than 4th.</p>\r\n<p>But a lot here are obsessed with Rankings.</p>\r\n<p>The Manatees are Power ranked 15 (+6) which puts them in Quadrant III if you played them at your place and Quadrant II for neutral and away games. Sheboygan are power ranked 16 (+4) which gives the same quadrants. It just so happened that they played each other at a neutral court with the Manatees winning 3 sets to 1. This gives Merritt Island 3 points and Sheboygan -2.&nbsp; Now if Merritt Island had won 3-0 it\'s possible that they would have moved to 13th Power ranking making them Quadrant II&nbsp; for your home game. New Orleans were at home to Merritt Island and scored 1.75 points. Moving Merritt Island to Quad II woiuld mean 2.75 points for New Orleans.</p>\r\n<p>Still there?</p>\r\n<p>What it means is that on average big wins gives your opponents more NET ranking points if they beat you or they lose less points if you beat them. Narrow wins gives them less ranking points if they win or they lose more if they lose.</p>\r\n<p>Conversly big losses help the other teams less.</p>\r\n<p>So if you know you\'re going to lose and want to have a better chance of a higher place in the rankings table then lose big.</p>\r\n<p>:-)</p>','Steve Turner','2022-08-06 16:05:57',NULL,'CCT','3-2 or 3-0'),(420,13,'<p>Just for fun, I\'m am going to trash talk. YOU ARE SO GOING TO GET YOUR B*TTS KICKED!!! Ahem. Ok, I\'m done.</p>','Micki McIntosh','2022-08-06 22:26:06',NULL,'ABQ','Ahem'),(421,30,'<p>Every team I play this week has a furry mascot.&nbsp; Hmm.&nbsp;</p>','Amy Sellers','2022-08-07 00:57:36',NULL,'TSS','Will the Fur Fly This Week?'),(422,30,'<p>Micki, you are too cute for words! good luck, Missy!</p>','Amy Sellers','2022-08-07 01:01:30',NULL,'TSS','Ahem #2'),(423,8,'<p>Just calling out attention to the fact that one of the biggest spending opportunities in all of Olmec history is about to take place today. Everyone make sure they max out their bids, because SOMEONE is going to outbid you. You do not want to miss out on this.&nbsp;</p>','Rob Peterson','2022-08-13 18:29:15',NULL,'AA','Brink on the Brink'),(424,12,'<p>With thanks to Al and Rob for helping drive up the price, I\'m delighted to have secured the services of Michael Brink for the next four years. Just three more signings to go - and with hardly any RPs left it\'s lucky I have a cunning plan...</p>','Roger Mendonça','2022-08-14 02:13:56',NULL,'PPP','Brink and Baldrick'),(426,8,'<p>Three new players up for Recruiting today that should fetch extremely high up.</p>\r\n<p>Cole Robinson S - ⭐<span style=\"font-size: 12pt;\">⭐</span><span style=\"font-size: 12pt;\">⭐</span><span style=\"font-size: 12pt;\">⭐</span></p>\r\n<p><span style=\"font-size: 12pt;\">Miguel Villegas OH -&nbsp;</span><span style=\"font-size: 12pt;\">⭐</span><span style=\"font-size: 12pt;\">⭐</span><span style=\"font-size: 12pt;\">⭐</span><span style=\"font-size: 12pt;\">⭐ Max + 2 Rcv</span></p>\r\n<p><span style=\"font-size: 12pt;\">Edson Merinho RS -&nbsp;</span><span style=\"font-size: 12pt;\">⭐</span><span style=\"font-size: 12pt;\">⭐</span><span style=\"font-size: 12pt;\">⭐</span><span style=\"font-size: 12pt;\">⭐ Max + 1 Atk</span></p>\r\n<p><span style=\"font-size: 12pt;\">These 3 guys should fetch HIGH prices, so everyone should bring their big checkbooks today.&nbsp;</span></p>','Rob Peterson','2022-08-27 18:34:00',NULL,'AA','Drumming up Interest'),(427,2,'<p>Just curious how much you\'re willing to spend on Blaser, Rob.</p>\r\n<p>Asking for a friend.&nbsp;</p>','Steve Turner','2022-08-30 03:07:02',NULL,'CCT','?'),(428,8,'<p>1 more RP than you Steve. ?</p>','Rob Peterson','2022-08-30 22:32:45',NULL,'AA','Blasing a trail'),(429,2,'<p>Not sure he\'s worth 1600 RP to you, Rob ?</p>','Steve Turner','2022-08-30 23:56:44',NULL,'CCT','Really?'),(430,8,'<p>He might even be worth 1601...&nbsp;</p>','Rob Peterson','2022-08-31 01:34:12',NULL,'AA','One upsmanship'),(431,6,'<p>The commissioners office has received complaints from some coaches that certain coaches&nbsp;<span style=\"font-size: 12pt;\">(well, two of them) </span><span style=\"font-size: 12pt;\">may be trying to entice Mr. Blaser with illegal offers of a new car for his services.</span></p>\r\n<p><span style=\"font-size: 12pt;\">On a related note the two teams with the most RP that are in the running to sign Mr. Blaser this week are:</span></p>\r\n<p><span style=\"font-size: 12pt;\">1) Antioch - 2348</span></p>\r\n<p><span style=\"font-size: 12pt;\">2) Columbia - 2266</span></p>\r\n<p>Have we ever seen a 2000+ RP signing?&nbsp; The media is reporting some verbal back and forth this week between Mr. Peterson and Mr. Turner.&nbsp; Also noticing some \"head fakes\" as both coaches have clicked on RS\'s in upcoming recruiting sessions... &nbsp;?</p>','Allan Sellers','2022-09-03 02:50:28',NULL,'QRM','Christian Blaser Shenanigans...'),(432,8,'<p>I will say that Antioch has set a VERY high price for Mr Blaser. So high that other teams just shouldn\'t even bother bidding.</p>','Rob Peterson','2022-09-03 05:10:28',NULL,'AA','Blaser'),(433,2,'<p>I think you\'ll find I\'ve set a fair price - probably not as high as Mr Peterson.</p>\r\n<p>This reminds me of a game I played years ago called Hols der Geier.</p>','Steve Turner','2022-09-03 07:29:46',NULL,'CCT','Blaser'),(434,29,'<p>Recruiting is a game within the game.&nbsp; Payne is ours to lose with Carlsbad and St Charles with both less than 500RP and only the Bananas with 935RP.&nbsp; &nbsp;Mike already has an OH from earlier in the recruiting so probably doesn\'t want another - but is he willing to risk duplication to drive up the price?&nbsp; Should I bid 936 and guarantee the win or should I bid just under?&nbsp; If Mike were to win then that would affect his abilty to bid on players he and I have shown interest for next time and beyond.&nbsp; Has he even considered this!!!</p>\r\n<p>Am I double guessing myself?&nbsp; &nbsp;Love the Recruiting mechanism, offers so much thought and strategy!</p>','James Tucker','2022-09-03 13:57:29',NULL,'CWH','Nate Payne'),(435,2,'<p>I can\'t see Mike bidding - he really doesn\'t need him so I think you got lucky here, James. Kinda wish I\'d shown interest myself but am trying not to waste too much.</p>','Steve Turner','2022-09-03 17:35:23',NULL,'CCT','Payne'),(436,6,'<p>...we appear to have an ALL-SEC FINAL FOUR over in the WGM Cup...</p>\r\n<p><img src=\"data:image/png;base64,\" alt=\"\" width=\"814\" height=\"226\" /></p>','Allan Sellers','2022-09-05 04:23:33',NULL,'QRM','Don\'t Look Now, But...'),(437,15,'<p>Good eye, Al. The four of us have been flying under the radar...</p>','Mike Halpin','2022-09-05 05:05:09',NULL,'BRB','Let\'s go SEC!'),(438,23,'<p>I have a cunning plan....</p>','Paul Cockayne','2022-09-06 15:48:00',NULL,'POR','Portland\'s Future'),(439,8,'<p>Looks like this week will probably be the end of the road for the Anglerfish in the WGM Cup. We needed home court advantage the whole way, and Kevin Martin\'s squad was the only thing standing in our way of that goal.&nbsp;</p>','Rob Peterson','2022-09-06 23:36:14',NULL,'AA','End of the Road?'),(440,3,'<p>We wish the Anglerfish all the best of luck in the TMVL Cup this season.</p>','Kevin Martin','2022-09-06 23:55:38',NULL,'NOS','No roads through the Swamp'),(441,2,'<p>Nearly a year ago John posted this table. If you have a 51% chance of winning every point then you have a 56% chance of winning the match</p>\r\n<p>51% -&gt; 56% chance of winning a match<br />52% -&gt; 61% <br />53% -&gt; 67%<br />54% -&gt; 71%<br />55% -&gt; 76%<br />56% -&gt; 80%<br />57% -&gt; 84%<br />58% -&gt; 87%<br />59% -&gt; 90%<br />60% -&gt; 92%</p>\r\n<p>It\'s pretty rare to win 51% of points on your serve - it really only happens if T7 meets B7. Even with New Orleans thrashing of Columbia they only won 33 of their 75 points on serve. But it shows how a small increase in your chance of getting a point gives a bigger increase in the chance of winning that match.</p>\r\n<p>My most important consideration on line-ups is serve rotation. The player in position I will get more chances to serve than the one in II because the set could end before II gets his chance. Increasing SRV from 13 to 14 might not mean much but it increases the chance of an excellent serve from 51% to 53% and decreases the chance of the poorest two serves by 1% each. The chance of the serve being in goes up from 85% to 86%, the chance of serving to the weaker receivers goes up. If increasing your SRV from 13 to 14 means their next best receiver\'s RCV goes down from 16 to 15 it means their chance of a Pass 3 goes down from 59% to 56%. The worse the pass the worse the set, the worse the set the worse the attack (more chance of being hit out, of being blocked or dug).</p>\r\n<p>Now this player only serves once every six man rotation and it\'s only a 1 or 2% increase/decrease but combined with having your best blockers at the net early in the rotation, having your best defenders at the back row early on, not having your setter at the net early on (he doesn\'t attack as well as your other players), having your better attacking MB at the net early on (in case the setter gets an excellent pass from the receiver) all add up.</p>','Steve Turner','2022-09-10 12:39:48',NULL,'CCT','Little things'),(442,13,'<p>Ok, has ANYONE else noticed that Phil hasn\'t changed his hat in over a year?!?!?!?!</p>','Micki McIntosh','2022-09-10 18:23:23',NULL,'ABQ','Hats'),(443,5,'<p>At least I change my underwear.</p>','Phil McIntosh','2022-09-10 19:27:54',NULL,'CC',''),(444,30,'<p>I dedicate my games this week to her Majesty the Queen. May she rest in peace!</p>','Amy Sellers','2022-09-11 00:56:46',NULL,'TSS','Dedication'),(445,23,'<p>My cunning plan hasn\'t quite come to fruition yet....</p>','Paul Cockayne','2022-09-14 23:58:08',NULL,'POR','Cunning Plan'),(446,30,'<p>I want to apologise (British spelling) to the Queen for my poor showing that I dedicated in her honour (British spelling).&nbsp;&nbsp;</p>\r\n<p>Welcome to Wrexham. I can relate.</p>','Amy Sellers','2022-09-18 00:41:07',NULL,'TSS','Dedication #2'),(447,23,'<p>Turns out I misread my notes. &nbsp;I have a cunning PLANT! &nbsp;A venus fly-trap,&nbsp;<span style=\"caret-color: #202122; color: #202122; font-family: sans-serif; font-size: 14px; background-color: #ffffff;\">(</span><em style=\"caret-color: #202122; color: #202122; font-family: sans-serif; font-size: 14px;\">Dionaea muscipula</em><span style=\"caret-color: #202122; color: #202122; font-family: sans-serif; font-size: 14px; background-color: #ffffff;\">), which feeds off small insects and TMVL managers. &nbsp;So maybe it doubles as a cunning plan....</span></p>','Paul Cockayne','2022-09-20 03:35:44',NULL,'POR','Not a Cunning Plan'),(448,6,'<p>While I was laid up this week I watched one of the women\'s college matches this week.&nbsp; Texas (#1 in USA) vs. unranked Kansas at Kansas.&nbsp; It shows what a fired up home team (of lesser talent) can do against, well, the best team in the USA at the moment.&nbsp;&nbsp;</p>\r\n<p>The women\'s game has a lot more rallys (back and forth during a point).&nbsp; The mens game is more about power so more quicker kills/points.&nbsp;&nbsp;</p>\r\n<p>Here\'s the link.&nbsp; If you happen to watch and have questions about certain points or what happens please feel free to ask.&nbsp; The announcers are pretty good and typically have good insights to share.</p>\r\n<p>https://www.youtube.com/watch?v=BOxSz6Hf-UE</p>\r\n<p>One thing you will see is that volleyball is a big momentum sport.&nbsp; Sometime things go well and a lesser skilled team gets unstoppable.&nbsp; Sometimes a great team serves 4 straight into the net. Sometimes a called timeout \"freezes\" the opposing server and they miss a serve (similarly on a challenge call).&nbsp; Sometimes a team playing poorly that has an \"automatic kill\" attacker gets smart and sets THAT player often to stay in a match.&nbsp;&nbsp;</p>\r\n<p>Boxscore is here:</p>\r\n<p>https://texassports.com/sports/womens-volleyball/stats/2022/kansas/boxscore/14969</p>\r\n<p>Again, if you can watch a few minutes please ask if you have questions.&nbsp;&nbsp;</p>\r\n<p>&nbsp;</p>','Allan Sellers','2022-09-26 04:48:40',NULL,'QRM','Match to Watch...'),(449,23,'<p>Three more losses for Portland, nine in a row now. &nbsp;Only five sets won. &nbsp;What I need is a cunning plan, or failing that, some better players. &nbsp;</p>\r\n<p>When I was studying for my finals in 1976, I became quite expert in drawing up cunning plans. &nbsp;</p>\r\n<p>I\'d wake up in the morning feeling overwhelmed by the amount of revision I needed to do in a short space of time. &nbsp;So I\'d draw up a revision plan, timetabling exactly what I was going to revise each day, starting tomorrow. &nbsp;Then, feeling much better, I\'d go to the pub.</p>\r\n<p>The next day I\'d wake up and start on my revision, but ineviatbly would fail to complete the daily plan. &nbsp;In my defence, 1976 was a very hot summer in the UK, and my efforts to revise were not helped by the heat, or by the Italian girl who sunbathed topless in the back garden, which my desk overlooked. &nbsp;Or my laziness. &nbsp;So, feeling a failure, I\'d go to the pub.</p>\r\n<p>I\'d wake up in the morning feeling overwhelmed by the amount of revision I needed to do in a short space of time.....many a cunning plan did I write that summer....</p>','Paul Cockayne','2022-09-27 21:03:28',NULL,'POR','Cunning Plans'),(450,6,'<p>Steve had some interesting numbers in his wall post on opponents he played and their average overall rating.</p>\r\n<p>How would we go about developing a \"strength of schedule\" type stat/number to show?&nbsp; The NET rankings certainly show some teams with a small, medium, large amount of Quad I opponents for example.</p>\r\n<p>Does anyone have some ideas on that and/or how we could present it (maybe show it on the rankings page and/or team page in rankings tab).</p>\r\n<p>It certainly seems like some teams play very tough schedules...I\'d just like to know who they are. &nbsp;?</p>\r\n<p>Of course every team Quincy plays is a tough team.&nbsp;&nbsp;</p>','Allan Sellers','2022-09-29 04:19:02',NULL,'QRM','Strength of Schedule'),(452,20,'<p>I know this has been discussed before briefly but I\'ve just been looking at the overall grades for everyone\'s T7, T11 and Roster and think there\'s room for change?!?</p>\r\n<p>T7</p>\r\n<p>A raters = 7</p>\r\n<p>A- raters = 11</p>\r\n<p>B+ raters = 12</p>\r\n<p>B raters = 2</p>\r\n<p>&nbsp;</p>\r\n<p>T11</p>\r\n<p>A- raters = 3</p>\r\n<p>B+ raters = 7</p>\r\n<p>B raters = 12</p>\r\n<p>B- raters = 8</p>\r\n<p>C+ raters = 2</p>\r\n<p>&nbsp;</p>\r\n<p>Rosters</p>\r\n<p>A- raters = 1</p>\r\n<p>B+ raters = 8</p>\r\n<p>B raters = 9</p>\r\n<p>B- raters = 11</p>\r\n<p>C+ raters = 3</p>\r\n<p>So my question is, should there be more difference between the top and bottom teams or are we ok with how it is?</p>\r\n<p>I must admit, when T7 plays T7 a team of A+ against a team of mostly A with maybe one B+ usually wins comfortably (I think?!? I haven\'t done the research lol) so imagine who it\'d be if the gap was bigger?</p>\r\n<p>I think I\'ve answered my own question.</p>\r\n<p>This is fake news. Sorry.</p>\r\n<p>You may go about your business. Move along, move along.</p>\r\n<p>#shamelessRPgrab</p>','Craig Bucknall','2022-09-30 19:56:28',NULL,'DAL','Team Overall Grades'),(453,3,'<p>For a Strength of Schedule rating, seems easiest to take all a team\'s opponents and tally their total Sets Won and Sets Lost, and calculate the Opponents\' Set Won %.&nbsp; If you play a team twice, you count their totals twice.&nbsp; Three times? Count \'em thrice.&nbsp; That will give a reflection of opponent strength or quality, based on season-to-date results.&nbsp; No need to reference any other current ranking system which might take a session or three to adjust.</p>','Kevin Martin','2022-10-01 00:06:35',NULL,'NOS','SoS'),(454,2,'<p>For an over all season strength of schedule I\'d agree with Kevin but I was thinking about a session by session rating. We don\'t all play T7 every game but we could face three T7 teams in a session. When I pick my coach of the session I do tend to go simply on wins and try to guess which teams had it tougher to break ties. If a team goes 3-0 in a session facing 205 and another goes 3-0 facing 220 then I know which I\'m more likely to vote for.</p>\r\n<p>But also beating Quincy is worth more to me than a low team simply because it\'s brave to try.</p>\r\n<p>&nbsp;</p>','Steve Turner','2022-10-01 02:04:40',NULL,'CCT','SoS'),(455,32,'<p>Strength of schedule being a term of art (at least in the U.S.; it\'s meaningless in, e.g., European soccer, where everyone plays everyone else an equal number of times), I prefer reserving that term to something along the lines of what Kevin suggests.</p>\r\n<p>Kevin\'s suggestion is a good start for SoS, but it would also help to see how an opponent\'s strength of schedule contributes to your own team\'s strength of schedule. For example, say Spokane\'s opponents have a combined winning percentage (sets won over total sets) of .550. You\'d say Spokane has a high strength of schedule, right? But what if Spokane\'s opponents all happened to play a bunch of cupcakes? That would inflate Spokane\'s opponents\' records and make it seem, possibly inaccurately, that Spokane is playing more difficult opponents. Granted, with the number of matches we play in TMVL, this effect would be diminished over the course of a season. But, you could probably get a more precise overall SoS number by weighting a team\'s strength of opponents together with the strength of the opponents\' opponents. A calculation I\'ve seen for this is [2(opponents\' total winning percentage) + opponents\' opponents total winning percentage]/3.&nbsp;</p>\r\n<p>I also think Steve\'s idea is very interesting. It\'s a metric of whether you overachieved, underachieved, or did about exactly what would be expected given the quality of the players your opponent put on the floor. I think comparing sets won with the quality of the opponent\'s players would be helpful, but comparing points won with opponent quality would be even better. Unfortunately, I\'m not adept enough with statistics to come up with a workable formula for this. But maybe someone else will be inspired by the idea.&nbsp;</p>','Jason Halpin','2022-10-01 06:04:59',NULL,'SPO','SoS'),(456,8,'<p>Not to be a c-c-c-combo breaker here... but I want to draw everyone\'s attention to Eddie Kinslow, the 5-star L with Max+1 SRV up for recruiting bids this week. There are 6 eligible teams, many with deep pockets. I encourage everyone to max out their RPs on this massively hyped recruit!</p>','Rob Peterson','2022-10-01 06:39:45',NULL,'AA','Hot Commodity'),(457,15,'<p>with Rob\'s post below. Not worth bidding on that libero.</p>','Mike Halpin','2022-10-01 06:45:30',NULL,'BRB','Strongly disagree....'),(458,12,'<p>Is it usual to get to this stage of the season and really struggle to know what to do with all your CPs? &nbsp;I\'ve coached all the players I want to, used tons on FIT, and I\'m still probably going to just bin around 60 at the end of the next session.</p>','Roger Mendonça','2022-10-02 19:58:47',NULL,'PPP','Too many CPs'),(459,2,'<p>Should that I be so lucky! I\'m thinking I\'m going to be short thanks to all the 3-0 wins and losses.</p>\r\n<p>I would certainly have spent some on the Freshman RS. He isn\'t great but like you say you will waste them.&nbsp;</p>\r\n<p>Just use all you can and carry 15 over even if you think it\'s a waste.</p>','Steve Turner','2022-10-02 21:26:42',NULL,'CCT','Too many CPs'),(460,12,'<p>Thanks as ever Steve. I realised I\'d have a CP glut a few sessions ago and (reluctantly) began coaching Hall as next year\'s reserve RS. He won\'t make potential this season but it won\'t matter because he\'s going to spend a lot of time during Season 7&nbsp;watching Netflix in the stands while I&nbsp;overplay Bonati (and pay the 4 FIT each session to keep him in top condition). I think it only works as a plan because Bonati goes straight into my T7 even if every dice roll he gets in the off season is a dud.</p>','Roger Mendonça','2022-10-02 22:49:41',NULL,'PPP','Too many CPs'),(461,6,'<p>I absolutely LOVE Roger telling us that he doesn\'t know what to do with all these CP he has.&nbsp;&nbsp;<span style=\"font-size: 12pt;\">?&nbsp;</span></p>\r\n<p>I suspect some managers may take it personally and try to win more games against Pekin.&nbsp; I don\'t know who those managers are, but I certainly will not.&nbsp; <span style=\"font-size: 12pt;\">?</span></p>\r\n<p><span style=\"font-size: 12pt;\">My answer is a resounding \"NO\" it is not a normal thing.&nbsp; &nbsp;I wish it were.&nbsp; I\'m still trying to ensure I have enough.&nbsp; But I have also used (overused?) some CP to support keeping some players at FIT +1 this season so that\'s my fault.</span></p>\r\n<p><span style=\"font-size: 12pt;\">Personally I\'d recommend picking the Freshman.&nbsp; Turning OFF the Netflix and build him enough to be a player that can fill in a little next season.&nbsp;&nbsp;</span></p>\r\n<p><span style=\"font-size: 12pt;\">If you have 4 strong OH players you will be hard to beat.&nbsp; I know for my team I have 3 and have one up in the stands watching Netflix.&nbsp; I\'d rather not have that, but that\'s the way it goes.&nbsp; With the OH players playing all the way around (all rotations) and passing they are so important.&nbsp; &nbsp;</span></p>\r\n<p><span style=\"font-size: 12pt;\">You have an interesting team and it might be easy to say \"just CP everyone\".&nbsp; Maybe another approach would be to only have 2 players on the roster watching netflix (max of 2) and the rest getting built up even if they don\'t have a ton of potential.&nbsp;&nbsp;</span></p>\r\n<p>Steve is (of course) right.&nbsp; Get that RS Freshman built up so he can be the \"reserve RS\" for the 5-star you have signed.&nbsp;&nbsp;</p>\r\n<p>I\'m still really excited about the subject line I put in this post... &nbsp;?</p>\r\n<p>&nbsp;</p>','Allan Sellers','2022-10-04 03:27:12',NULL,'QRM','Mo CP Mo Problems...'),(462,24,'So being over here in Australia and volleyball not as big as what it seems to be overseas the only times I\'ve really watched it is the Olympics or stumble across it when channel surfing late at night. \r\nI played basketball and mixed netball for a few years and thought myself fit and quick and able to play at a decent level. However, watching volleyball both indoors and the beach one there is no way even up to a few years ago that I could have handled the pace.\r\nJust a random thought I\'ve gathered while being here this season ',NULL,'2022-10-04 05:55:04',NULL,'KEN','Volleyball'),(463,12,'<p><span style=\"font-family: \'Lucida Grande\', Verdana, Helvetica, Arial, sans-serif; font-size: 13px; -webkit-text-size-adjust: auto; background-color: #ffffff;\">\"I suspect some managers may take it personally and try to win more games against Pekin.\"</span><br /><br />Surely you underestimate the generosity of spirit that pervades this wonderful community Al? &nbsp;I would imagine most managers would understand how difficult it is for Pekin (#32 out of 32 for roster strength) to spend CPs for long term benefit when all their good players are graduating at the end of the season, and sympathise with a rookie manager who has clearly mismanaged their squad. They\'d probably see games against Pekin as a great opportunity to play all their Freshmen and&nbsp;earn the XP they need to make up their CP shortfall. Especially Kevin and Jason in our semi-final match ups....??</p>\r\n<p>&nbsp;</p>','Roger Mendonça','2022-10-06 02:43:01',NULL,'PPP','Let CPing dogs lie..'),(464,23,'<p>I think that if people grumble about having too many CPs they should have them confiscated and donated to people who grumble about having too few.</p>\r\n<p>I have too few, by the way....</p>','Paul Cockayne','2022-10-06 23:09:08',NULL,'POR','Too many CPs'),(465,10,'<p>It is an interesting and rare dynamic that you can have too many CPs in an OLMEC-style game.</p>\r\n<p>I found this to be the case during an extreme rebuild in MSWL-U. I stripped the team to the bone probably around season 18 or so and by the end of the season had \"too many\" CPs! The team was so youth orientated that playing the youth was enough to improve them and none of the other players were really worth levelling up.</p>\r\n<p>There\'s probably some sort of game strategy where you could \"bank\" CPs that you don\'t spend for round one of the following season, but I\'m not sure what that proposal would look like.</p>','John Holden','2022-10-08 04:18:12',NULL,'SVB','Too many CPs'),(466,8,'<p>I tend to plan my CP expenditure out so that, at the end of the season, I can use XP to get the last coaching in place. So, towards the end of the season, I end up coaching up the Juniors more than anything because i focused on the underclassmen early in the season. But my team can\'t win anything, so maybe I don\'t have the right strategy...&nbsp;</p>','Rob Peterson','2022-10-08 07:39:37',NULL,'AA','CP'),(467,23,'<p>Planning for best use of CPs is and interesting aspect of the game. &nbsp;One can, of course, play younger players to gain them experiance that can be used to coach them at the end of the season. But is that an effective use of CPs? &nbsp;Very hard to calculate, which, of course, adds to the interest in the game.</p>','Paul Cockayne','2022-10-10 22:56:33',NULL,'POR','`Use of  CPs'),(468,15,'<p>I use that same strategy, for the most part, Rob.&nbsp;</p>','Mike Halpin','2022-10-15 06:21:53',NULL,'BRB','Rob\'s Strategy'),(469,2,'<p>Damn right they are. Someone asked why the minimum cost is more than other players.</p>\r\n<p>I played T7 apart from my setter against Pekin thinking it would be an easy-ish win. Borowski\'s set rating for the game was only 11 but I played him to give me enough XP to increase his Attack rating - with hindsight 9 rather than 8 attack wasn\'t worth the risk.</p>\r\n<p>Because of his Set rating he\'s setting a 1 or 2 a lot which means 2 or 3 blockers a lot. Pekin had 47 assisted blocks (adding up all the 2 and 3 blocker). Torres (attack 18) seemed to be the victim with 15 errors (blocks or hit out) and only 12 kills. He also had 12 attacks dug, pobably also due to poor sets -&gt; more poor attacks -&gt; easier to defend.</p>\r\n<p>&nbsp;</p>','Steve Turner','2022-10-16 13:39:42',NULL,'CCT','Are Setters important?'),(470,12,'<p>I already had beard envy over Jason, but Rob\'s latest photos definitely raise the bar even further. Top whiskers sir!</p>','Roger Mendonça','2022-10-16 17:13:27',NULL,'PPP','New photos'),(471,23,'<p>An undistinguished season for Portland, but decent recruiting and hopes for better results to come</p>','Paul Cockayne','2022-10-16 20:15:23',NULL,'POR','On the up?'),(472,20,'<p>Wall to wall crap this season.</p>\r\n<p>Next season will be win everything.</p>\r\n<p>Obviously.</p>','Craig Bucknall','2022-10-21 20:52:25',NULL,'DAL','On The Down?'),(473,22,'<p>A big thanks to Al and everyone who supported him running TMVL this season.</p>\r\n<p>TMVL is currently my favourite management game to play. We have a quiz show on the BBC called House of Games and they had a picture question asking the contenders to identify the libero. From watching the video Al posted last season of the Women\'s Championship and knowing how the libero functions in the games I could pick out the player in the different coloured top. (None of the contestants picked this player and 2 of them picked the umpire...)</p>\r\n<p>The one thing in TMVL I still feel a bit lost about is which competition is which. When I\'m managing matches I know which is which, what I struggle with is to work out what competition other teams are playing in and doing well in - especially when it gets to the final stages when most of us are knocked out.</p>\r\n<p>It doesn\'t affect the gameplay but when we\'re doing the voting for best coach of the round it can be a bit tricky to know who\'s done best and I know James\' Alton missed out on votes in the final session despite winning the TMVL Shield.</p>\r\n<p>I know you can select the Scores menu and then select the round to see what matches are played but it there a way to make it more accessible? Or.. could someone summarise any key matches coming up? CB likes to talk...</p>\r\n<p>&nbsp;</p>','Roy Rolsten','2022-10-30 13:01:09',NULL,'NRP','Competition Summary'),(474,6,'<p>Thanks to Roy, John, James, Paul, and Aires for your post of thanks.&nbsp; And thanks to the rest of you who sent me an email or also posted and I missed it.&nbsp; I always appreciate the feedback in this and the United leagues I run so it is always nice to hear.</p>\r\n<p>I\'ve coded most of the scheduling items that I\'ve been leaning on Steve and others to help me with the past 2 seasons when we shifted to 32 teams.&nbsp; Thank you to Steve and the guys for helping!&nbsp; So I think I have a good plan there to move that forward.&nbsp; I do need to do a little verification.&nbsp; I need to check my list for other things, but I think I\'m on a trajectory to officially run things next weekend with a session 1 deadline of Nov 12th.</p>\r\n<p><strong>Roy</strong>: I love your story on liberos! &nbsp;?&nbsp; Tell me more on your ideas.&nbsp; Maybe you can help with an example or perhaps you see something similar in another league, website, etc that we could \"borrow\".&nbsp; Even itemizing suggestions like (we need the home/away/neutral indicator on this page and that page and the indication of tournament stage on this page, etc) is helpful.</p>\r\n<p>More to come this week.&nbsp; &nbsp;</p>','Allan Sellers','2022-10-31 04:53:21',NULL,'QRM','Update, Thank You & Comp Summary'),(475,21,'<p>Didn\'t you used to be able to do a team post blog from here ?</p>\r\n<p>Has it been deleted or just missed off ?</p>','Andy Shaw','2022-11-07 00:15:13',NULL,'DEN','Team home page'),(476,6,'<p>In United you can add a new article/journal from the Team Page but I don\'t have that yet for TMVL.&nbsp; It is on my to do list.</p>\r\n<p>You can add one from the Front Page Andy under the Team News section.</p>','Allan Sellers','2022-11-07 00:51:49',NULL,'QRM','Andy\'s Home Page Question'),(477,32,'<p>Is this the season Spokane\'s rebuilding process begins yielding results? It\'s unlikely we\'ll seriously compete for a National Championship (or any other trophy), but with a solid recruiting class and a mid-level T7, we can aspire to a .500 record. If we bring in a 5-star or two, as well, then we may really be in business next year.&nbsp;</p>','Jason Halpin','2022-11-07 23:01:32',NULL,'SPO','Turning the Corner?'),(478,23,'<p>If Jason turns the corner, he will be round the bend....</p>','Paul Cockayne','2022-11-08 21:43:33',NULL,'POR','Turning the Corner....or....'),(479,20,'<p>James! Is that a British Bulldog I spy on your photos??</p>\r\n<p>If so, please tell me more!</p>\r\n<p>I have a Frenchie and a Puggle but next on the list is a British Bulldog so feel free to tell me anything/everything :)</p>\r\n<p>Thanks :)</p>','Craig Bucknall','2022-11-12 03:56:51',NULL,'DAL','Attention James White!!!'),(480,8,'<p>With the new player rankings system, is anyone surprised that the Sellers\' boys have the top 2 teams in the league for T7?</p>\r\n<p><img src=\"data:image/png;base64,\" alt=\"\" /></p>','Rob Peterson','2022-11-12 08:21:24',NULL,'AA','It\'s a Sellers\' Market'),(481,6,'<p><span style=\"font-size: 14pt;\">This official TMVL website statsheet has Max and I at 7th and 6th for Roster respectively Rob.&nbsp; I\'m not sure where you found your graphic.?</span></p>\r\n<p><span style=\"font-size: 14pt;\">Looks to me like Antioch is a solid 4th here...</span></p>\r\n<p><img src=\"data:image/png;base64,\" alt=\"\" width=\"772\" height=\"149\" /></p>','Allan Sellers','2022-11-13 00:21:40',NULL,'QRM','My Browser is different than Rob\'s...'),(482,25,'<p>His name is Max, which I thought was oddly appropiate for this game.</p>\r\n<p>He is lazy which is just as well as he could probably run through the wall if he built up enough speed he is that solid.</p>\r\n<p>Despite his looks (everyone thinks he is scary) he is a big softy that loves to cuddle in and get clapped and rubbed</p>','James White','2022-11-15 00:18:49',NULL,'ASE','FAO Craig Bucknall'),(483,22,'<p>For a moment there I thought James was talking about the St Charles coach</p>','Roy Rolsten','2022-11-16 06:08:07',NULL,'NRP','Tummy Rubs'),(484,20,'<p>Any known health issues?</p>\r\n<p>Do they like walks or not really fussed? (I\'ve heard both! ie those that are quite up for it and those that hate it)</p>\r\n<p>Training? Waste of time or does he love it?</p>\r\n<p>&nbsp;</p>','Craig Bucknall','2022-11-17 13:47:53',NULL,'DAL','FAO Mr White'),(485,20,'<p>...win every game. Literally?</p>\r\n<p>I\'m looking at those serial winners.</p>\r\n<p>I need lots of \'A\'s and \'A+\'s yes but I want those tactical geniuses out there (yes, just like me) to share literally all of their tactical prowess and secrets.</p>\r\n<p>In a forum or blog entry</p>\r\n<p>For all to see</p>\r\n<p>So I/we stand a chance of beating them</p>\r\n<p>I\'m doing this for everyone, especially us little guys</p>','Craig Bucknall','2022-11-17 14:04:49',NULL,'DAL','How Do I.....'),(486,2,'<p>I don\'t think my 34-4 record will be beaten anytime soon. Quincy had the best chance last season as they were way better than anybody else. I got lucky because my team peaked with A+ players everywhere but MB and it was the first season with all the new managers who took a while to get into it. A perfect storm you could say. Last season the new teams and managers were better so it was harder for Quincy than it was for us.</p>\r\n<p>As for tactics - I\'ve posted loads here and there and there\'s really only two things I haven\'t mentioned and I\'m keeping them to myself for now.</p>','Steve Turner','2022-11-17 15:46:43',NULL,'CCT','You can\'t win every game '),(487,12,'<p>Is someone here secretly writing the questions for House of Games quiz on the BBC? As Roy pointed out they recently had a question on Liberos, earlier this week was one on an Anglerfish, and today there was one on the election slogan of H\'Angus the monkey who became Hartlepool mayor.</p>','Roger Mendonça','2022-11-18 23:25:23',NULL,'PPP','House of Games'),(488,22,'<p>Next week I wouldn\'t be surprised to hear a question asking which town is the series Last Man On Earth set? (Tucson) and in the final Answer Smash round they show pictures of cute animals including Red Pandas, Raccoons, Squirrels and Chihuahuas. The winner will take away a golden fondue set emblazoned with the Quincy Rabid Biting Mules logo...</p>\r\n<p>&nbsp;</p>\r\n<p>I also like that this week they did a champions edition in which a former winner came back who had got engaged to the host Richard Osman since her first appearance on the show.</p>','Roy Rolsten','2022-11-19 00:42:31',NULL,'NRP','Game On'),(489,13,'<p>OK, Phil is way overdue on a hat update. I mean, cowboy hats were SO last season. I don\'t think he has the guts to challenge my rein of the throne.</p>','Micki McIntosh','2022-11-19 11:03:45',NULL,'ABQ','Hats'),(490,2,'<p>Craig, one thing I did two seasons ago was to look at the opposition and decide how much I wanted to win. Today we play Quincy and I\'ve had to decide between T7 and throwing the game. T10 wouldn\'t be worth it, Against the Scarecrows last week I decide to throw that game and concentrate on the others. You play Quincy today and and in your place I\'d probably throw the game - however Quincy play us and will want a home advanage in the WGM. Al won\'t T7 against you - but you won\'t let him live it down if you win ?</p>\r\n<p>Next weekend we play you and I\'ll decide if I can throttle back a little off T7 and still be favourites (and it also depends on my other games and if there\'s one I will throw). All this depends on today\'s skill and fitness levels.</p>\r\n<p>Our second best Libero is 10 points better than your best after home advantage is taken into account. I could play Bianchi</p>\r\n<p>My Middles are 9 points better, with 2 and 3 nearly equal. If I dropped my #1 MB we\'d be roughly equal and that would be risky. Tough call.</p>\r\n<p>My Outside Hitters are worse anyway so it\'s my top 2.</p>\r\n<p>My second Right Side is much worse than yours so White would play.</p>\r\n<p>My secont Setter is much worse than yours so Lam plays.</p>\r\n<p>All the above assumes my priority is beating Dallas and expecting a T7 side from you. You have three tough games next week and I\'d I\'d expect T7 in one, nealy in the second and throw the third.</p>','Steve Turner','2022-11-19 20:58:55',NULL,'CCT','Trying to win everything'),(491,6,'<p><strong>Code Updates this week</strong></p>\r\n<p>1. An issue with MBs making an error but their team getting the point was identified and fixed.&nbsp; Thanks to Steve for helping with examples.</p>\r\n<p>2. Issues with setting assists/attempts were identified and I believe resolved.&nbsp; Again thanks to Steve for his analysis here too.</p>\r\n<p>3.&nbsp; When I look at the preview sometimes it doesn\'t always hit me why the home team has a high winning percent (for the ELO part) when the ratings are close.&nbsp; I added the \"+145\" to highlight it is a home match and its really the rating PLUS 145 that gets you to the higher chance of winning.</p>\r\n<p><img src=\"data:image/png;base64,\" alt=\"\" width=\"357\" height=\"191\" /></p>\r\n<p><strong>Craig</strong></p>\r\n<p>I\'ll try to add more strategy ideas but it may not be for about 3 weeks as I\'ll be away for a bit.&nbsp; One consideration though is to think about playing 1-2 of your best players all 3 matches from time to time (obviously not this week).&nbsp; It will cost some FIT/CP for FIT but may yield results.</p>\r\n<p><strong>Steve</strong></p>\r\n<p>When Steve says \"You can\'t win every game\" he means the \"you\" as in the other 31 teams.&nbsp; Steve, in fact, CAN win every game as evidenced by his amazing 34-4 mark in season 5. &nbsp;?</p>\r\n<p>Seriously though his analysis is of course exactly right.&nbsp; It will be harder to have those types of seasons now that we have coaches who are gaining knowledge and building strong teams.&nbsp; Good stuff!</p>\r\n<p>Very curious though about those \"two things\" Steve is holding back though on strategy. &nbsp;?</p>\r\n<p><strong>Misc</strong></p>\r\n<p>Good to hear TMVL is providing all the answers to House of Games.&nbsp; That\'s funny.</p>\r\n<p><strong>Hats</strong></p>\r\n<p>That reminds me, I need to add some code to show people with hats for their photos more often...</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>','Allan Sellers','2022-11-19 21:03:26',NULL,'QRM','Quick Updates & Responses'),(492,22,'<p>This time they asked where in the US is Denali?</p>\r\n<p>As Andy manages the Angry Wolves I had looked up where they were.</p>\r\n<p>Would anyone else know in which state you would find Denali?</p>','Roy Rolsten','2022-11-21 18:26:39',NULL,'NRP','Another HOG question'),(493,32,'<p>Roy,</p>\r\n<p>Denali is in Alaska. It\'s the name of the tallest mountain in North America, which was formerly known as Mount McKinley. Denali is also the name of the borough (similar to a county in the rest of the United States) in which the mountain is located.&nbsp;</p>','Jason Halpin','2022-11-22 06:01:12',NULL,'SPO','Denali'),(494,32,'<p>I\'m realizing now I completely misread Roy\'s post and thought he was actually asking where it is. Oops.</p>','Jason Halpin','2022-11-22 06:02:21',NULL,'SPO','Denali - Part 2'),(495,22,'<p>Denali is the native word for tall mountain. The Russians used to call it the big mountain.</p>\r\n<p>The word Sahara just means desert and the river Avon in the UK means river.</p>\r\n<p>The word kangaroo does not mean \'your finger\' but the Yucatan in Mexico does translate to \'I don\'t know what you mean\'</p>\r\n<p>Finally Canada means village, it\'s believed the first explorers knew this but still decided to refer to it as the Canadas region.</p>','Roy Rolsten','2022-11-22 17:47:20',NULL,'NRP','What\'s in a name?'),(496,5,'<p>All this talk and nobody answers the question...</p>\r\n<p>WHY ARE THE WOLVES ANGRY?</p>','Phil McIntosh','2022-12-03 23:56:27',NULL,'CC','Blah blah blah'),(497,5,'<p>Oh, I\'m sorry Micki. Did I overlook your hat comment?&nbsp;</p>\r\n<p>I\'ll say it again, slowly, so that everyone understands. MY hat is THE hat in TMVL. I actually own my hat. And I love all the attention it gets. If I fail to respond, it is because MY hat actually speaks for itself.&nbsp; And today it is telling me, \"tilt me forward a bit down toward the nose. I\'m feeling rowdy today.\"</p>\r\n<p>&nbsp;</p>','Phil McIntosh','2022-12-04 00:01:28',NULL,'CC','Hat'),(498,13,'<p>Oh, your actually wearing your hat today? I thought it was in your closet gathering dust.</p>','Micki McIntosh','2022-12-04 00:05:13',NULL,'ABQ','Hats 2.0'),(499,5,'<p>Well, of course I\'m not wearing my hat at this moment. Because I\'m cleaning bathrooms. Including YOUR bathroom. By the way, you are welcome and this situation is about to change!</p>','Phil McIntosh','2022-12-04 00:13:38',NULL,'CC','Hat'),(500,5,'<p>Well, of course I\'m not wearing my hat at this moment. Because I\'m cleaning bathrooms. Including YOUR bathroom. By the way, you are welcome and this situation is about to change!</p>','Phil McIntosh','2022-12-04 00:20:28',NULL,'CC','Hat'),(501,5,'<p>And, I actually own my hat. As opposed to someone who gets to wear their hat one day a year at the Mexican restaurant (or any other day of the year when she tells them it is her birthday to sneak a free dessert....she thinks they don\'t know, but Micki....THEY KNOW!!)</p>','Phil McIntosh','2022-12-04 00:23:50',NULL,'CC','Hat'),(502,13,'<p>Well, the thing is is that I wear my hat more often than you do! And they give free desserts because they like me better.</p>','Micki McIntosh','2022-12-04 08:58:56',NULL,'ABQ','Hats'),(503,13,'<p>And even if you claim that your hat is the hat of all hats (which is totally not true) mine still looks better. :)</p>','Micki McIntosh','2022-12-04 09:02:23',NULL,'ABQ','Hats'),(504,6,'<p>At the bottom left side of the Round of 32 WGM Cup Bracket we have this:</p>\r\n<p><img src=\"data:image/png;base64,\" alt=\"\" width=\"639\" height=\"336\" /></p>\r\n<p>-----------</p>\r\n<p>The first matchup has the Big East 1st Place <strong>Burlington Bullfrogs</strong> playing the ALSO 1st Place <strong>Sheboygan Vampire Bats.</strong></p>\r\n<p>Aires vs. John</p>\r\n<p>Mega matchup</p>\r\n<p>Recent quotes by these coaches include:</p>\r\n<p><strong>Aires</strong> - <em>Getting it done</em></p>\r\n<p><strong>John</strong> -&nbsp;<em>Once again, we\'re way too high</em> (is there a time machine involved and are the Bats following the Grateful Dead around the US?)</p>\r\n<p>-----------</p>\r\n<p>Then its Mad Max and the Crows versus Steve and the Tomatoes.</p>\r\n<p>Just as with the above...MEGA MATCHUP</p>\r\n<p>\"Rebuilding Steve\" won 3 titles two seasons ago and 2 this past season.&nbsp; Can he make that 4th seed work for him in this corner of the bracket?&nbsp;&nbsp;</p>','Allan Sellers','2022-12-09 04:33:57',NULL,'QRM','This part of the WGM Cup Bracket...'),(505,2,'<p>I noticed this as well. Doesn\'t bode well as we have never reached the semi-finals of the WGM.</p>','Steve Turner','2022-12-09 12:22:47',NULL,'CCT','Re: this part');
INSERT INTO `blog` VALUES (506,5,'<p>I have won. I have won the right to claim Micki\'s hat. Note the look of concession on her face. Winner!</p>\r\n<p>&nbsp;</p>\r\n<p><img src=\"data:image/png;base64,\" alt=\"\" /></p>','Phil McIntosh','2022-12-11 00:11:00',NULL,'CC','Winner'),(507,20,'<p>That looks like a significantly different hat to the one worn by Micki.</p>\r\n<p>It is smaller and less impressive.</p>\r\n<p>Therefore your claim is null and void.</p>\r\n<p>Micki is still the winner</p>','Craig Bucknall','2022-12-11 04:30:56',NULL,'DAL','Not Convinced'),(508,13,'<p>Just like Craig said, that hat is a much more insignificant than my hat is. Micki will be winner. Micki is always winner. Micki is winner. Micki also has money and is willing to bribe the waiter to make sure Phil\'s grubby hands stay off my hat.</p>','Micki McIntosh','2022-12-12 00:23:51',NULL,'ABQ','Hat Fraud'),(509,30,'<p>Winner, Winner, Taco Dinner?&nbsp; I think not. Micki\'s hat is far superior and substantial. I can\'t believe I am playing they McIntosh family this weekend. May the best hat win!</p>','Amy Sellers','2022-12-18 01:42:11',NULL,'TSS','Winner?'),(510,13,'<p>I notice that Phil has failed to challenge my authority to the best hat throne. He has finally given up on fighting for it, so I am the winner! (You can\'t see me, but I\'m gloating to Phil.)</p>','Micki McIntosh','2022-12-24 23:07:20',NULL,'ABQ','Superior'),(511,24,'<p>It\'s Christmas Day here in Australia so Merry Christmas to you all. Enjoy your presents, food and drink and family and friends. Remember it\'s a time of giving...so more wins to the Panthers please ??</p>','Matthew Fowler','2022-12-25 01:40:08',NULL,'KEN','Christmas '),(512,2,'<p>to wish everyone here a very happy Christmas.&nbsp;</p>\r\n<p>It\'s a 100 minutes away from Christmas Day here as I type and we\'re just getting stuff out of the hiding places for the kids for tomorrow. We always hope for an early night but never get to bed before midnight.</p>','Steve Turner','2022-12-25 03:41:34',NULL,'CCT','My Turn...'),(513,2,'<p>Asleep by 1 AM if I\'m lucky. Awake at 6 AM I expect.</p>','Steve Turner','2022-12-25 05:19:41',NULL,'CCT','Still up'),(514,12,'<p>It\'s just past 10pm on Christmas Day here in the UK, and what better way to round off the day than getting Al\'s email to say results are in. Thanks Al ?</p>\r\n<p>Hope you all have had / are having / will have a great day. The weather in the States looks scary (if a little cool compared to the drab rainy grey day we\'ve had in the middle of England.&nbsp;</p>\r\n<p>Steve - hope you got a bit of a lie-in. I\'m glad my kids are all grown up, and not only sleep in but cook the dinner too ?</p>','Roger Mendonça','2022-12-26 03:12:48',NULL,'PPP','Thanks Al'),(515,23,'<p>Like Roger, grown up kids so we took a back seat at Christmas, nothing more energetic than throwing the grandkids around a bit. &nbsp;Getting old has its benefits</p>','Paul Cockayne','2022-12-26 21:07:48',NULL,'POR','A relaxed Christmas'),(516,20,'<p>I must say I LOVE Christmas. Definitely my most favourite time of the year.</p>\r\n<p>Not only do you get presents, which is ace (yes, I am 12), but it is enforced relaxation with the family whilst eating and drinking too much.</p>\r\n<p>It\'s also one of the only times of the year that family will play a board game with me.....but this year we didn\'t!! Booooo</p>','Craig Bucknall','2022-12-30 16:44:25',NULL,'DAL','Christmas'),(517,10,'<p>Those on the national championship tournament bubble will have an eye on two matches: #5 Mat-Su v #2 Tucson in the Pac 8 and #3 Teutopolis v #1 Baton Rouge as well as the WGM Cup Final as San Jose play Columbia.</p>\r\n<p>The winners of all these games clinch a spot in the national tournament.</p>\r\n<p>Mat-Su and San Jose are currently on the wrong side of the bubble while Tucson and Teutopolis are on the \"right\" side.</p>\r\n<p>The Mat-Su/Tucson winner will clinch a spot and with Mat-Su having a difficult schedule they probably need a win while a win would probably be enough for Tucson to get an at-large bid anyways but would still cement them in the tourney.</p>\r\n<p>Same goes for Teutopolis - a win would secure their spot but would also basically clinch an at-large bid.</p>\r\n<p>San Jose though are just off the pace and could would slide into the field with a win over Steve\'s Columbia in the final - another situation where the standings are so close a win would probably launch them into the at-large conversation anyways.</p>\r\n<p>This leaves Mat-Su as the one \"true\" bid thief.</p>','John Holden','2023-01-02 03:09:19',NULL,'SVB','Bid Thieves (spoilers)'),(518,23,'<p>Following a quiet Christmas, more quiet at the new year. &nbsp;A birthday to contend with though I find that I am counting in fives thses days. &nbsp;Next year (or strictly, this year), I may be forced to admit to being old....or can I push \"late middle age\" out until I hit 75?</p>','Paul Cockayne','2023-01-02 17:45:43',NULL,'POR','...and a quiet new year'),(519,18,'<p>First of all, ouch...a thief?!</p>\r\n<p>Second of all, on an unrelated note I just bought some of the quietest shoes ever and a nice black turtleneck.</p>','Bryce Kalmbach','2023-01-04 11:16:34',NULL,'MSM','Re: Bid Thieves'),(520,28,'<p>Big session for the little shrimp underdogs this week as we face the Tomato Beasts of TMVL who rolled over some tough opposition in the Anglerfish away from home 3-0 to reach the WGM Cup Final. Now they are at home in the final and have better players than us in every position. It is not looking good is it, but the Shrimps have pushed above their weight to get here, beating both Denali and Cincinnati on the road to get this far. We should probably just enjoy the day and now concentrate on winning more achievable games this session as the Tomatoes have already vowed to put out their top dogs. Probably we should, but it is the final and the Shrimps do like a good scrap.....................</p>','Vick Hall','2023-01-07 16:02:20',NULL,'SJS','Tomato Showdown'),(521,12,'<p>Despite valiant resistance from Vick\'s Shrimps, Big 8\'s Columbia took the WGM Cup last session. At the same time, Dallas topped the Non Conference, closely followed by Ames and Portland in joint second place. In fact the eight Big 8 teams occupied the top 13 places in the NC table.</p>\r\n<p>Looking ahead, Quincy are the top rated team left in the Cup. Despite the presence of a lot of top teams, Columbia must be clear favourites for the Shield. Quincy are #1 seed for the National Championship and Portland #1 seed for the Holyoke. What odds for a Big 8 clean sweep this season?</p>','Roger Mendonça','2023-01-08 16:42:50',NULL,'PPP','Big 8 Big Time'),(522,30,'<p>To keep this fair, no names will be specified. &nbsp;Need to settle a family dispute. A friend recently got a Dachshund puppy (very adorable) in the U.S. they are sometimes called \"wiener dogs\". One of us said to the other \"in the U.K. They are called \"sausage dogs\". The other disagreed stubbornly and vehemently. Then in an Episode of Derry Girls there was a reference to \"sausage dogs\", thereby proving that person correct, but the other still disagreed and suggested we bring it to the blog for an answer. Who is right?&nbsp;</p>','Amy Sellers','2023-01-10 08:19:18',NULL,'TSS','Need UK friends to clarify an argument'),(523,31,'<p>Sausage would be the correct term in Britain. Weiner isn\'t a thing here.</p>','Colin Scott','2023-01-10 14:51:00',NULL,'AMA','Dugs'),(524,30,'<p>Thank you for your prompt response.&nbsp; If I had to guess, I would think that perhaps the large number of German immigrants to the U.S. probably had something to do with us using the term \"weiner\"&nbsp;</p>','Amy Sellers','2023-01-11 02:30:50',NULL,'TSS','Thanks Colin!'),(525,23,'<p>...are definitely called sausage dogs in the UK. &nbsp;This is not, as is commonly thought, because they resemble a sausage but because they are about as affectionate as a frozen sausage.</p>','Paul Cockayne','2023-01-11 04:15:06',NULL,'POR','Silly animals with ridiculously small legs...'),(526,28,'<p>sausage dogs is certainly how thy are known on this side of the pond</p>','Vick Hall','2023-01-12 17:53:46',NULL,'SJS','sausage dogs'),(527,30,'<p>Thank you for confirming that I was right. I had heard it a couple of times, but Allan would not believe me and was kind of stubborn about it. It was his suggestion that we consult the UK experts. I told him now he should get me a sausage dog since I was right.&nbsp; Just kidding, I have a few friends with them and I have heard in general that they can be quite stubbon and don\'t listen.</p>','Amy Sellers','2023-01-13 04:42:58',NULL,'TSS','Sausage dogs!'),(528,20,'<p>Bulldogs are the best. Fact.</p>\r\n<p>I have a French Bulldog and she is very funny.</p>\r\n<p>Our next dog will be a English Bulldog - mega lazy so we\'ll get on well :)</p>\r\n<p>Don\'t forget that Bulldogs are also the BEST at volleyball. This is also a fact.</p>','Craig Bucknall','2023-01-13 19:50:17',NULL,'DAL','Dogs'),(529,20,'<p>Urgh, do I not like that.</p>\r\n<p>My post should read \'an\' English Bulldog not \'a\'.....it\'s because I typed British Bulldog the first time</p>','Craig Bucknall','2023-01-13 19:52:08',NULL,'DAL','Grammar'),(530,10,'<p>There\'ll definitely be room for the Saint Donatus (Iowa) Sausage Dogs (San Diego is taken)</p>\r\n<p>More importantly the Sausage Dogs would feature in the Sandwich Cup (mascots which when combined would make good sandwiches), especially when they would play New Orleans, which might be the top delicacy in TMVL.</p>','John Holden','2023-01-14 00:36:15',NULL,'SVB','When the league expands again'),(531,32,'<p>If we\'re going to add a Sandwich division, we\'re going to need some cheese-based mascots.</p>\r\n<p>Also, did John just call a hot dog a sandwich? Be careful wading into that debate.</p>','Jason Halpin','2023-01-14 01:06:46',NULL,'SPO','Sandwiches'),(532,28,'<p>The city of San Jose has banned prawn sandwiches. We don&acute;t want to be compared to old trafford.</p>','Vick Hall','2023-01-14 02:40:07',NULL,'SJS','Banned'),(533,24,'<p>In Volleyball the ball goes over the net</p>\r\n<p>In Basketball the ball goes through the net</p>\r\n<p>In Football (Soccer) the ball goes into the net</p>\r\n<p>In Baseball the net stops the crowd behind the batter getting hit.</p>\r\n<p>In Fishing there is constantly a hole in the net so the fish keeps escaping ?</p>','Matthew Fowler','2023-01-14 04:12:56',NULL,'KEN','Nets'),(534,10,'<p>During expansion, I really should have pitched the Leicester Roquefort as a bona fide internet volleyball team.</p>','John Holden','2023-01-14 18:50:14',NULL,'SVB','Cheese-based mascots'),(535,30,'<p>I am sure we could find some difficult to pronounce towns in Wisconsin that could be Cheese towns, like Mukwanago Muensters.&nbsp;</p>','Amy Sellers','2023-01-14 23:41:58',NULL,'TSS','Cheese Based Mascots'),(536,16,'<p>New Year: when does it stop being new?&nbsp; It could be when you wish the last person Happy New Year, as I have been told.&nbsp; But you would never know when that was, would you? And what if you met somebody you hadn\'t seen for three years? Happy New Year, Happy Previous New Year &amp; Happy New Year Twice Removed? And what if you met somebody you hadn\'t seen since school 45 years ago.&nbsp; Ridiculous</p>\r\n<p>Actually I really wanted to respond to Paul Cockayne\'s point about middle age and being old.&nbsp; Nobody really wants to be old or at least to be called old do they?&nbsp; And yet Society reinforces the message that you are old all the time.&nbsp; I have been receiving my UK state pension for a few months - widely referred to as the old age pension which makes me an OAP - Old Age Pensioer.&nbsp; When I turned sixty, I was initially chuffed to find that lost of places - cinemas, atttractions small &amp; large etc - offer a discount.&nbsp; Except that for sometimes a tiny benefit - say 80p off your &pound;9 admission - you have to state your elderliness to some ticket seller who then, disbelieving, asks how old you are before disdainfully allowing the pathetic reduction.&nbsp; And then there\'s the place in many forms when \"for analysis purposes\" you have to state which aged band you are in.&nbsp; There is no consistency in what these ranges are but the cruellest has to be, for example, under 20, 20-40, 40-65, 65+.&nbsp; That + is code for \"really old\" isn\'t it?</p>','Martyn Hathaway','2023-01-15 11:43:24',NULL,'SCC','...and a quiet new year'),(537,12,'<p>Last session I confidently predicted Quincy to win the Cup, Columbia the Shield and Portland the Holyoake. Clearly Al isn\'t the only one with the power ? &nbsp;Although I\'m not sure what went wrong with the Championship....</p>','Roger Mendonça','2023-01-15 17:55:22',NULL,'PPP','Kiss of death?'),(538,23,'<p>As I approached 65, I wet for a rare haircut, and was asked if I was entitled to a discout. &nbsp;The very thought! &nbsp;What an insult!</p>\r\n<p>At my next haircut, I was asked the same question. &nbsp;How wonderful! &nbsp;What a compliment!&nbsp;</p>','Paul Cockayne','2023-01-16 01:31:36',NULL,'POR','Getting Old'),(539,24,'<p>Hole in One in Golf is Good</p>\r\n<p>Hole in the ground can be good and bad</p>\r\n<p>Hole in the bucket is not good</p>','Matthew Fowler','2023-01-16 10:53:53',NULL,'KEN','Holes'),(540,23,'<p>Hole in the head I don\'t need</p>\r\n<p>Hole in the toad is the wrong way round</p>','Paul Cockayne','2023-01-16 13:20:25',NULL,'POR','More Holes'),(541,2,'<p>I bet that gets the Americans googling.</p>','Steve Turner','2023-01-16 14:30:50',NULL,'CCT','Re: holes and toads'),(542,2,'<p>There is such a thing as toad in a hole in the US of A but that is just an egg fried in a slice of bread/toast that has a hole in it.</p>','Steve Turner','2023-01-16 20:15:46',NULL,'CCT','My mistake'),(543,24,'<p>A Panther is actually a jaguar or leopard</p>\r\n<p><strong>The Panther is a stealthy hunter</strong></p>\r\n<p><strong>Panthers are incredibly quick and strong</strong></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>','Matthew Fowler','2023-01-24 03:01:17',NULL,'KEN','Panthers'),(544,2,'<p>Tomatoes can be considered a fruit and a vegetable - we\'re crazy that way.</p>\r\n<p>Tomatoes don\'t hunt but just hang around waiting for the time to be ripe.</p>','Steve Turner','2023-01-24 17:52:05',NULL,'CCT','Tomatoes'),(545,23,'<p>Beware of lumberjacks, they swing in all directions.... &nbsp;</p>','Paul Cockayne','2023-01-31 05:32:03',NULL,'POR','Lumberjacks'),(546,31,'<p>A friend of mine was telling me how he had fallen out with a work colleague at Tesco while were chatting over a pint in the pub. One of the local hard men overheard us and asks my friend who the guy at work is and when the name is revealed the goon says he knows him too and he would sort him out for a pound. A pound? my friend asks. Aye, says big Arty, I normally charge more but seeing as I don\'t like him I\'ll do it for a pound. My friend hands over the pound and I go up the road.</p>\r\n<p>Turns out big Arty did sort the guy out. He turned up at his place of work and throttled the poor guy. He then saw two folk watching and to avoid any witnesses he throttles them too.</p>\r\n<p>I only know this information from what I read in the local newspaper which had the headline</p>\r\n<p><strong>BIG ARTY CHOKES 3 FOR A POUND IN TESCO</strong></p>','Colin Scott','2023-01-31 15:15:29',NULL,'AMA','My friend'),(547,20,'<p>Firstly, name the reference in my subject ;)</p>\r\n<p>Secondly, a bit late in the day now but just remember for next season to have at least a loose idea of what you need to do to max out your budding stars of tomorrow with CP use.</p>\r\n<p>I\'ve royally cocked mine up.</p>\r\n<p>All I did, as far as planning its use, was think back to last season where I had CP to burn and found myself trying to find where to spend them in the last couple of sessions.....so based on that, I decided to burn a load of CP on FIT this season and as a result I won\'t max out some of my star players.</p>\r\n<p>Imbecile.</p>','Craig Bucknall','2023-02-02 15:18:21',NULL,'DAL','Drat and Double Drat'),(548,2,'<p>Without googling I\'d say Dick Dastardly.</p>\r\n<p>I did the same thing with my freshman right-side.&nbsp; Too late I realised there weren\'t enough sessions to fill all the slots I wanted.</p>\r\n<p>It\'s a fine balance between coaching players and Fit. I decided not to coach my junior OH and save the CP for Fit. Next season he\'ll be my 3rd OH anyway and was never going to be a superstar.</p>','Steve Turner','2023-02-02 15:45:45',NULL,'CCT','Drat and double drat'),(549,31,'<p>Aye, I&rsquo;ve done something similar myself this season. Too late to fix it now and gives me a challenge next season.</p>','Colin Scott','2023-02-03 01:22:53',NULL,'AMA','Whacky Races'),(550,20,'<p>Both Colin and Steve are spot on - Dick Dastardly said \'drat and double drat\' in Whacky Races.</p>\r\n<p>So, for those who remember Whacky Races....who was your favourite?</p>\r\n<p>Mine were the cavemen...soz, can\'t remember their actual names but I\'m sure you know who I mean :)</p>','Craig Bucknall','2023-02-04 01:20:25',NULL,'DAL','Correct and Question to All'),(551,24,'<p>I believe their names were and I\'m happy to be corrected but Captain Caveman and Son ring a bell.</p>','Matthew Fowler','2023-02-04 04:40:19',NULL,'KEN','Wacky Races'),(552,22,'<p>Muttley was my favourite character and I think I did want Dick Dastardly to win at least once.</p>\r\n<p>I quite liked the Ant Hill Mob.</p>\r\n<p>The Slag brothers Rock and Gravel drove the Boulder Mobile and they were the inspiration for Captain Caveman</p>','Roy Rolsten','2023-02-04 05:58:23',NULL,'NRP','Wacky Races'),(553,30,'<p>Why, Oh Why on this last weekend of the season do I have to face the two youngsters (Micki and Max) that I root for when we are not playing against one another?</p>','Amy Sellers','2023-02-04 22:20:12',NULL,'TSS','Why, Oh Why?'),(556,15,'<p>Demonstrating why the SEC is the best TMVL conference!&nbsp;</p>','Mike Halpin','2023-02-06 01:20:40',NULL,'BRB','Congrats, Co-conference Champions, New Orleans!'),(557,2,'<p>I think with the National Champions, the WGM champion, 2 of the top 3 NET/ELO/Overall standing as well as 1st and two 2nd= in the non conference BIG 8 has a food claim for the best conference.</p>','Steve Turner','2023-02-06 03:33:33',NULL,'CCT','SEC the best?'),(558,6,'<p>In a TMVL first, we have a 4-way tie for conference champions.</p>\r\n<p>Santa Clara, Tucson, San Jose, and Albuquerque (I\'ve been to 2 of these cities; its not a competition) all finish at 8-6 and will each a conference co-champions title!</p>\r\n<p>WOW!</p>','Allan Sellers','2023-02-06 05:19:18',NULL,'QRM','(Spoiler) - Congratulations Micki, Amy, Martyn, and Vick!'),(559,20,'<p>You can\'t shout spoiler then congratulate those involved in the same subject heading lol :)</p>\r\n<p>It would mean reading the word spoiler then immediately averting your eyes.</p>\r\n<p>Only my eyes roll that fast</p>','Craig Bucknall','2023-02-06 14:25:25',NULL,'DAL','You Can\'t.....(spoiler)'),(560,6,'<p>Congratulations to James Tucker on winning the BIG EAST!</p>\r\n<p>Oh and I like this SEC vs. BIG 8 rivalry between Senator Halpin and Olmec Steve! &nbsp;?</p>','Allan Sellers','2023-02-07 05:11:52',NULL,'QRM','Congratulations JT! (Am I doing it right CB?) Oh...Spoiler!'),(561,20,'<p>...you\'re not (doing it right).</p>\r\n<p>I recommend stopping posting spoliers.</p>\r\n<p>It is beyond you.</p>\r\n<p>Put the keyboard down and just stick to buttering up the Olmec Gods and delivering Kiss of Death quips as these are two areas you excel in.</p>\r\n<p>Rolls eyes</p>','Craig Bucknall','2023-02-08 16:22:21',NULL,'DAL','Of Course....'),(562,23,'<p>I like spoilers, it saves time, and it\'s always nice to be spoilt occasionally</p>','Paul Cockayne','2023-02-11 13:51:41',NULL,'POR','Spoilers (not a spoiler)'),(563,30,'<p>Micki kicked my butt in our final match, and that meant that we were part of a four-way tie for first in the PAC 8!&nbsp;</p>','Amy Sellers','2023-02-11 22:01:32',NULL,'TSS','GIRL POWER!!');
