CREATE TABLE `recruits` (
  `id` int NOT NULL AUTO_INCREMENT,
  `season` int DEFAULT '1',
  `source` varchar(1) DEFAULT 'R',
  `session` int DEFAULT '0',
  `lot` int DEFAULT '0',
  `type` char(1) DEFAULT 'P',
  `stars` int DEFAULT '0',
  `position` char(2) DEFAULT '',
