  `last_name` varchar(20) DEFAULT NULL,
  `min_points` int DEFAULT '0',
  `winning_points` int DEFAULT '0',
  `team_id` int DEFAULT '0',
  `serve` int DEFAULT '0',
  `receive` int DEFAULT '0',
  `attack` int DEFAULT '0',
  `block` int DEFAULT '0',
  `defense` int DEFAULT '0',
  `setting` int DEFAULT '0',
  `age_int` int DEFAULT '0',
  `max_sl_player` varchar(1) DEFAULT 'N' COMMENT 'used to identify if there will be any max used. default is N',
  `max_sl` int DEFAULT '0' COMMENT 'used for identifying if this is an elite player.\n0 is default. max_sl_player must be set to Y. ',
  `max_sl_attribute` varchar(3) DEFAULT NULL COMMENT 'used to identify the attribute the will be maxed out. Possible values: (blank/null), srv, rcv, blk, atk, def, set',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=105 DEFAULT CHARSET=latin1;
